(43, 163, 'SkyPoint Climb', '', 0, '', 'Logo-0113201711112017.jpg', 'For sweeping views of the greater Surfers Paradise region, climb atop Australia''s highest external building and one of Queensland''s most recognised land marks; the Q1 Tower with SkyPoint Climb. Rising to an impressive 270 metres the SkyPoint Climb is a 90 minute adventure from beginning to end and is a definite must for visitors to the region. Providing unmatchable views of the region, the peak of Q1 will give you views stretching over the coastline and over to the Gold Coast Hinterland.', NULL, NULL, 'SkyPoint, Surfers Paradise, Queensland, Australia', '-28.0061', '153.42949999999996', '', NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/skypoint', 'https://twitter.com/SkyPoint_AU', 'https://www.instagram.com/skypoint_au/', 'https://www.skypoint.com.au/', 'https://facetag.experienceoz.com.au/en/gold-coast/attractions/skypoint-climb', NULL, '61755822700', 'info@skypoint.com.au', NULL, NULL, NULL, NULL, NULL, '0.00', 2, 2, 12, '2016-12-05 03:52:28', '2017-01-13 11:22:21', 2, 1, 1, 0),
