(171, 429, 'Test Account Pty Ltd', '1234567890', 1, '1234567890', 'Logo-0206201708080000.jpg', 'Average User Rating:              \r\nCurrumbin Wildlife Sanctuary on the Gold Coast has long been one of the most popular attractions in south-east Queensland, and it isn''t hard to see why. With great prices on tickets for the huge array of things to do, Currumbin Sanctuary offers one of the best value days out for families and individuals alike! Get up close with a ton of the best and cutest native Aussie and exotic wildlife at the many interactive displays and wide-open enclosures, while walking amongst the lush, comfortable eucalyptus and rainforest environments.\r\n\r\nAll your animal favourites are here; you can cuddle up to and have your photo taken with a koala, get up close with crocodiles, hand-feed the many friendly kangaroos and much, much more. Be sure to stay around for the daily Rainbow Lorikeet feeding - one of the main attractions - with two demonstrations in the morning from 8am and afternoon from 4pm!\r\n\r\nBuy your Currumbin Wildlife Sanctuary tickets here to visit this ever-popular zoological facility that is located on the Gold Coast Highway at Currumbin, around 5 minutes from Gold Coast Airport and approximately 20 mins from Surfers Paradise. Open 364 days a year (except Christmas), pay a visit to Currumbin Wildlife Sanctuary today - you won''t be disappointed.', NULL, NULL, 'Gold Coast Hotel and Casino Las Vegas, West Flamingo Road, Las Vegas, NV, United States', '36.1165742', '-115.19159669999999', '', NULL, NULL, NULL, NULL, NULL, '', '', '', '', '', NULL, '', 'colin.bland@facetag.com.au', '0', 'test', '<500', '<500', 'forsale', '10.00', 1, 1, 1, '2017-02-05 20:40:00', '2017-02-27 04:10:23', 0, 1, 1, 0),
