(173, 448, '1770 Lark Tours', NULL, 0, '', 'Logo-0304201706061109.png', 'Spend part of your afternoon exploring the gorgeous 1770 region aboard Larc''s iconic pink submersible vessel. Transitioning from the road to water with ease you can see the best of the region from the best seat in the house. The 1-hour tour kicks off in the mid to late afternoon, just in time to chase the sun as it goes into hiding to signal the end of another day. Crossing the Southern Great Barrier Reef''s Round Hill Creek and travelling along the Eurimbula National Park coastline, you''ll see the sea and sky transform from the vibrant, bright colours it reflects in the day to the pastel, dreamy tones it presents in the evening.\r\n\r\nLed by experienced tour guides you''ll learn all there is to know about the region including its rich history as the Birthplace of Queensland. Be sure to keep your eyes peeled and have your camera at the ready as local wildlife also enjoy this time of day. If you''re lucky, you might get the chance to see some kangaroos, sea eagles, turtles, dolphins or stingrays to name a few.\r\n\r\nThere are two departure times in the afternoon, however these are subject to change depending on tidal times and conditions and School Holiday periods.', NULL, NULL, '535 Captain Cook Drive, Woolooware, New South Wales, Australia', '-34.0391354', '151.13863179999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/1770Larc', 'https://twitter.com/1770larc', 'https://www.instagram.com/1770larc/?ref=badge', 'http://www.1770larctours.com.au', 'https://facetag.experienceoz.com.au/en/1770/tours/1770-larc-duck-tours', NULL, '610749749422', 'info@1770larctours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 00:41:09', '2017-03-04 06:11:09', 2, 1, 1, 0),
(174, 449, 'Whitsundays Tallship Cruise and Snorkel Tour', NULL, 0, '', NULL, 'Explore the Whitsundays a little differently with a full day adventure aboard ""Derwent Hunter"" - a real Australian Tall Ship! Leaving from Abell Point Marina at 8.30am and returning at around 4.30pm, you''ll have the opportunity to sit back, relax and really take in the wonder of this iconic part of Australia. Included in this unique adventure is a snorkelling experience at Langford Reef as well as Bali Hai. Boasting the only sand cay in the Whitsundays, guests can climb on to the beach and enjoy easy snorkel access to Langford Reef from the sand. The second snorkelling location - Bali Hai, is a secluded beach surrounded by crystal clear waters. With an assortment of vibrant corals, and unique fish species waiting to be discovered at each location, your eyes are in for a real treat.\r\n\r\nTo ensure a hassle free experience, morning and afternoon tea, lunch, snorkelling equipment and marine park fees are covered in the price of the tour. However, if you do wish to enjoy a glass of wine or beer whilst sailing, purchases can be made from the licensed bar on board at guests expense. For the perfect day out on the reef, this is it. Purchase your voucher today and experience the magic of the Whitsundays aboard a tall ship!', NULL, NULL, 'Abell Point Marina, Barcelona Restaurant, South Village, Airlie Beach QLD 4802', '-20.267031', '148.711345', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://tallshipadventures.com.au/', 'https://facetag.experienceoz.com.au/eN/Airlie-beach/cruises/whitsundays-tallship-cruise-and-snorkel-tour/derwent-hunter-full-day-adventure', NULL, '610749467124', 'office@tallshipadventures.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 00:43:38', '2017-03-04 06:13:38', 2, 1, 1, 0),
(175, 450, 'Jungle Surfing Day Tour from Cairns', NULL, 0, '', NULL, 'Experience this unique jungle adventure from Cairns for a day filled with fun and thrill. Jungle Surfing is great for all ages and will let you fly through the trees while connected to flying fox zip lines to give you that free yet safe feeling. Stopping at five platforms high in the top canopy of the rainforest, you''ll get to experience some spectacular views stretching out to the Great Barrier Reef. Jungle surfing is a great explorative activity that combines sightseeing with pure fun and is a great way to experience the best of the Daintree Rainforest - on this tour, you''ll be picked up from your Cairns accommodation and head out to Cape Tribulation, heading into the heart of the Daintree on a river cruise down its serene waters before harnessing up and ascending to the treetops where the true fun begins!\r\n\r\nJungle surfing will see you zipping from one platform to the next, providing unmatched views of all the rainforest''s most impressive wonders such as crystal clear streams, wildlife-rich tree canopies, and the stunning waters of the reef out in the distance. Your knowledgeable guides will accompany you throughout the journey, providing informative and entertaining insight as to the workings of the Daintree Rainforest and its delicate and ancient ecosystem. Cap it all off with a delicious picnic lunch amongst these lush rainforest surrounds AND entry to popular attraction The Wildlife Habitat where you''ll get up close with some wonderful native animals, and you''ve got the ultimate Daintree Rainforest tour - with a difference', NULL, NULL, '24 Camelot Close, Cape Tribulation, Queensland, 4873, Australia', '-16.0880007', '145.45955370000001', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/junglesurfing/?fref=ts', '', 'https://www.instagram.com/junglesurfing/', 'http://www.junglesurfing.com.au/tours/go-jungle-surfing-full-day-tour/', 'https://facetag.experienceoz.com.au/en/cairns/tours/jungle-surfing-day-tour-from-cairns/jungle-surfing-day-tour-from-cairns', NULL, '610740980043', 'info@junglesurfing.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:14:58', '2017-03-04 10:44:58', 2, 1, 1, 0),
(176, 451, 'Herberton Historical Village Full Day Tour', NULL, 0, '', 'Logo-0304201710104949.png', 'Discover Australia''s rich pioneering history with this full day tour to the award winning Herberton Historical Village. Here you''ll have the opportunity to fully immerse yourself, with a visit to Kuranda Lookout, Barron Falls, and the iconic Bridges Cafe all included. Visitors will enjoy a guided tour of Herberton Historical Village, before sitting down for an old-fashioned cooked lunch in preparation for an afternoon of non stop adventure and sightseeing. After lunch you can ride the Tinlander Train before climbing back on the bus to follow the highway through the scenic Crater Valley and Herberton Ranges to Mt Hypipamee. Here you''ll have the opportunity to discover the hidden truths of the areas rich Indigenous history, as well as the timber, railway, war, dairy and mining industries of the early pioneers. To conclude the tour, you''ll witness the lush rainforests of Gillies or Kuranda ranges as the bus makes its way back to your accommodation in Cairns.\r\n\r\nWith all entry fees, bottled water, morning tea and lunch all included in this great tour, all you need to bring is some comfortable walking shoes, your camera and an open mind ready to be mesmerised by Herberton! This family friendly tour is perfect for all ages, and a great way to introduce children to Australia''s rich pioneering history. With the assistance of your informative and friendly tour guide, you''ll walk away feeling enriched by the precise details and information this tour presents to you', NULL, NULL, '6 Broadway St, Herberton QLD 4887', '-17.3742788', '145.3844375', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/HistoricVillageHerberton', '', '', 'http://www.historicvillageherberton.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/tours/herberton-historical-village-full-day-tour/full-day-australian-heritage-tour', NULL, '610740962002', 'info@historicvillageherberton.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:19:49', '2017-03-04 10:49:49', 2, 1, 1, 0),
(177, 452, 'Aquaduck Land and Water Adventure', NULL, 0, '', 'Logo-0304201710105001.jpg', 'One of the Gold Coast''s most popular tours, the Aquaduck in Surfers Paradise allows you to discover the Gold Coast by land and sea without even leaving your seat! Your return journey will begin in the heart of Surfers Paradise, taking in views of the famous, golden Gold Coast beaches while waddling along the beachfront. The tour then heads past the 5 star resorts of Palazzo Versace and the Sheraton Mirage before ducking straight into the magnificent Broadwater at the Spit where the water-borne portion of the tour begins.\r\n\r\nThe vehicle then ""transforms"" into a boat as the Aquaduck goes harbour cruising, taking in the sights of Seaworld, Marina Mirage, Australia Fair, Mariners Cove, The Yacht Club, fabulous millionaires homes, canals and more from the water! With entertaining, fun commentary on all the highlights and the ability to see the best of the Gold Coast from all available angles, the Aquaduck is one of Surfers Paradise''s true ""must do experiences"" - plus, don''t forget kids get to drive and receive their FREE Captain Aquaduck license certificate! A family friendly and relaxed way to see the Gold Coast''s main highlights, get quacking and book a duck tour online today.', NULL, NULL, '36 Cavill Avenue, Surfers Paradise, QLD, 4217, Australia', '-28.0019838', '153.42786639999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/AquaduckTours/', '', '', 'http://www.aquaduck.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/cruises/aquaduck-safaris/aquaduck', NULL, '610755390222', 'Aquaduck@optusnet.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:20:02', '2017-03-04 10:50:02', 2, 1, 1, 0),
(178, 453, 'Cruise Whitsundays', NULL, 0, '', NULL, 'Want one of the most unforgettable Whitsundays experiences? Book a Reefsleep package! Spend a night under the stars on the Great Barrier Reef with this amazing overnight cruise tour package in the Whitsundays that spans two unforgettable days. One of the ultimate reef adventures, you''ll get to take part in cruising, snorkelling, swimming and diving on the pristine and wildlife-rich waters of one of the world''s natural wonders. Departing in the early morning on the first day, you''ll begin the reef adventure with semi-sub rides and fish viewing from the underwater observatory and soak up some sun on the spacious deck.\r\n\r\nRevel in the tranquility of the watery surrounds in the evening as you enjoy a delicious gourmet BBQ with your fellow guests and watch as the marine world comes alive right in front of you before bunkering down for the night and gazing up at the stars in the crystal-clear night sky. Kick off day 2 with a hearty breakfast and then take part in all of the previous days'' activities that you missed! Spend the night in a traditional Australian ""swag"" available in King Single or Double. For the best of the Great Barrier Reef by both day and night, book this Reef Sleep overnight cruise package online today.', NULL, NULL, 'Hardy Reef, Great Barrier Reef, Airlie Beach QLD 4802', '-19.745641', '149.182671', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'https://www.cruisewhitsundays.com/great-barrier-reef-experiences/reefworld/', 'https://facetag.experienceoz.com.au/eirlie-beach/cruises/spend-a-night-under-the-stars-on-the-great-barrier-reef/reefsleep', NULL, '611800426403', 'info@cruisewhitsundays.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:20:53', '2017-03-04 10:50:53', 2, 1, 1, 0),
(179, 454, 'Breakfast with the Koalas at Hartleys Crocodile Adventures', NULL, 0, '', NULL, 'Spend your morning surrounded by beautiful scenery and accompanied by some furry friends with Hartley''s Crocodile Adventures'' Breakfast with the Koalas. Seated on Lilies Restaurant''s deck, you''ll overlook Hartley''s Lagoon for a relaxing start to your day. You can enjoy a cooked breakfast with sides of toast, fruit, tea, coffee or juice as you overlook the park, taking in its beautiful atmosphere. From 9am until 9:30am one of Hartley''s friendly and experienced keepers will come say hello with a furry and sleepy koala friend. This is a wonderful opportunity to get up close to one of Australia''s most loved and renowned animals and ask the keeper as many questions as you want about their lifestyle and what it''s like to care for these animals. In addition to seeing the koala, you can cuddle up to it and have your photo taken for an extra fee ($20).\r\n\r\nFollowing breakfast and your interaction with the koala, you''ll embark on a boat cruise along Hartley''s Lagoon as well as receiving access to all of the presentations on offer at Hartley''s Crocodile Adventures. Upon arrival at the sanctuary you will be allocated a cruise time, ensuring you don''t miss out on any of the days activities. Guests are asked to bring comfortable walking shoes as well as sun safety clothing and accessories, cameras, extra food and drinks for later in the day and extra money if you wish to purchase souvenirs from the gift shop. This is a wonderful way to get up close to a range of Australian animals, most importantly the koalas. Perfect for the entire family and kids of all ages with children 3 years and younger entering free of charge', NULL, NULL, '40 Horseshoe Bay Rd, Horseshoe Bay QLD 4819', '-19.1212202', '146.862808', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/BungalowBayYHA', '', '', 'http://www.bungalowbay.com.au/breakfast-with-the-koalas/', 'https://facetag.experienceoz.com.au/en/cairns/activities/breakfast-with-the-koalas-at-hartleys-crocodile-adventures/breakfast-with-the-koalas', NULL, '610747785577', 'info@bungalowbay.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:23:42', '2017-03-04 10:53:42', 2, 1, 1, 0),
(180, 455, 'SouthernCross4WDTour', NULL, 0, '', 'Logo-0304201710105402.png', 'Explore secluded trails to experience the beauty and spectacular scenery of remote parts of the Gold Coast Hinterland, accessible only by 4WD. You will be taken well off the beaten track to live the life of an adventurer for a day. Lose yourself in the sub tropical rainforests of the World Heritage Listed Lamington and Tamborine National Parks, seeing places few tread. However, these tours also visit all the popular attractions, so you get the best of both worlds.\r\n\r\nVisit nature''s bounty, see her beautiful waterfalls, fern fringed, mossy streams, swim in rock pools, spot wildlife, view sweeping mountain panoramas, take in the magnetism of walking tracks under the canopy of ancient rainforests. See glow worms, feed birds, taste vineyards produce, walk O''Reillys Canopy Boardwalk, visit Hinterland villages, become an expert whip cracker, and boomerang thrower.', NULL, NULL, '5/3078 Surfers Paradise Blvd, Surfers Paradise QLD 4217', '-28.0046959', '153.4286814', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/SouthernCross4WDTours/?ref=page_internal', 'https://twitter.com/hinterland_tour', '', 'http://sc4wd.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/tours/gold-coast-rainforest-4wd-tours', NULL, '610755745041', 'tours@sc4wd.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:24:02', '2017-03-04 10:54:02', 2, 1, 1, 0),
(181, 456, 'Scenic Hinterland Day Tours', NULL, 0, '', 'Logo-0304201710105835.png', 'These Gold Coast hinterland day tours will let you experience this untouched gem that provides a refreshing, natural break from the normal expectations of glitz and glamour that is just waiting to be explored! Behind the Gold Coast''s amazing beaches, city skyline and meandering waterways lies an impressive range of rolling hills and hinterland mountains. Visit the Gold Coast''s best kept secrets with these award winning Gold Coast hinterland day tours that will take you to some of the most verdant, lush and visually striking displays of waterfalls, rainforests and amazing lookout points in the South-East Queensland region.\r\n\r\nSuch popular destinations as Springbrook, O''Reilly''s, Lamington National Park and the highly popular Tamborine Mountain await - choose a tour below and enjoy them for yourself!', NULL, NULL, '14/9 Beach Rd, Surfers Paradise, QLD, 4217, Australia', '-28.00259179999999', '153.4276565', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/ScenicDayTourGroup/', '', '', 'http://www.hinterlandtours.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/tours/gold-coast-hinterland-tours', NULL, '610755315536', 'tours@scenicdaytourgroup.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:28:35', '2017-03-04 10:58:35', 2, 1, 1, 0),
(182, 457, 'Learn to Surf on Surfers Paradise Beach', NULL, 0, '', 'Logo-0304201711110126.png', 'Dive in board first and experience surfing on the world famous Surfers Paradise Beach with this fully guided lesson. You''ll feel like a pro in no time as you''re taught how to paddle, stand and balance to ride that wave back to shore. After a lesson on land you''ll take to the waters to put your new skills into action and hopefully nail a few of those waves.\r\n\r\nThe lesson runs for a total of 2 hours and in that time you''ll receive all of the necessary instructions to build up your confidence. All equipment is provided so all you will have to bring is yourself, swimwear, a towel and sunscreen. Lessons depart from the end of the Cavill mall twice a day at 10am and 2pm. Book your surfing lesson on Surfers Paradise beach today to fall in love with this popular Gold Coast past time.', NULL, NULL, 'Gold Coast, 2a/25 River Drive, Surfers Paradise, QLD, 4217, Australia', '-27.9941681', '153.42466979999995', NULL, NULL, NULL, NULL, NULL, NULL, '', 'https://twitter.com/SurfinParadiseQ', '', 'http://www.surfinparadise.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/activities/learn-to-surf-on-surfers-paradise-beach/go-take-the-drop-1-x-2-hour-lesson', NULL, '610410722034', 'info@surfinparadise.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 1, '2017-03-04 05:31:26', '2017-03-04 11:01:26', 2, 1, 1, 0),
(183, 458, 'Hummer 4WD Rainforest Night Tour In Cairns', NULL, 0, '', NULL, 'Discover the beauty of Kuranda a little differently with a night time 4WD tour in the surrounding bushland. With return transfers from your accomodation to Kuranda aboard air conditioned coaches, as well as a delicious BBQ dinner, everything you could possibly need is included. Departing your hotel at 6pm, you''ll make your way to the the Hummer site to enjoy a BBQ dinner before all the fun starts. Sample BBQ kangaroo and crocodile sausages (vegetarian options are available), roast some marshmallows on the campfire and enjoy a warming cup of Billy Tea.\r\n\r\nUpon finishing dinner, you''re ready to board the awaiting American Military H1 Hummer. This all terrain beast will ensure comfort throughout your journey, with the ability to tackle whatever landscape comes its way. Heading straight into the rainforest, you''ll encounter a creek crossing - your first taste of the fun that is to come. With your experienced driver/guide you can be at ease knowing that you''re in very safe hands.\r\n\r\nAfter your thrilling 4WD experience, you have the opportunity to relax with the chance to feed the local wallabies at Granite Gorge. These wallabies are so used to human interaction, they''ll even eat right out of your hand (food is provided)! These beautiful creatures are super friendly and act as the perfect way to conclude a fabulous tour. Whilst in the Granite Gorge, don''t forget to look up, the Australian Outback skies are famed for their spectacular star gazing opportunities.\r\n\r\nTours operate Monday to Friday (excluding Christmas Day, New Year''s Day and Good Friday) departing at 6pm and returning at around 10.30pm. Be sure to wear some warm clothing and comfortable shoes, as well as packing a water bottle and camera of course. A minimum of 4 people are required for the tour to go ahead, and are subject to weather, access and availability. For a unique way to discover Kuranda that is ideal for all ages, this is it. Book your tour today', NULL, NULL, '38 Okeefe St, Cairns North, QLD, 4870, Australia', '-16.8983948', '145.7566759', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://internationalcoachesandtours.com.au/cairns-hummer-tours/', 'https://facetag.experienceoz.com.au/en/cairns/tours/hummer-4wd-rainforest-night-tour-in-cairns-/hummer-4wd-rainforest-night-tour-in-cairns', NULL, '610740325877', 'intcoaches@ledanet.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:31:31', '2017-03-04 11:01:31', 2, 1, 1, 0);
