(184, 459, 'Ocean Rafting', NULL, 0, '', 'Logo-0304201711110220.jpg', 'For the ultimate way to witness the beauty of the Great Barrier Reef, this flight and ocean rafting package allows you to discover this favoured part of Queensland from air and sea. To begin the day, you will enjoy either a 25 or 60 minute flight dependant on which package option you choose. Providing magical scenery of hectares of different reefs from a guaranteed window seat, you''ll fall in love with the crystal clear waters, and pure white sand of the islands below. Should you choose the 25 minute option you will witness views of islands like Whitsunday Island, North Molle Island and Hayman Island. If opting for the 60 minute option however, you will venture a great distance further allowing for sights of these islands as well as the reefs located a little further away, such as Hook Reef, Hardy Reef and the famous Heart Reef, that yes as the name suggests, is heart shaped! Whether your budget only allows the 25 minute flight, or it stretches a little further to accommodate the 60 minute flight, you''ll fall in love with the scenery visible only from the air!\r\n\r\nThe fun doesn''t stop there however, with a thrilling ocean rafting experience also included in this fantastic package. Enjoy a full day adventure jetting along the waters of the Great Barrier Reef that sees you travel to the famously stunning Whitehaven Beach for a stop filled with stunning scenery both on the land and under the water. Make the trek to Hill Inlet and lose your breathe at the magical views that await. With panoramic views of the Great Barrier Reef, you will struggle to ever find something that can top the sight you will see. Also included in this tour is a chance to put on some snorkel gear and explore the vibrant world that lives underneath the blanket of water. Try your luck at spotting marine life, witness handfuls of different coloured reefs and simply enjoy the magic that awaits.\r\n\r\nWith courtesy bus transfers from Airlie Beach included in the package, getting to the departure point at the Whitsunday Airport couldn''t be easier or cheaper! Also included is a delicious buffet lunch meaning you really don''t have to bring a thing! Other than your swimwear, a towel, sun protective clothing, a change of dry clothes and a camera of course! Running from 10am until 4.30pm, the day is long, however is filled with fun, adventure and stunning views that are sure to result in irreplaceable memories.', NULL, NULL, 'Abell Point Marina North, Shingley Drive, Airlie Beach, QLD, 4802', '-20.267031', '148.711345', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/oceanrafting/', 'https://twitter.com/OceanRafting?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor', 'https://www.instagram.com/oceanrafting/', 'http://oceanrafting.com.au', 'https://facetag.experienceoz.com.au/eirlie-beach/cruises/scenic-flight-and-ocean-rafting-package/flight-and-ocean-rafting-packages', NULL, '610749466848', 'tours@oceanrafting.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:32:20', '2017-03-04 11:02:20', 2, 1, 1, 0),
(185, 460, 'Mamu Tropical Skywalk', NULL, 0, '', 'Logo-0304201711110344.jpg', 'Walk amongst the treetops of Wooroonooran National Park with an adventure along the Mamu Tropical Skywalk. Located 15 minutes out of Innisfail in Queensland, the Mamu Tropical Skywalk offers panoramic views over this scenic World Heritage listed rainforest. Rising 15 metres above the ground and stretch along 350 metres, the first walkway is an easy grade trail that travels amongst the luscious canopy of the tropical rainforest.\r\n\r\nThe other features of the walk include a 10 metre long cantilever and a 37 metre high observation tower for incredible sweeping views over the North Johnstone River gorge and the surrounding region. The entire Mamu Tropical Skywalk is made up of over 1100 metres of tracks with elevated walkways and rest shelters located at various points on the skywalk.\r\n\r\nThroughout the walkways, there are a number of informative signs explaining the life, culture and history of the rich rainforest. An ideal adventure for all ages to enjoy, the Mamu Tropical Skywalk offers a safe and exhilarating way to explore this old and historic rainforest. Book your tickets online today to begin your adventure', NULL, NULL, 'Palmerston Hwy, Innisfail QLD 4860', '-17.5213491', '145.9860482', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/mamutropicalskywalk', 'https://twitter.com/MamuSkywalk', 'https://www.instagram.com/mamutropicalskywalk/', 'http://mamutropicalskywalk.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/mamu-tropical-skywalk/mamu-tropical-skywalk-general-admission', NULL, '610740645294', 'info@mamutropicalskywalk.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:33:45', '2017-03-04 11:03:45', 2, 1, 1, 0),
(186, 461, 'Infinity Futuristic Maze Entry', NULL, 0, '', 'Logo-0304201711110433.jpg', 'Infinity Attraction on the Gold Coast is a mind blowing journey into a spectacular, futuristic, maze-like world of wonder. Infinity is one of the Gold Coasts favourite attractions, comprised of an extraordinary series of around 20 multi-sensual environments. Be transported into another world filled with unique special effects, atmospheric sound fields, ultra groovy music and illusions that appear to go all the way to – Infinity!\r\n\r\nThis unique Infinity journey is a fantastic out-of-this-world experience and is great for both kids and adults. Infinity Gold Coast is suitable for all ages from 8-108 offering unforgettable family fun right in the heart of Surfers Paradise. It is also a great idea if you are looking for something fun to do on a rainy day on the Gold Coast or even to escape the heat of summer. For an awesome sensory overload visit Infinity the special effects fun house like nothing else you have ever experienced!', NULL, NULL, '31 Chevron Renaissance Centre, Corner Surfers Paradise Blvd & Elkhorn Ave Surfers Paradise, Queensland 4217', '-27.9996157', '153.4278275', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/infinityattraction', 'https://twitter.com/INFINITYsurfers', 'https://www.instagram.com/infinityattraction/', 'http://infinitygc.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/attractions/infinity-attraction-gold-coast/infinity', NULL, '610755268935', 'info@infinitygc.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:34:34', '2017-03-04 11:04:34', 2, 1, 1, 0),
(187, 462, 'Whale Watching Whitsundays', NULL, 0, '', 'Logo-0304201711110450.png', 'PLEASE NOTE: The 2016 whale watching season has now finished. Tickets for the 2017 whale season will be available soon!\r\n\r\nThis exclusive and comprehensive Whitsundays day tour combines whale watching in wonderful surrounds with a trip to the spectacular Whitehaven Beach. Encompassing a full day''s worth of spectacular marine and island exploration, this tour departs from Airlie Beach in the morning where you''ll board a comfortable, smaller yet powerful vessel limited to just 12 passengers per trip to ensure the best possible viewing angles. Head out onto the Whitsundays waters in pursuit of seeing the massive yet gentle Humpback Whales up close as they relax, breach and play during their annual migratory period between June and October. See them leap out of the water, slap their fins and even approach the vessel of their own will!\r\n\r\nEnjoy a delicious on-board BBQ lunch as the trip makes its way to Whitsunday Island, home to the incredible Whitehaven Beach - widely considered one of the most beautiful beaches in the world. Disembark and take a walk on the ultra-fine silica sand that it''s famous for, taking in the views and revelling in one of Australia''s most beautiful locations. Learn all about the geography and history of the beach and the Whitsundays as a whole before re-boarding your vessel and returning to Airlie Beach at the conclusion of the tour. Comprising of an epic 4 hour journey with a hint of luxury and multiple inclusions, this is an extensive Whitsundays tour that combines the best of the natural world into a single, enjoyable package.', NULL, NULL, '33 port drive, port of airlie marina, Airlie Beach, QLD 4802', '-20.271657', '148.723232', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/ODynamics/', '', '', 'http://www.oceandynamics.com.au/whales-whitsundays/', 'https://facetag.experienceoz.com.au/eirlie-beach/cruises/whale-watching-cruise-around-the-whitcundays-including-bbq-lunch/full-day-whale-watching-cruise-including-beach-and-bbq-lunch-from-airlie-beach', NULL, '610732269150', 'carolyn@imcm.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:34:51', '2017-03-04 11:04:51', 2, 1, 1, 0),
(188, 463, 'Skydiving Over Bribie Island', NULL, 0, '', 'Logo-0304201711110507.png', 'If you''re interested in taking a tandem skydive from 14,000ft above Queensland, then the Skydive Over Bribie Island is for you!\r\n\r\nBefore taking flight, your experienced attendants will give you a safety briefing, and prepare you with all the necessary gear. Soon after, you will exit the vessel nearly 14,000ft as you soar back to earth with a 9,000ft freefall. Feel your adrenalin pumping as you soar over 200 kilometres per hour and experience exceptional views of Bribie Island, Brisbane, Moreton Bay, and the Sunshine Coast.\r\n\r\nNo matter the wind conditions, it is guaranteed you will have a beach landing, making it one of the premier tandem skydive experiences in Queensland. Upon completion of your tandem skydive, you will receive a skydiving certificate - a great way to show friends and family at home just how adventurous you are!\r\n\r\nDon''t miss out on the incredible chance to experience skydiving over Brisbane and its surrounding areas. Book it today', NULL, NULL, 'Bribie Island, Second Avenue, Woorim, Queensland, 4507, Australia', '-27.0670971', '153.2013158', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/BribieSkydive', '', '', 'http://skydivebribie.com.au/', 'https://facetag.experienceoz.com.au/en/caloundra/activities/skydiving-over-bribie-island/skydive-over-bribie-island', NULL, '610733143664', 'info@skydivebribie.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:35:07', '2017-03-04 11:05:07', 2, 1, 1, 0),
(189, 464, 'Jet Boat Ride from Surfers Paradise', NULL, 0, '', 'Logo-0304201711110622.jpg', 'Gold Coast Jet Boating Adventure Ride is the ultimate thing to do for adrenalin junkies visiting the Gold Coast. A favourite amongst both locals and tourists, this is an activity jam packed with fun, adventure, thrill and great scenery, making it one powerfully exhilarating day out. This is an adrenalin rush you won''t forget, a must for those looking to combine fun with sightseeing.\r\n\r\nThe tour departs from the heart of Surfers Paradise and the boat is powered by new twin jet powered 600hp turbo charged jets, providing comfort, safety and convenience for guests. You can expect 360 degree spins, awesome power slides and amazing speed and exhilaration as you zoom up and down the waters off the Surfers Paradise shoreline. Gold Coast Jetboat Rides deliver all the fun you can handle when you ride the ultimate Jetboat Adventure.', NULL, NULL, '30-34 Ferny Ave, Surfers Paradise, QLD, 4217, Australia', '-27.9999394', '153.4265365', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/jetboatextreme/', 'https://twitter.com/jetboatx', '', 'http://www.jetboatextreme.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/activities/jet-boating-departing-surfers-paradise', NULL, '610755388890', 'info@jetboatextreme.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:36:22', '2017-03-04 11:06:22', 2, 1, 1, 0),
(190, 465, 'Caloundra Cruises', NULL, 0, '', 'Logo-0304201711110715.jpg', 'Take one of the popular daily cruises and discover this waterway’s rich sea faring history and marvel at the superb scenery of the Moreton Bay Marine Park. Choose the lunchtime cruise option and stop at Pelican Waters Tavern to enjoy a relaxing lunch. Experience superb vistas across pristine sand cays and abundant bird life while discovering all other forms of beauty on a smooth water cruise as you sit back, relax and enjoy. Suitable for all ages, the calm waters of the channel ensures a pleasant trip for all, and the experienced guide will cover the highlights of the fascinating history, geography and ecology of this vibrant region.\r\n\r\nEnjoy morning tea at anchor while you observe the native flora and fauna, then cruise north for some great bird-watching opportunities before returning in time for lunch back on shore. The Eco Explorer cruise on a Thursday takes you deep into the heart of this internationally significant region, home to over 300 bird species', NULL, NULL, '38 Pelican Waters Blvd, Pelican Waters, QLD, 4551, Australia', '-26.8333569', '153.1098217', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Caloundracruise/', 'https://twitter.com/caloundracruise', '', 'http://www.caloundracruise.com/', 'https://facetag.experienceoz.com.au/en/caloundra/cruises/caloundra-river-cruises', NULL, '610754928280', 'admin@caloundracruise.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:37:15', '2017-03-04 11:07:15', 2, 1, 1, 0),
(191, 466, 'Air Whitsunday Seaplanes', NULL, 0, '', 'Logo-0304201711110824.jpg', 'Take in some of the many gorgeous icons of the Whitsundays from high above with a scenic seaplane flight that provides the opportunity for water landings for an extra additional touch of magic! Join your experienced pilot-guides and hit the skies above the Whitsundays where you''ll gain a whole new level of appreciation for the sheer scale and natural beauty of the Great Barrier Reef; you''ll see firsthand all those incredible shots you''ve seen in promotional material in person, including a number of picture-perfect spots such as Heart Reef, Hayman Island, and the pristine Whitehaven Beach among countless others.\r\n\r\nChoose from a range of available scenic light itineraries ranging from those that head directly to Whitehaven Beach complete with a beach landing, all the way up to extended multi-hour adventures that encompass multiple highlights and access areas that are private and secluded. Whether it''s to commemorate a special occasion or simply to soak in amazing panoramas of the reef that a cruise simply can''t match, choose from the range of Whitsundays scenic flight options below to book an aerial adventure online today.', NULL, NULL, '12 Air Whitsunday Rd, Airlie Beach, QLD 4802', '-20.2811721', '148.758638', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/airwhitsunday', 'https://twitter.com/airwhitsunday', '', 'http://www.airwhitsunday.com.au/', 'https://facetag.experienceoz.com.au/eirlie-beach/activities/whitsundays-scenic-seaplane-flights', NULL, '610749469111', 'reservations@airwhitsunday.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:38:24', '2017-03-04 11:08:24', 2, 1, 1, 0),
(192, 467, 'Gold Coast Sightseeing Tour on a Fire Truck', NULL, 0, '', 'Logo-0304201711110834.jpg', 'Want to explore the Gold Coast in a fun and different way? Book a Gold Coast fire truck tour! Board your Fire Truck in Cavill Ave – Surfers Paradise for a unique tour aboard an authentic Fire Truck! The siren sounds as you depart for an exciting ride to the Spit via Surfers Paradise, along the beachfront to Narrow Neck, then on to Main Beach, and past Sea World. Plenty of smiles, laughs and waving to everybody to be enjoyed as you ride aboard a real Fire Truck!\r\n\r\nExperience operating of a fully functional fire hose & pose for photographs holding the nozzle & wearing authentic Fire Helmets! Keep the cameras ready - Kids love the chance to sit in the driver’s seat for an up close view of the Fire Engine! Enjoy complimentary refreshments then it''s time for another Fire Truck ride for the return journey to Surfers Paradise via Main Beach!', NULL, NULL, '36 Cavill Ave, Gold Coast, Queensland, Australia', '-28.0019838', '153.42786639999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/fire4hireoz/', 'https://twitter.com/fire4hireoz', '', 'http://fire4hire.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/tours/fire-4-hire/fire-truck-experience', NULL, '610488883473', 'info@fire4hire.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:38:34', '2017-03-04 11:08:34', 2, 1, 1, 0),
(193, 468, 'Bellingham Maze', NULL, 0, '', 'Logo-0304201711110847.png', 'If you are looking for a fun activity that’s a little out of the ordinary then the Bellingham Maze should definitely be on your list of things to do while visiting the Sunshine Coast! Enter through the magic waterfall past the wishing well over the bridge and through a tropical rainforest garden! Sounds enchanting? It is! A new large timber panel maze was constructed in March 2013 and has been turned into a scrambled scrabble maze! Find the 8 dead ends, write down the scrambled scrabble letters and use the clues to help solve the puzzle.\r\n\r\nThere are all sorts of other things to do in this spectacular location that will keep the family entertained and you can make a day out of your visit including other activities such as mini golf, puzzles and games, a walk through bird aviary, mini mazes and picnic areas to have a family lunch or you can hire a BBQ (by prior arrangement). Beat the queues and get your maze tickets online, you can also make the most of the great value combo passes to include a mini golf game or choose to purchase maze tickets or mini golf tickets separately', NULL, NULL, '25 Tanawha Tourist Drive, Tanawha, QLD, 4556, Australia', '-26.6985754', '153.0134405', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Bellingham-Maze-102227696515584/', 'https://twitter.com/bellinghammaze', '', 'http://www.bellmaze.com/', 'https://facetag.experienceoz.com.au/en/caloundra/attractions/bellingham-maze-tickets/bellingham-maze', NULL, '610754452979', 'admin@bellmaze.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:38:47', '2017-03-04 11:08:47', 2, 1, 1, 0),
(194, 469, 'Big Kart Track', NULL, 0, '', 'Logo-0304201711111005.png', 'The Big Kart Track on QLD''s Sunshine Coast is the largest commercial go-kart track in Australia. With tracks for kids to cater to the whole family combined with the main attraction - an international standard race track, capable of running 50 go-karts at one time, with 1.2km of track - this venue has got it all. Straights, bends, chicanes, and hair-rising hairpins. Find the rush you desire.\r\n\r\nMultiple different length packages are available for the Sunshine Coast''s Big Kart Track, ranging from 15 minutes all the way up to an entire hour''s worth of go karting fun! With bookings only required if you are looking to bring 12 or more people, feel free to grab your tickets online instantly today', NULL, NULL, '2310 Steve Irwin Way, Landsborough, Queensland, 4550, Australia', '-26.8001621', '152.99270130000002', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/pages/Big-Kart-Track/113407568690679?sk=timeline', '', 'https://www.instagram.com/bigkarttrack/', 'http://bigkart.com.au/', 'https://facetag.experienceoz.com.au/en/caloundra/activities/big-kart-track-bookings/big-kart-track', NULL, '610754941613', 'info@bigkart.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:40:05', '2017-03-04 11:10:05', 2, 1, 1, 0),
(195, 470, 'Ice Skating at Paradise Resort', '', 0, '', 'Logo-0304201711111029.png', 'Get set for the newest ice skating experience on the Gold Coast! This Surfers Paradise area ice skating rink provides a great option for some all-weather, year-round fun that''s perfect for the whole family to lace up the skates and have some light-hearted enjoyment on the ice. Take a break from the beach and swap the bikinis and bathers for some cardigans at this great resort at the northern end of Surfers Paradise which offers three separate two hour ice skating sessions per day.\r\n\r\nSimply choose a session time from the available options below to buy your tickets online and let your kids experience the joy of zipping round the ice just metres from the golden beaches of the Gold Coast - ice skating has never felt fresher!', NULL, NULL, '122 Ferny Avenue, Surfers Paradise, Queensland, 4217, Australia', '-27.9933985', '153.42704930000002', '', NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/paradiseresortgc/', 'https://twitter.com/paradiseresort', 'https://www.instagram.com/paradiseresortgc/', 'http://www.paradiseresort.com.au', 'https://facetag.experienceoz.com.au/en/surfers-paradise/activities/gold-coast-ice-skating', NULL, '610755794444', 'book@paradiseresort.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:40:29', '2017-03-04 23:05:11', 2, 1, 1, 0),
(196, 471, 'Aussie World', NULL, 0, '', 'Logo-0304201711111143.png', 'Buy your admission tickets to Aussie World on the Sunshine Coast here! As the Sunshine Coast''s leading theme park, Aussie World means fun for the entire family. It is located alongside the Pub at Aussie World on Queensland''s Sunshine Coast. Aussie World is jam-packed with over 30 rides and attractions for all ages. Be Boggled in Professor Boggleworth''s Illusionarium, be brave on the Redback, take on the Plunge, or have a blast on the Ballroom Blitz, water play area Leak''nLogs, Giant Slide, Dodgems, Platypus Ponds Mini Golf, Ferris Wheel Bizzie Buggies or the Space Shaker Swinging Ship.\r\n\r\nThere is plenty for the little kids too with the NEW Bug Run kiddie rollercoaster, Tin Lids Tea Party ride, Classic Carousel, and everyone''s favourite, Side Show Alley!\r\n\r\nThe Pub at Aussie World is one of Queensland''s leading tourist attractions and is a must visit. The Pub at Aussie World is open 9am until late and the lunch and dinner menu specialises in the use of local produce including a mouth-watering range of grilled steaks. Aussie World also has a great gift store, the Gift Emporium where the pleasure of browsing through some of the most unique gifts lines on the Sunshine Coast can be found. Also enjoy the Aussie World Village with a selection of specialty shops that cater for the most discerning buyer and includes locally grown and Australian made products', NULL, NULL, '73 Frizzo Rd, Palmview, QLD, 4553, Australia', '-26.7505942', '153.04646939999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/aussieworldsunshinecoast/', '', 'https://www.instagram.com/aussieworldfun/', 'http://www.aussieworld.com.au/', 'https://facetag.experienceoz.com.au/en/caloundra/attractions/aussie-world/aussie-world-rides-and-attractions', NULL, '610754945444', 'fun@aussieworld.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:41:44', '2017-03-04 11:11:44', 2, 1, 1, 0),
(197, 472, 'Townsville Scenic Helicopter Flights', NULL, 0, '', 'Logo-0304201711111329.png', 'See the best of tropical North QLD from high above with one of a range of available scenic flights from Townsville including itineraries to Magnetic Island, Cape Cleveland and much more! Join your experienced helicopter guides aboard a privately owned, luxury helicopter and zip into the sky for an outstanding birds-eye view on this incredibly scenic part of Australia. Choose from a range of flights of varying lengths and destinations that will provide you with a whole new perspective on Townsville City and its lovely surrounds as the waters and islands form a wonderful backdrop from which to grab a photo or three.\r\n\r\nWith 10 minute, 20 minute and extended helicopter flights from Townsville to choose from, there''s a pricing option and sightseeing itinerary available to suit all budgets and sightseeing requirements - to get your airborne experience of QLD underway, simply choose from the available scenic flight options here and book online today.', NULL, NULL, '149 -157 Old Common Rd Townsville, QLD 4810', '-19.2437895', '146.7760632', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/TSVHELIPilotTraining/', '', '', 'https://www.townsvillehelicopters.com.au/', 'https://facetag.experienceoz.com.au/en/townsville/activities/scenic-helicopter-flights-townsville', NULL, '610747724998', 'rarnold@tsvheli.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:43:29', '2017-03-04 11:13:29', 2, 1, 1, 0),
(198, 473, 'Caloundra Jet Ski Tours', NULL, 0, '', 'Logo-0304201711111400.jpg', 'Want a fun and exciting way to see the sights of Caloundra on Queensland’s Sunshine Coast with an added dash of adrenaline and high-speed fun included? With a jet ski tour, you''ll have the freedom to explore the scenic waterways of Caloundra and with a local guide you can enjoy some of the region''s best sights that largely go unseen by other tourists. Choose your desired Sunshine Coast jet ski tour from the available itineraries below - ranging from a cheaper, 40 minute option all the way up to an epic 3 hour guided tour - and embark on a fast paced 25 km or a 50 km scenic tour of Caloundra’s picturesque waterways.\r\n\r\nRenowned for its coastal beauty, there''s a reason the Sunshine Coast is one of Queensland''s most desirable getaway spots; zoom along the beaches and see historic and famous landmarks, encounter wildlife such as turtles and dolphins and hear the history of this stunning area from an experienced and highly friendly jet ski guide who is used to accommodating both first-time and experienced riders alike. For an exhilarating ride and a scenic tour all in one, book a jet ski tour at Caloundra online today', NULL, NULL, 'The Esplanade and & Oranto Street, Caloundra QLD 4551', '39.7629373', '-121.8675849', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/caloundrajetski/', '', '', 'http://www.caloundrajetski.com.au/', 'https://facetag.experienceoz.com.au/en/caloundra/activities/caloundra-jet-ski-tours', NULL, '610434330660', 'ken@caloundrajetski.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:44:00', '2017-03-04 11:14:00', 2, 1, 1, 0),
(199, 474, 'Whale Watch Cruise from Coolangatta', NULL, 0, '', 'Logo-0304201711111637.JPG', 'Don''t spend hours driving to far away destinations to see humpback whales, you can get world class whale watching at Coolangatta and Tweed Heads, this is as good as it gets! Guaranteed to see whales on every cruise! All trips subject to weather and passenger numbers. For the past four years, we have seen whales on every single trip, up close and personal!!, Cows and calves, whales feeding, dozens of pods all within viewing distance at one time. All of this happening in close proximity to Tweed Heads and Coolangatta!\r\n\r\nThis is the only whale watching vessel departing from Coolangatta, however you will have to make your own way to the departure point as hotel transfers aren''t included. Tours depart daily during whale season from the a private jetty at the Coolangatta and Tweed Heads Golf Club at 8:30am to return at 11:30am', NULL, NULL, 'Unit 3 - 10 Rivendell Drive, Tweed Heads South NSW 2486', '-28.2057621', '153.5431011', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Coolangatta-Whale-Watch-163059917094344/', '', '', 'http://www.coolangattawhalewatch.com.au/', 'https://facetag.experienceoz.com.au/en/coolangatta/whale-watching/whale-watch-cruises-from-coolangatta/morning-whale-watch', NULL, '610421410587', 'whales@coolangattawhalewatch.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 0, '2017-03-04 05:46:37', '2017-03-04 11:16:37', 2, 1, 1, 0),
(200, 475, 'Townsville Military Tour with Optional Scenic Tour', NULL, 0, '', 'Logo-0304201711111859.jpg', 'Get an in-depth look at the proud military history of Townsville and its role in Australia''s wartime past, as well as an optional tour of the city with this comprehensive tour package. Join your knowledgeable guides and gain a new, deeper appreciation for the sacrifices made by our proud servicemen and women, many of whom paid the ultimate price for our freedom as you''re taken to explore the largest military base in Australia, a military museum, and many more insights that would be otherwise hard to come by.\r\n\r\nLimited to small groups, you''ll receive a personalised and interactive experience as you listen and learn of some of the awe-inspiring stories of bravery and courage that our heroes performed during life-threatening situations. Pausing for a delicious morning tea, this tour has everything you''ll need for an experience that is equal parts educational, interesting and inspiring.\r\n\r\nTravellers can also purchase the afternoon Scenic Tour of Townsville which departs at 1:30 pm just after the Military Tour has concluded. The scenic tour will take you up to Castle Hill for endless views of the Coral Sea, and the beautiful Magnetic Island. The scenic tour also includes commentary about the historical relevance of the area since inception 150 years ago. Lunch is included if you register for both tours. Tours are available from Tuesday to Friday, and Sunday.\r\n\r\nIf you''ve got even a passing interest in war, military, and the history of Townsville, then the Townsville Military Tour and Scenic Tour is an absolute must - so book online today.', NULL, NULL, 'Townsville, Queensland, 4810, Australia', '-19.35682', '147.03791249999995', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/TourTownsville/', '', '', 'http://www.tourtownsville.com.au/', 'https://facetag.experienceoz.com.au/en/townsville/tours/townsville-full-day-military-tour-with-optional-city-tour/full-day-townsville-military-tour-with-optional-city-tour', NULL, '610408555887', 'info@tourtownsville.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:48:59', '2017-03-04 11:18:59', 2, 1, 1, 0),
(201, 476, 'Morning Whale Watch and Fraser Island One Day Tour', NULL, 0, '', 'Logo-0304201711112118.jpg', 'Experience the best of both worlds with a Whale Watch Cruise and Fraser Island Day Tour with this one day package - it doesn''t get any better than that!\r\n\r\nThis one day package includes a morning whale watch cruise departing at 7am, a light breakfast and morning tea, then hop off at Kingfisher Bay Resort at 12noon and enjoy lunch at the Sandbar. After lunch, self walks and activities are at your own leisure before boarding the ferry at 5pm to River Heads with a courtesy drop off to your Hervey Bay accommodation', NULL, NULL, 'Berth A6 Great Sandy Straits Marina, Buccaneer Drive, Urangan, QLD 4655', '-25.292933', '152.910158', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/whalesongcruisesherveybay', 'https://twitter.com/whalesongcruise', '', 'http://www.whalesong.com.au/package/whale-watching-fraser-island-tour/', 'https://facetag.experienceoz.com.au/en/fraser-island/tours/whale-watch-and-fraser-island-day-tour-combo/whale-watch-and-fraser-island-1-day-superpass', NULL, '610741256222', 'bookings@whalesong.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:51:18', '2017-03-04 11:21:18', 2, 1, 1, 0),
(202, 477, 'Texas Longhorn Wagon Tour from Charters Towers', NULL, 0, '', 'Logo-0304201711112227.jpg', 'Join a tour that harks back to the days of Western exploration on a Texas Longhorn wagon safari tour aboard a traditional coach wagon filled with history! Located just outside the famed gold rush town of Charters Towers in North QLD, you''ll join your hosts for a delicious Aussie bush meal of freshly-cooked damper and scones - as well as Texas style chocolate brownies - before embarking on an old-time journey aboard the wagon drawn by two powerful and beautiful Percheron horses.\r\n\r\nWe head off through the open plains to see the herds of Texas Longhorns as well as buffalos and native Aussie wildlife such as kangaroos on a day that wonderfully combines wildlife with history into a single enjoyable package. An entertaining, educational and wild-west style tour adventure in North QLD, this Texas Longhorn tour is something that''s both different and highly memorable - so hitch your wagon and be sure to book online today!', NULL, NULL, '441 Urdera Road Charters Towers , Qld 4820', '-20.0287496', '146.2056214', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/texaslonghornsaustralia/', '', '', 'http://www.texaslonghorn.com.au/', 'https://facetag.experienceoz.com.au/en/townsville/tours/texas-longhorn-wagon-tour-from-charters-towers/texas-longhorn-wagon-tour', NULL, '610474561122', 'info@texaslonghorn.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:52:27', '2017-03-04 11:22:27', 2, 1, 1, 0),
(203, 478, 'Small Group Remote Fraser Island Full Day Tour', NULL, 0, '', NULL, 'Explore the surroundings of the beautiful Fraser Island with a remote Fraser Island Full Day Tour. Be one of the lucky few to see the untouched and unique side of this stunning island with the help of your experienced tour guide. You will enjoy the opportunity to not only explore, but bush walk, snorkel, fish, swim and kayak your way around this tropical paradise. Try your luck at spotting some of the beautiful dolphins, dingos and turtles who call this island getaway home - be sure to bring your camera as these are memories you''ll want to last a life time! This peaceful sanctuary will keep you entertained for hours with its sheer natural beauty, and gorgeous crystal clear waters.\r\n\r\nFind out why Fraser Island is quickly becoming one of Australia''s favourite island destinations! Be mesmerised by the endless beauty of 9km of coloured sand. In this relaxing and comfortable tour you will be truly spoilt with morning tea, afternoon tea, and a delicious BBQ lunch. Do not pass up the opportunity to explore and fall in love with the untouched beauty of the scenic Fraser Island', NULL, NULL, 'Buccaneer Drive, Urangan, Queensland, 4655, Australia', '-25.294227', '152.908857', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.visitfrasercoast.com/destinations/hervey-bay/tours/remote-fraser-island-tour-tasman-venture#tabs1', 'https://facetag.experienceoz.com.au/en/fraser-island/tours/small-group-fraser-island-full-day-tour/small-group-remote-fraser-island-full-day-tour', NULL, '610428243922', 'info@tasmanventure.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:53:11', '2017-03-04 11:23:11', 2, 1, 1, 0),
(204, 479, 'Museum of Tropical Queensland', NULL, 0, '', 'Logo-0304201711112417.jpg', 'Providing a blend of human and natural history with archaeology and just plain FUN, the Museum of Tropical QLD is a must-visit for adults and kids alike. As the home of one of Australia''s most diverse ecosystems, Tropical QLD has a huge array of flora and fauna to document, and the Museum of Tropical QLD in Townsville does all that and more.\r\n\r\nWith entry to the museum, you''ll see and learn all kinds of interesting facts about the Great Barrier Reef and North QLD in general, everything from prehistoric to modern day creatures are covered here, with highlights including a walk through Enchanted Rainforest exhibit the kids will love, great examples of Pacific Island art, Space Lab with plenty of interactivity, a maritime section featuring a full-scale boat and much, much more.\r\n\r\nThe perfect Townsville attraction to both have fun and come away with some new and satisfying knowledge - plus the ideal place to spend a few hours should the weather turn sour - the Museum of Tropical QLD provides a detailed, heartfelt look of all the factors that have helped make North QLD what it is today. If you''re looking for a great experience in the Townsville region that won''t rot your or your kids brains, then be sure to grab your tickets to the Museum of Tropical QLD online today.', NULL, NULL, '70-102 Flinders St, Townsville City, QLD, 4810, Australia', '-19.2574667', '146.82221019999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/museumoftropicalqueensland/', 'https://twitter.com/MTQ_Townsville', 'https://www.instagram.com/museum_of_tropical_queensland/', 'http://www.mtq.qm.qld.gov.au/', 'https://facetag.experienceoz.com.au/en/townsville/attractions/museum-of-tropical-queensland/museum-of-tropical-queensland-general-admission', NULL, '610747260600', 'info.mtq@qm.qld.gov.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:54:17', '2017-03-04 11:24:17', 2, 1, 1, 0),
(205, 480, 'Skydive Airlie Beach', NULL, 0, '', 'Logo-0304201711112549.png', 'There''s not many places in the world that are more picturesque than Tropical North Queensland. Home to the beautiful Great Barrier Reef and the equally as impressive Whitsunday Islands, this area is truly a little slice of paradise! What better way to take in all the beauty of this area than a 14,000ft tandem Airlie Beach skydive above the waters of the incredible Whitsunday Islands! Falling to views of crystal clear waterways, pure white sanded beaches, and an abundance of reef clusters, you''ll be blown away by the sights you''ll witness.\r\n\r\nWith the drop zone in the heart of Queensland''s most popular tourism spot, experience the thrill of freefall at over 220km/hr for up to 60 seconds! After the immediate adrenalin inducing fall is over, relax as you float towards the ground under the canopy of your parachute taking in the mind blowing panoramic views surrounding you. Simply wear closed in shoes and some comfortable clothing and prepare yourself for a moment you''ll never want to end. With a number of different photo and video package options available also, there are plenty of resources to ensure you never forget this incredible experience!\r\n\r\nIncluded in the price is customised pants to put on over your clothes, as well as fleeces and gloves during winter. Transfers from selected Airlie Beach accommodation is also included. Please keep in mind there is a $35 per person APF Levy and admin fee that is NOT included in the price that is payable on the day of your jump.', NULL, NULL, 'AIRLIE BEACH, Whitsunday Mainland, Queensland, Whitsundays QLD 4802,', '-20.2687204', '148.7184564', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/skydive.australia/', 'https://twitter.com/skydivethebeach', 'https://www.instagram.com/skydivethebeach/', 'https://www.skydive.com.au/airlie-beach/', 'https://facetag.experienceoz.com.au/eirlie-beach/activities/airlie-beach-skydiving/airlie-beach-skydiving', NULL, '610749469115', 'info@skydive.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:55:50', '2017-03-04 11:25:50', 2, 1, 1, 0),
(206, 481, 'Hervey Bay and Fraser Island Jet Ski Tours', NULL, 0, '', NULL, '', NULL, NULL, 'Bert A3, Great Sandy Straits Marina Urangan, 17 Buccaneer Dr, Hervey Bay QLD 4655', '-25.293074', '152.910314', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/frasercoastjetskitours', '', '', 'http://www.frasercoastjetskitours.com.au/', 'https://facetag.experienceoz.com.au/en/fraser-island/activities/hervey-bay-jet-ski-tours', NULL, '610412004590', 'info@frasercoastjetskitours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:56:07', '2017-03-04 11:26:07', 2, 1, 1, 0),
(207, 482, 'Reef HQ Aquarium', NULL, 0, '', 'Logo-0304201711112617.jpg', 'Grab your tickets to the world''s only living coral reef aquarium, Townsville''s Reef HQ, for a day out that will immerse yourself in marine life of the Reef! One of the best available showcases of the stunning Great Barrier Reef available without getting wet, Reef HQ is an award-winning facility that is renowned for its amazing, organic displays of marine life as well as its conservation efforts. Come along and experience the massive 2.5 million litre coral reef exhibit which blends the various corals and creatures of the reef together in a single, massive viewing area. Home to the likes of hammerheads, rays, massive groupers and thousands of vibrant fish of all shapes and sizes, Townsville''s Reef HQ feels just like seeing them in the ""real world"".\r\n\r\nReef HQ offers plenty of viewing areas to take in the marine life from a range of different angles and features a number of entertaining and informative shows and talks. See sharks being fed, graceful sea turtle shows and take advantage of the friendly staff ready to answer questions throughout the day. Kids will also love the dedicated reef-themed Play Zone that provides yet more entertainment in addition to the marine life.\r\n\r\nRounding out the experience is the behind-the-scenes look at the Reef HQ Turtle Hospital, where injured and sick turtles are rehabilitated before being released back into the wild. Playing a vital role in the rehabilitation of the animals, Reef HQ Turtle Hospital aims to not only restore the health of these much loved sea creatures, but also to raise awareness with the general public about the threatened species. Operating under the C.A.R.E philosophy (Conserve. Act. Rehabilitate. Educate), the hospital encourages changes to the way humans contribute to nature conservation to better preserve these animals to ensure the species is around for many more years to come.\r\n\r\nFor one of Townsville''s must-do attractions that combines fun as well as education in an exciting way, be sure to buy your Reef HQ Aquarium tickets online today! The doors are open from 9.30am to 5pm daily, excluding Christmas Day (December 25th).', NULL, NULL, '2-68 Flinders Street, Townsville City, QLD, 4810, Australia', '-19.2576888', '146.8234943', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/reefhqaquarium/?ref=page_internal', 'https://twitter.com/reefhqaquarium?lang=en', 'https://www.instagram.com/reefhqaquarium/', 'http://www.reefhq.com.au/', 'https://facetag.experienceoz.com.au/en/townsville/attractions/reef-hq-aquarium/reef-hq-aquarium-general-admission', NULL, '610747500800', 'info@reefhq.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:56:18', '2017-03-04 11:26:18', 2, 1, 1, 0),
(208, 483, 'WILD LIFE Hamilton Island', NULL, 0, '', 'Logo-0304201711112744.jpg', 'Buy general admission tickets to Hamilton Island''s great wildlife park to see all your animal favourites up close, or even book yourself a special breakfast with the Koalas! Kids will love WILD LIFE Hamilton Island, an entertaining animal facility that features the likes of koalas, kangaroos, crocodiles, snakes, lizards and much, much more. Have your photo taken with a koala, witness the slithery fun of the daily reptile show, chow down on a delightful buffet breakfast accompanied by a range of furry friends - the choice of how you wish to experience this Whitsundays wildlife park is entirely up to you.\r\n\r\nTo start YOUR Whitsundays wildlife experience, simply select either standalone general admission WILD LIFE Hamilton Island tickets, or the Breakfast with the Koalas option from the selections below and come face to face with your favourite creatures in the sunny Whitsundays today', NULL, NULL, 'Hamilton Island, Resort Drive, Whitsundays, QLD, 4803, Australia', '-20.3478282', '148.9568193', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/wildlifehamiltonisland/', '', '', 'http://wildlifehamiltonisland.com.au/', 'https://facetag.experienceoz.com.au/en/hamilton-island/attractions/wild-life-hamilton-island', NULL, '610749469078', 'WLHInfo@merlinentertainments.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:57:44', '2017-03-04 11:27:44', 2, 1, 1, 0),
(209, 484, 'Whitsunday Segway Tours', NULL, 0, '', 'Logo-0304201711112752.png', 'Explore the lush rainforest and picturesque coastal areas of the Whitsundays in a truly unique way with a guided Segway tour that offers a cavalcade of wonderful sights! A Segway is a mechanic, two-wheeled vehicle that saves your legs from walking and allows you to travel upright while taking in all the Whitsundays'' best scenery. Choose between two available Segway ride options - either head deep into the delightful greenery of the Conway National Park and follow the Whitsunday Great Walk, or for watery views take an itinerary that follows the Whitsunday Bicentennial Boardwalk with views out to vibrant Pioneer Bay and beyond - as your experienced and friendly tour guides point out all the local landmarks, features and highlights.\r\n\r\nSimply choose one of the two available Segway tour itineraries below for more information and to book this quirky and enjoyable way to see the Whitsundays from an entirely different angle.', NULL, NULL, '4 Golden Orchid Dr, Airlie Beach, QLD, 4802, Australia', '-20.2707375', '148.71940500000005', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/whitsundaysegway.tours/', 'https://twitter.com/whitsegwaytours', 'https://www.instagram.com/whitsundaysegwaytours/', 'http://www.whitsundaysegwaytours.com.au/', 'https://facetag.experienceoz.com.au/eirlie-beach/activities/whitsunday-segway-tours', NULL, '610432734929', 'fun@whitsundaysegwaytours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:57:52', '2017-03-04 11:27:52', 2, 1, 1, 0),
(210, 485, 'Whitsunday Airport to Hotel Arrival Transfer', NULL, 0, '', 'Logo-0304201711112846.png', 'Arrive in the Whitsundays refreshed, relaxed and ready to explore!\r\n\r\nTravelling alone, with a group or with your family this is the best hassle-free way to kick-start your Whitsundays holiday! Travel between the Whitsunday Airport and your Airlie Beach or Shute Harbour accommodation with a door-to-door coach transfer.', NULL, NULL, '7 Orchid Road, Cannonvale, Queensland, 4802', '-20.2705114', '148.7202048', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Whitsunday-Transit-230499042980/?ref=page_internal', '', '', 'http://www.whitsundaytransit.com.au/', 'https://facetag.experienceoz.com.au/en/whitsundays/transport/whitsunday-airport-arrival-transfer/whitsunday-coast-airport-to-airlie-beach-or-shute-harbour', NULL, '610749461800', 'reservations@whitsundaytransit.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 05:58:46', '2017-03-04 11:28:46', 2, 1, 1, 0),
(211, 486, 'Dolphin Watching Sailing Cruise', NULL, 0, '', 'Logo-0304201711112916.png', 'The morning Dolphin Cruise is on the waters of the Great Sandy Straits by Hervey Bay and Fraser Island. Here we look for the bottlenose dolphins (aduncas) and the indo-pacific humpback dolphins (sousa chineses), which is a lesser known species. Both of these species reside in small residential pods of up to 20 and are found around Hervey Bay and Fraser Island. The waters are also home to dugongs, turtles, seabirds and other marine life.\r\n\r\nThe cruise lasts for around 4 hours and morning tea is provided. During summer and weather permitting we also manage a swim on one of the shallow sand banks', NULL, NULL, 'Great Sandy Straits Marina, Buccaneer Drive, Hervey Bay, QLD, 4655, Australia', '-25.292933', '152.91015800000002', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/bluedolphinherveybay', 'https://twitter.com/bluedolphintour', 'https://www.instagram.com/bluedolphintour/', 'http://www.bluedolphintours.com.au/', 'https://facetag.experienceoz.com.au/en/hervey-bay/cruises/full-day-whale-watch-sailing-cruise-including-buffet-lunch/dolphin-watching-cruise', NULL, '610741249600', 'info@bluedolphintours.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 0, '2017-03-04 05:59:16', '2017-03-04 11:29:16', 2, 1, 1, 0),
(212, 487, 'Whitsunday Fishing Charters', NULL, 0, '', 'Logo-0304201711113007.png', 'Get out on the waters of the spectacular Whitsundays with a fishing tour or charter for the chance to ""catch a whopper"" including Mackerel, Tuna & more. These fishing tours from Airlie Beach can be done in either half day or full day options, and include all the necessary equipment such as bait, quality gear, eskies with ice and more. Join the passionate and knowledgeable skippers who know the best fishing hotspots of the Whitsundays like the back of their hand, and be taken to locations that provide the best possible chance to come away with a quality catch.\r\n\r\nSimply choose from either the full day or half day Whitsundays fishing charters below to book yourself a great day out on the water suitable for the whole family online today.', NULL, NULL, 'Abel Point Marina, Airlie Beach, Queensland 4802, Australia', '-20.267031', '148.711345', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Whitsunday-Fishing-Charters-365506157401/', '', '', 'http://www.whitsundayfishingcharters.com.au/', 'https://facetag.experienceoz.com.au/eirlie-beach/activities/half-and-full-day-fishing-charters-', NULL, '610457822553', 'wfc@live.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:00:07', '2017-03-04 11:30:07', 2, 1, 1, 0);
