(213, 488, 'Champagne Sunset Sail Cruise', NULL, 0, '', 'Logo-0304201711113036.jpg', 'Sit back & relax while you cruise around Hervey Bay and Fraser Island on a luxury yacht giving you the chance to take in the beautiful panoramic views. Sip champagne as the sun sets over the waters of the Great Sandy Strait. Enjoy pre-dinner drinks with a delicious finger food platter for all. The champagne sunset sail last for 90 minutes around Hervey Bay and Fraser Island. All your champagne, beer or wine is fully inclusive and there are also soft drinks and orange juice available as well. There is no better way wind down after a long day at work, exploring Fraser Island or just to start your evening', NULL, NULL, 'ferry terminal, cullen bay, 0800 Darwin', '-12.4506052', '130.8229325', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/saildarwin', '', '', 'http://saildarwin.com.au/champagne-sunset-sail/', 'https://facetag.experienceoz.com.au/en/hervey-bay/cruises/champagne-sunset-sail-cruise/champagne-sunset-sailing-cruise', NULL, '610448736492', 'enquiries@saildarwin.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:00:36', '2017-03-04 11:30:36', 2, 1, 1, 0),
(214, 489, 'Whitehaven Beach Speedboat and Snorkel Tour', NULL, 0, '', NULL, 'Climb on board and enjoy the beautiful waters of the Whitsundays with a full day speedboat tour aboard a thundercat! Departing from Abell Point Marina at 9am and returning around 5pm, you''ll be guaranteed hours of sightseeing, fun and wonderful scenery! Included in the tour are 2 beach visits including one at the iconic Whitehaven Beach. Recognised as the most photographed beach in the world, the moment you step onto the pristine white sand or dive into the crystal clear waters, you''ll understand why. Whilst stopped at Whitehaven Beach, a guided tour to Hill Inlet will also be included. As well as the beach stops, you''ll also enjoy the opportunity to snorkel at two of the reefs best snorkelling spots.\r\n\r\nTravelling aboard a 600 horse power speedboat, that boasts shade on 80% of the vessel, you can have a blast flying around the waters without having to worry about getting sunburnt. With lunch, morning and afternoon tea, water, snorkel equipment and marine park frees all covered in the price of this tour, you truly don''t have to worry about a thing! However, if you do desire drinks other than water, guests are welcome to BYO alcohol, soft drinks and juice. If you want a hassle free way to enjoy the islands of the Whitsundays, this is it. Perfect for those chasing something a bit faster than your usual boat cruise, this Thundercat Full Day Adventure guarantees fun and speed without compromising any sightseeing opportunities. Book your tour today and enjoy an exhilarating day out at the magical Whitsundays!', NULL, NULL, 'Abell Point Marina, Shingley Drive, Airlie Beach, Queensland, 4802, Australia', '-20.267031', '148.71134499999994', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/thundercatwhitsundays/', '', '', 'http://www.thundercatwhitsundays.com.au/', 'https://facetag.experienceoz.com.au/en/whitsundays/cruises/whitehaven-beach-speedboat-and-snorkel-tour/thundercat-full-day-adventure', NULL, '610400275367', 'julie@tongarra.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:01:20', '2017-03-04 11:31:20', 2, 1, 1, 0),
(215, 490, 'Sarina Sugar Shed Tours', NULL, 0, '', 'Logo-0304201711113158.png', 'Tour a miniature working sugar mill in the beautiful Mackay region to learn about this popular industry from some experienced locals. Offering the choice of a morning tea tour, lunch tour and sampler pack tour you can enjoy tasting some of the mills best products including rums, liqueurs, ginger beer, gourmet sauces and fairy floss.\r\n\r\nBrowse the available tours below and book your spot online for this popular regional tour to learn about the big sugar industry in the region and taste some of their sweetest and tastiest products', NULL, NULL, 'Railway Square, Field of Dreams Parkland, Sarina QLD 4737', '-21.4274885', '149.2178214', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Sarinasugarshed', '', '', 'http://www.sarinasugarshed.com.au/', 'https://facetag.experienceoz.com.au/en/mackay/attractions/sarina-sugar-shed-tours', NULL, '610749432801', 'info@sarinasugarshed.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:01:59', '2017-03-04 11:31:59', 2, 1, 1, 0),
(216, 491, 'Whitsunday Jetski Tours', NULL, 0, '', 'Logo-0304201711113205.jpg', 'Hop aboard your own high-powered jet ski and experience the gorgeous waters of the Whitsundays at high speed on a guided tour departing from Airlie Beach. Choose from either a 1 hour or 3 hour Whitsundays jet ski tour, then join your guides for a trip either around Airlie Beach''s picturesque shoreline, or out further to the spectacular waters surrounding the region''s beautiful South Molle Island. With all safety gear and full safety briefing included, this is an excellent way to combine Whitsundays sightseeing with a dose of on-water fun, as you pilot your own Yamaha Jet Ski for some bumps, spins, and wonderful outlooks. Your jet ski guides are used to catering to all ability levels, so both first-time riders and the advanced can gain enjoyment while feeling entirely safe on the water.\r\n\r\nSimply choose either the 1 or 3 hour itinerary options from the list below to book your Whitsundays jet ski tour online today and experience this beautiful part of Queensland with an added dose of adrenaline.', NULL, NULL, 'Abell Point Marina South Village, Shingley Drive, Airlie Beach, QLD 4802', '-20.267031', '148.711345', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/whitsundayjetskitours/', 'https://twitter.com/whitjetskitours', 'https://www.instagram.com/whitsundayjetskitours/', 'http://www.jetskitour.com.au/', 'https://facetag.experienceoz.com.au/eirlie-beach/activities/jetski-tours-around-the-whitsundays', NULL, '610459538754', 'info@jetskitour.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:02:05', '2017-03-04 11:32:05', 2, 1, 1, 0),
(217, 492, 'Sovereign Hill Day Tour from Melbourne', NULL, 0, '', 'Logo-0304201711113310.png', 'This Melbourne tour to the renowned historical heritage park of Sovereign Hill will lead you back in time to a world focused on gold. One of regional Victoria''s most popular attractions, Sovereign Hill is a frozen-in-time village emulating the 1800''s staffed by talented in-character actors and era-accurate architecture to explore. You''ll be able to see blacksmiths at work and even try your hand at panning for gold!\r\n\r\nIn 1850 the world focused on the Victorian town of Ballarat as the cry ''Gold'' echoed around the globe. People from all nations poured into Ballarat to seek a fortune, many found the real Australia and decided to make this great land their home. Today, you too can capture the excitement of these bawdy times as you visit the scene of revolt, rebellion and the emergence of democracy at Eureka and Sovereign Hill - Ballarat.\r\n\r\nDeparting Melbourne with accommodation transfers, you''ll begin your journey to Ballarat at 8:20am and return around 5:30pm. Tours operate every Monday, Tuesday, Thursday and Saturday and give guests the option to add lunch or a visit to Ballarat Wildlife Park on top of the original tour.', NULL, NULL, '39 Magpie Street, Ballarat, Victoria, 3350, Australia', '-37.5777577', '143.86381929999993', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/sovereignhill/?ref=page_internal', 'https://twitter.com/sovereignhill?ref_src=twsrc%5Egoogle%7Ctwcamp%5Eserp%7Ctwgr%5Eauthor', 'https://www.instagram.com/sovereignhill/?hl=en', 'http://www.sovereignhill.com.au/', 'https://facetag.experienceoz.com.au/en/ballarat/tours/all-sightseeing-tours-from-melbourne/sovereign-hill', NULL, '610353371199', 'enquiries@sovereignhill.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:03:10', '2017-03-04 11:33:10', 2, 1, 1, 0),
(218, 493, 'Yongala Dive', NULL, 0, '', 'Logo-0304201711113320.png', 'Visit one of the world''s 10 best wreck dives with this full day tour from Townsville or Magnetic Island - during which you''ll be able to get underwater and see the famed wreck of the SS Yongala up close! Situated in the heart of the Great Barrier Reef Marine Park, the SS Yongala sank back in 1911 and has been used as a dive site since 1958, with its untouched nature providing a great haven for a number of spectacular kinds of marine life and coral that make for some wonderful exploration and visual opportunities.\r\n\r\nOn this full day diving tour you''ll join your friendly, experienced diving guides and head out from your choice of either Townsville or Magnetic Island aboard their comfortable vessel headed for the SS Yongala.\r\n\r\nOnce there, you''ll have full use of diving equipment and get to conduct two separate dives on the SS Yongala where you''ll encounter turtles, gropers, eagle and manta rays and much, much more. With some great diving on offer as well as a range of inclusions such as morning and afternoon teas, lunch, beverages and hot showers, if you''re looking to take part in Australia''s premier wreck dive then be sure to book this SS Yongala diving tour in North QLD online today', NULL, NULL, '56 Narrah St, Alva QLD 4807', '-19.4537448', '147.4782808', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/yongaladive', '', '', 'http://www.yongaladive.com.au/', 'https://facetag.experienceoz.com.au/en/magnetic-island/cruises/yongala-wreck-dive-trip-from-townsville-and-magnetic-island/yongala-wreck-dive-trip', NULL, '610747831519', 'reservations@yongaladive.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:03:20', '2017-03-04 11:33:20', 2, 1, 1, 0),
(219, 494, 'Story Bridge Adventure Climb', NULL, 0, '', 'Logo-0304201711113438.png', 'Climbing Brisbane''s Story Bridge with The Story Bridge Adventure Climb is one of the best and most scenic ways to see the beautiful Brisbane region. A popular adventure for both visitors and locals alike, this is a great adventure for all fitness levels and ages. An exhilarating journey with breathtaking panoramic views, the challenge of climbing is completely worth it upon reaching the top. This is a rewarding and enjoyable achievement that you won''t want to miss while visiting the Queensland capital. Through the duration of the climb you''ll receive informative and interesting commentary from your climbing guide about the history and heritage of Brisbane and the bridge itself.\r\n\r\nThe Story Bridge Adventure Climb is challenging but safe and unique but affordable. It is a 2.5 hour experience with spectacular, uninterrupted 360 degree views and is one of only three bridge climbs in the world. Dawn, day, twilight and night climbs all available and all climbers are supplied with a fully-enclosed climb suit, and the climb leaders will advise you of the weather conditions for the day and suggest comfortable clothing to wear in conjunction with your climb suit. Accessories provided include hats, handkerchiefs, sunglasses, lanyards, all-weather jackets and sunscreen, and all climbers are required to wear fully-enclosed rubber-soled shoes.\r\n\r\nCommentary from the leaders is delivered via a radio headset, however you will be unable to communicate through the radio headset yourself - you will still be able to directly interact with your fellow climbers and the climb leader throughout the entire experience however. With a range of different climb types and time sessions, simply choose one of the Brisbane bridge climb options below to book online today!', NULL, NULL, '170 Main Street, Brisbane, QLD, 4169, Australia', '-27.4678009', '153.03558810000004', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/sbacbrisbane/', 'https://twitter.com/bridge_climb', 'https://www.instagram.com/storybridgeclimb/', 'http://www.sbac.net.au/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/brisbane-story-bridge-adventure-climb', NULL, '611300254627', 'climbs@sbac.net.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 0, '2017-03-04 06:04:38', '2017-03-04 11:34:38', 2, 1, 1, 0),
(220, 495, 'Kryal Castle Entry', NULL, 0, '', 'Logo-0304201711113501.jpg', 'Take a step back in time, and journey inside Australia''s only Medieval themed adventure park! Within the walls of Kryal Castle in Victoria, you''ll find a sprawling medieval village of activities including jousting tournaments, wizardry, sword battles and much, much more! For lovers of anything pre-15th century, you''ll lose yourself in this fantastic replica village that boasts the aura of the real medieval times. Explore the lavishly decorated castle complete with themed passageways, view the fascinating (and somewhat terrifying) torture chamber exhibition, watch as knights joust to proclaim their bravery and so much more - this unique adventure park will guarantee you hours of fun! Best of all, if visiting with children, Kryal Castle hosts dedicated kids activities including militia training that allows the Kryal children to learn the skills of knighthood including sword fighting and firing the Castle catapult.\r\n\r\nPerfect for all ages, you are bound to find plenty of things to do in Kryal Castle to please everyone! The castle is also home to an on-site resort that is also decked out with a medieval theme ensuring all the fun doesn''t have to end at the park. Make a weekend out of this great attraction and truly embrace the opportunity to feel like a King or Queen! The castle is open to the public on weekends, public holidays and Victorian School Holidays from 10am to 4pm with the last entry admitted at 3pm. Book your tickets now and get ready for a very memorable experience that will leave you wanting more!', NULL, NULL, '121 Forbes Rd, Leigh Creek, VIC, 3352, Australia', '-37.5720369', '143.95674770000005', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/kryalcastle/?ref=page_internal', 'https://twitter.com/Kryal_Castle', 'https://www.instagram.com/kryalcastle/', 'http://kryalcastle.com.au/', 'https://facetag.experienceoz.com.au/en/ballarat/attractions/kryal-castle-entry', NULL, '610353348500', 'admin@kryalcastle.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:05:01', '2017-03-04 11:35:01', 2, 1, 1, 0),
(221, 496, 'Tangalooma Island Resort Dolphin Feeding', NULL, 0, '', NULL, 'A magical day out, discover this tropical island escape only 75 minutes from Brisbane. A winning combination of crystal clear waters, white sandy beaches and untouched national parks; Tangalooma on Moreton Island is a pristine wonderland waiting to be explored. You will delight as wild dolphins swim into shore at dusk for hand feeding making this an unforgettable experience.\r\n\r\nWhile on the island you''ll also be able to enjoy a range of activities and attractions including more than 40 free activities available at the resort and a four-wheel-drive desert safari with sand tobogganing. Additionally, you''ll also be treated to a delicious buffet lunch and access to a VIP lounge. Tours depart six days a week (except Saturdays) at 8:45am and return around 8:30pm.', NULL, NULL, 'Tangalooma Island Resort Jetty, Tangalooma, Moreton Island, Queensland 4025', '-27.181151', '153.371728', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.tangalooma.com/info/dolphin_feeding/', 'https://facetag.experienceoz.com.au/en/brisbane/tours/tangalooma-and-moreton-island-dolphin-feeding-adventure/tangalooma-dolphin-feeding-adventure', NULL, '610736372000', 'dolphins@tangalooma.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:06:23', '2017-03-04 11:36:23', 2, 1, 1, 0),
(222, 497, 'Ballarat Wildlife Park Entry', NULL, 0, '', 'Logo-0304201711113702.png', 'Visit the popular, family-run Ballarat Wildlife Park in Victoria and get up close with a wide variety of native Aussie and exotic animals! There are few friendlier or more personal wildlife attractions in Australia than this facility where you can come face-to-face with a wide assortment of creatures including kangaroos, koalas, wombats, crocodiles and more all located in pleasant, green surroundings. A wonderful place to visit for families or for first-time visitors to Australia, with tickets to Ballarat Wildlife Park you''ll get a true Aussie adventure that incorporates a range of live shows where you''ll gain further insight into various species. The various shows will let you learn about different kinds of snakes, pat a koala, get up close with friendly wombats, see birds of prey in flight and much more.\r\n\r\nIn addition to general admission entry to the park, you''ll also get a guided tour that lasts approximately 1.5 hours (scheduled to take place at 11:00am - please ensure you arrive beforehand) with a friendly and knowledgeable guide who will provide an additional and detailed look at some of the park''s most popular species - some of which you can even touch and feed! The park is open daily from 9am until 5:30pm with the exception of Christmas Day. One of Victoria''s must-visit animal attractions just a short drive from the centre of Ballarat, grab your tickets to Ballarat Wildlife Park online today.', NULL, NULL, '250 Fussell St, Ballarat Central VIC 3350', '-37.569128', '143.890958', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/BallaratWildlifePark/?ref=page_internal', '', 'https://www.instagram.com/ballaratwildlifepark/', 'http://wildlifepark.com.au/', 'https://facetag.experienceoz.com.au/en/ballarat/attractions/ballarat-wildlife-park-entry/ballarat-wildlife-park-general-admission', NULL, '610353335933', 'info@wildlifepark.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:07:02', '2017-03-04 11:37:02', 2, 1, 1, 0),
(223, 498, 'Tangalooma Island Resort Day Tour from Brisbane', NULL, 0, '', 'Logo-0304201711113856.jpg', 'If you''re in Brisbane and looking for a quick and affordable island getaway, take advantage of a relaxing cruise across glistening Moreton Bay and spend a few hours soaking up the atmosphere of Tangalooma Island Resort on spectacular Moreton Island just off the coast of Brisbane. On this day tour, you''ll enjoy a scenic cruise across the Bay to Moreton Island and then be able to take advantage of all the luxury resort''s activities and facilities. Once on the island you can feed dolphins in the wild, relax in the sunshine, play on the beach, swim in the pools and much, much more all on one of the world''s largest sand islands and all just a short distance from one of Australia''s biggest capital cities!\r\n\r\nHow you choose to spend the day is entirely up to you, you can choose to do absolutely nothing or hire snorkel gear for an aquatic adventure - the choice is yours! Departing from Brisbane at 8:45am and return at 5:45pm, you''ve got an entire day to enjoy the wonderful tropical atmosphere and with return coach transfers and many free activities to take part in, you''ll have plenty to keep you occupied. For the ultimate island escape, book this Tangalooma tour from Brisbane online today', NULL, NULL, 'Tangalooma, Moreton Island QLD 4025', '-27.181151', '153.371728', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/TangaloomaIslandResort', 'https://twitter.com/Tangalooma', 'https://www.instagram.com/tangaloomaislandresort/', 'http://www.tangalooma.com/info/home/', 'https://facetag.experienceoz.com.au/en/moreton-island/tours/brisbane-to-tangalooma-island-resort-day-tour/brisbane-to-tangalooma-island-resort-day-tour', NULL, '611300652250', 'miceenquiries@tangalooma.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:08:56', '2017-03-04 11:38:56', 2, 1, 1, 0),
(224, 499, 'Puffing Billy Steam Train Day Tours from Melbourne', NULL, 0, '', 'Logo-0304201711113911.jpg', 'The century-old Puffing Billy Steam Train runs in the scenic Dandenong Ranges and is a major Victorian tourist attraction that''s popular for adults and kids alike, and on these tours you''ll be taken from Melbourne city to the departure point for this iconic experience. Driven by an authentic, old-world steam engine, you''ll be able to climb on board one of its open carriages and soak in the wonderful bush foliage and distant views as it makes its way ably through the forests of the Dandenongs. Kick back on one of the seats, or be daring and hang your heads over the side of the rails, as you pass over historic wooden bridges, stop at small regional train stops, and enjoy the toot of the train whistle along the way.\r\n\r\nAn absolute must in the Dandenong Ranges and one of Melbourne''s longest-running experiences, choose from a variety of Puffing Billy Tours which take in the Dandenong Ranges alone, or combine with other regional attractions such as Healesville Wildlife Sanctuary or the Yarra Valley for even more extended Victorian goodness.', NULL, NULL, '1 Old Monbulk Road, Belgrave, VIC, 3160, Australia', '-37.9075675', '145.3573705', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/PuffingBillyRailway/?ref=page_internal', 'https://twitter.com/puffingbillyr', 'https://www.instagram.com/puffingbillyrailway/', 'http://puffingbilly.com.au', 'https://facetag.experienceoz.com.au/en/dandenong-ranges/tours/puffing-billy-day-tours-from-melbourne', NULL, '610397570705', 'info@pbr.org.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:09:11', '2017-03-04 11:39:11', 2, 1, 1, 0),
(225, 500, 'Australia Zoo', NULL, 0, '', 'Logo-0304201711113944.jpg', 'This Brisbane to Australia Zoo tour offers a convenient way to access Australia Zoo''s famous combination of great shows and up close and personal animal encounters, with six hours free to explore this award-winning zoo on Queensland''s Sunshine Coast! Expect exciting wildlife shows and some up close and personal animal encounters at Australia Zoo made famous by the Irwin family. Take the hassle out of the drive to the zoo with this tour that will take you from Brisbane directly to the zoo''s gates aboard a comfortable, air-conditioned coach, giving you multiple hours to see all the wildlife and shows before returning to Brisbane in the early evening.\r\n\r\nThe zoo is now a living legacy to Steve and his wildlife conservation efforts. Australia Zoo is home to over 1,000 native and exotic species of wildlife that can’t wait to get up close and personal to you! Get hands-on with cuddly koalas, wombats, snakes and kangaroos. Come face to face with majestic tigers or get your photo taken with a baby alligator! Your day at Australia Zoo will be the ultimate wildlife adventure.', NULL, NULL, '1638 Steve Irwin Way, Beerwah, Queensland, 4519, Australia', '-26.8355732', '152.96221990000004', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/AustraliaZoo', 'https://twitter.com/AustraliaZoo', 'https://www.instagram.com/australiazoo/', 'http://www.australiazoo.com.au', 'https://facetag.experienceoz.com.au/en/brisbane/tours/brisbane-to-australia-zoo-tour-including-entry/australia-zoo-day-tour-including-entry-from-brisbane', NULL, '610754362000', 'info@australiazoo.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:09:44', '2017-03-04 11:39:44', 2, 1, 1, 0),
(226, 501, 'Swim with Seals and Dolphins from Queenscliff', NULL, 0, '', 'Logo-0304201711114201.jpg', 'How many places in the world can you swim with wild dolphins AND seals? Few, but Victoria''s Queenscliff is one of them. People travel from all over the world to experience what we have on our very doorstep. Whether a planned trip, a surprise or even a gift voucher - it’s the ultimate way to explore Port Phillip Bay on this dolphin and seal swim tour. Tours last for 3.5 hours and give guests a great understanding and experience of the area''s local wildlife. The cruise boat is well equipped and tours are suitable for all ages and fitness levels.\r\n\r\nThis nature based tourism business offers a wide range of marine experiences. Visit the beautiful Port Phillip Heads Marine National Park and have fun in the sun with friends, family or colleagues. Cruises also offers great photo opportunities, along with boom netting, a duck board spa and roof top jumping. Wetsuit, snorkels, instruction and refreshments are all supplied.\r\n\r\nQualified, caring instructors are trained by Life Saving Victoria and combined with an underlying respect for the local environment, will ensure that you and your special one take away memories that will last a lifetime! (Dolphin Swim Season is from October to May each year).', NULL, NULL, '6, Queesncliff Boat Harbour, 3, Queenscliff VIC 3225', '-38.264361', '144.669164', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/dolphinswims/', 'https://twitter.com/dolphinswims', '', 'http://www.dolphinswims.com.au/', 'https://facetag.experienceoz.com.au/en/geelong/tours/swim-with-seals-and-dolphins-from-queenscliff/the-dolphin-and-seal-swim-tour', NULL, '610352583889', 'crew@dolphinswims.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:12:01', '2017-03-04 11:42:01', 2, 1, 1, 0),
(227, 502, 'Brisbane Whale Watching', NULL, 0, '', 'Logo-03042017111142011.jpg', 'Come on board and experience an amazing encounter with Humpback Whales on this morning Brisbane whale watching tour that lasts 4.5 hours! Join the friendly crew on board their comfortable, purpose-built whale watching vessel and head out in pursuit of the migrating whales in the waters of the wildlife-rich Moreton Bay Marine Park. Of all the great whales, the Humpback is the most surface active displaying behaviour that will not only inspire you but leave you in awe!\r\n\r\nThere is no better place to to observe the mighty Humpback''s than Brisbane''s Moreton Bay region which has been recognised as one of the world''s best whale watching areas. Optional transfers from both Brisbane and the Sunshine Coast are available for an additional fee to make getting to and from the departure point even easier.\r\n\r\nThere are various different tour options to choose from including a self drive option to the departing dock at Redcliffe Jetty, transfers from Brisbane and the Sunshine Coast, self drive with lunch as well as transfers with lunch. Cruises depart at 10am to return around 2:30pm. Don''t miss Brisbane''s whale watching season this year - book yourself a wonderful whale tour and see these gentle giants up close.', NULL, NULL, '11/133 Redcliffe Parade, Redcliffe, QLD, 4020, Australia', '-27.2271132', '153.11468230000003', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/brisbanewhalewatching', 'https://twitter.com/MVEyeSpy', 'https://www.instagram.com/brisbanewhalewatching/', 'http://www.brisbanewhalewatching.com.au/', 'https://facetag.experienceoz.com.au/en/brisbane/cruises/brisbane-whale-watching-cruises/whale-watching-tour', NULL, '610738800477', 'admin@brisbanewhalewatching.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:12:01', '2017-03-04 11:42:01', 2, 1, 1, 0),
(228, 503, 'Jet Boating Ride from Noosa', NULL, 0, '', 'Logo-0304201711114228.jpg', 'Get a combined dose of adrenaline and wonderful coastal scenery on this one hour Noosa jet boat ride! When you step aboard this jet boat ride in Noosa and as you pull away from the Jetty and cruise around the corner into the river mouth, your heart will start to beat a little faster as you catch your first glimpse of the ocean and the fun that lies ahead. The sound of a few hundred horsepower kicks in behind you the feeling of weightlessness as you become airborne off your first few waves, the taste and feel of the wind and the salt spray in your face all adds up to one thing - AMAZING FUN! Screaming and having lots of fun is mandatory, so don''t even try to hold back!\r\n\r\nWith the state''s most highly qualified thrill-boat captain behind the wheel, all you need to do is sit back, hold on tight and enjoy as we explore some of the world''s most beautiful coastline, with waves crashing on steep, rocky cliffs, pristine and tiny coves dotting the landscape, secret caves and the spectacular ""Hell''s Gates"". We get up close and personal not just with the geographical features but also with the wildlife as the cheeky resident dolphins often join us to take the spotlight for a few minutes while riding in our boat''s wake. If an ""experience"" is truly something that means a lot to you, book now', NULL, NULL, '194 Gympie Terrace, Noosaville QLD 4566', '-26.398338', '153.0617167', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/NoosaThriller', '', '', 'http://www.noosathriller.com/', 'https://facetag.experienceoz.com.au/en/noosa/activities/noosa-jet-boating-rides/noosa-jetboating-ride', NULL, '610754473042', 'info@noosathriller.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:12:28', '2017-03-04 11:42:28', 2, 1, 1, 0),
(229, 504, 'Moreton Island Scenic Flight', NULL, 0, '', 'Logo-0304201711114339.png', 'Travel all the way to beautiful Moreton Island with this premium coastline scenic helicopter flight package as you depart Brisbane''s Archerfield Airport and head east towards Stradbroke Island, descending to just 500 feet above the beach then flying north along the coastline towards Moreton Island. After crossing the south passage bar, you''ll then track inside to see the famous wrecks that dot Moreton Island surrounded by the crystal clear water the area is known for.\r\n\r\nKeep your eyes peeled to see a variety of marine life from above including whales, dolphins, rays and even sharks as you continue north towards Cape Moreton. The flight path will then circle you around the lighthouse before turning south and following the endless view of the beach. From here the pilot will then turn west and island-hop back towards the south of Brisbane before returning to the airfield to conclude the flight. If you''re looking for the best way to see the stunning islands around QLD''s capital, book a Moreton Island scenic helicopter flight online today!', NULL, NULL, 'Hanger 219, Qantas Ave, Brisbane, QLD 4108', '-27.5670662', '153.0147135', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/vsquaredhelicopters', 'https://twitter.com/V2helicopters', '', 'http://v2helicopters.com.au/helicopter-scenic-flights-brisbane/moreton-island-scenic-flight/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/moreton-island-scenic-helicopter-flight/moreton-island-scenic-flight-from-brisbane', NULL, '610732746666', 'info@v2helicopters.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:13:39', '2017-03-04 11:43:39', 2, 1, 1, 0),
(230, 505, 'Noosa Everglades BBQ Lunch and Afternoon Cruises', NULL, 0, '', 'Logo-0304201711114341.png', 'Want to see an entirely different - yet no less beautiful - side of the Sunshine Coast away from the more famous spots? These Noosa Everglades cruises take you on a journey both past and through a varied environment made up of lovely beaches, majestic headlands, forested dunes, multi-coloured cliffs, and the many deep and dark waterways that comprise much of the Great Sandy National Park''s Cooloola Section. Renowned for its calm waters and dense array of varied scenery, highlighted by numerous forms of water birds and other avian life, on an Everglades cruise you''ll board a comfortable sightseeing vessel and venture along this pristine waterway, learning about the various swamplands, mangroves, sand banks and various other features along the way.\r\n\r\nChoose from a pair of available cruise itineraries - one in the afternoon and another that includes a fresh and tasty Aussie-style barbecue lunch - and then prepare to soak in this remarkable wilderness area that forms part of the ""Green Behind the Gold"" on the Sunshine Coast. Simply select the desired cruise option below to book a relaxed and scenic journey online today', NULL, NULL, '12 Eenie Creek Rd, Noosaville QLD 4566', '-26.4121098', '153.0452988', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/thediscoverygroup/?fref=ts', '', 'https://www.instagram.com/thediscoverygroup/', 'http://thediscoverygroup.com.au/', 'https://facetag.experienceoz.com.au/en/noosa/cruises/noosa-everglades-bbq-lunch-and-afternoon-cruises', NULL, '610754490393', 'info@thediscoverygroup.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:13:41', '2017-03-04 11:43:41', 2, 1, 1, 0),
(231, 506, 'Otway Fly Treetop Walk and Zip Line Tour', NULL, 0, '', 'Logo-0304201711114401.jpg', 'Prepare for adventure in the forest with two great experiences in Victoria - the Otway Fly offers both a treetop walk through the green of the canopy and an exhilarating zipline tour that will take you through multiple stations, flights and bridges for a comprehensive and fun trip surrounded by nature! Located around 2.5 hours from Melbourne''s city centre and 1.5 hours from Geelong, the Otway Fly is a great choice for a day trip outside the city with the family that will help showcase some of the pristine greenery that Victoria simply doesn''t receive enough credit for.\r\n\r\nWith a day full of nature, fresh air and family bonding, the Otway Fly offers one of the best ""change of pace"" activities for those looking to experience something different. Simply choose between the Treetop Walk and Zip Line tour (or both!) below, and book online today.', NULL, NULL, '360 Phillips Track, Weeaproinah VIC 3237', '-38.6495843', '143.5046838', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/otwayflytreetopadventures/', 'https://twitter.com/otwayfly', '', 'http://www.otwayfly.com/', 'https://facetag.experienceoz.com.au/en/geelong/activities/otway-fly-treetop-walk-and-zip-line-tour', NULL, '610352359200', 'admin@otwayfly.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:14:01', '2017-03-04 11:44:01', 2, 1, 1, 0),
(232, 507, 'Kayak Noosa', NULL, 0, '', 'Logo-0304201711114458.png', 'Embark on a scenic adventure along the coast to get up close to some of the region''s most friendly and curious creatures on this multi-hour kayaking tour on the Sunshine Coast! Departing from Noosa, your adventure will begin with a picturesque 4-wheel-drive beach drive into the Great Sandy National Park and up to Double Island Point. This is the launching point for your enjoyable kayak in the warm, crystal clear waters. While on the water you''ll have the chance to mingle with the likes of large Bottlenose Dolphin Pods, Humpback whales (between June and November), turtles, manta rays, sting rays and migrating sea birds to name a few.\r\n\r\nThere are hundreds of dolphins living in the are so your chances of coming into contact with these playful creatures are quite high (90%). This kayak tour is suitable for all ages and is the perfect way to get up close to some of the ocean''s most mesmerising animals. Paddling at a gentle pace the tour also provides stunning views of the headland and Double Island Point Lighthouse. Ideal for nature lovers, this tour is the perfect combination of nature, wildlife, exercise and picturesque views. The 1.5 to 2 hour tour finishes with an enjoyable swim or downtime on the beach before driving back to Noosa. A wonderful wildlife encounter coupled with amazing scenery - book your dolphin kayak tour online today', NULL, NULL, 'The Boathouse, 194 Gympie Terrace, Noosaville QLD 4566', '-26.397651', '153.061386', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/kayaknoosaaustralia/', '', '', 'http://www.kayaknoosa.com/', 'https://facetag.experienceoz.com.au/en/noosa/activities/noosa-kayaking-experience-with-dolphins/dolphin-view-kayak-noosa', NULL, '610448567321', 'info@kayaknoosa.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:14:58', '2017-03-04 11:44:58', 2, 1, 1, 0),
(233, 508, 'Lone Pine Koala Sanctuary', NULL, 0, '', 'Logo-0304201711114549.jpg', 'Brisbane''s Lone Pine Koala Sanctuary is the first and biggest koala sanctuary in the world! Home to over 130 koalas, you can get up close to these Aussie icons as well as a range of other Australian favourites with just one visit to this popular Brisbane attraction. Set in a lush, natural setting, Lone Pine Koala Sanctuary is located just outside of Brisbane CBD and just over an hour from the Gold Coast.\r\n\r\nThere are two ticket options available; general admission and admission plus meal packages, choose the one most suitable to you below to begin your animal adventure at one of Brisbane''s premier animal attractions.', NULL, NULL, 'Brisbane, 708 Jesmond Road, Fig Tree Pocket, QLD, 4069, Australia', '-27.5333579', '152.96862399999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/lonepine.koala.sanctuary/', 'https://twitter.com/lonepinekoala', 'https://www.instagram.com/lonepinekoala/', 'http://www.koala.net/', 'https://facetag.experienceoz.com.au/en/brisbane/attractions/lone-pine-koala-sanctuary', NULL, '610733781366', 'service@koala.net', NULL, NULL, NULL, '', '', '0.00', 1, 1, 1, '2017-03-04 06:15:49', '2017-03-04 11:45:49', 2, 1, 1, 0),
(234, 509, 'Great Ocean Road Learn to Surf Tour from Melbourne', NULL, 0, '', 'Logo-0304201711114617.jpg', 'Take a surfing lesson in one of Australia''s most beautiful and iconic locations - the wonderful Great Ocean Road, one of the country''s true natural wonders. Departing from Melbourne early in the morning, you''ll head out to a stretch of wondrous coastline where, surrounded by epic scenery, you''ll have 4 hours worth of surfing lessons on the beach by an expert and friendly surfing instructor.\r\n\r\nYou will be taken down the Great Ocean Road in search of some perfect waves at some truly iconic stretches of sand - including the world-famous Bells Beach! Your surf coach will be there to show you step by step the best way to catch waves and surf with style. In addition, you''ll be provided with breakfast and lunch to help recharge for more surfing thereafter, coming away with some awesome surf adventures before being returned back to Melbourne around 5:30pm. A combination of incredible Victorian scenery coupled with surfing some of the country''s most iconic breaks makes this a tour that any surfing junkie would be nuts to miss!', NULL, NULL, '106 Surf Coast Hwy, Torquay, VIC, 3228, Australia', '-38.32745479999999', '144.3174358', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/greatoceanroadsurftours/?ref=page_internal', 'https://twitter.com/GORSurfTours', 'https://www.instagram.com/greatoceanroadsurftours/', 'http://www.gorsurftours.com.au/', 'https://facetag.experienceoz.com.au/en/great-ocean-road/activities/great-ocean-road-surf-tours/experience', NULL, '610352613730', 'info@gorsurftours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:16:17', '2017-03-04 11:46:17', 2, 1, 1, 0),
(235, 510, 'Noosa Fishing and Crab Tours', NULL, 0, '', 'Logo-0304201711114629.png', 'Being one of Queensland''s most pristine fishing areas, the Noosa River is an idyllic location for a day out on the water! Climb aboard the custom-built fishing vessel for a satisfying experienced with a ton of fishing, crabbing and sightseeing. Enjoy the waterways, admire the rate native bird life and you''ll even get to pull up a few crab pots and taste the legendary Queensland Mud Crab or Blue Swimming Crab - tastes that are truly unmatched!\r\n\r\nMost of our passengers are repeat customers who return yearly due to the pride we take in the quality of our crab tours, and we are also extremely popular with families given our discounted kids prices and that children under 4 are free! So why not join us and try your hand at catching some bream, flathead, whiting, trevally and many other species of the abundant number of fish in the area, with the helping hand of your friendly, professional fishing guide?\r\n\r\nPull your catch straight out of the water and prepare to dine - you can''t get fresher than that', NULL, NULL, '222 Gympie Terrace, Noosaville QLD 4566', '-26.3974691', '153.0642427', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/NoosafishingandCrab', '', '', 'http://www.noosafishingandcrabadventures.com.au/', 'https://facetag.experienceoz.com.au/en/noosa/activities/noosa-fishing-and-crab-tours/fishing-and-crab-tours', NULL, '610754497984', 'info@fishingandcrab.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:16:29', '2017-03-04 11:46:29', 2, 1, 1, 0),
(236, 511, 'Sunset Safaris', NULL, 0, '', NULL, 'Looking for the ultimate aquatic escape from Brisbane? Join in on this epic multi-day tour to explore one of the Great Barrier Reef''s most beautiful coral lagoons and Islands, Lady Musgrave Island. Here we will experience the life and death struggle of migrating birds, turtles and coral, in a place that many would call ""Nirvana"". Snorkelling, diving and deep-sea fishing are what this place is famous for, as we encounter colours and beauty unsurpassed anywhere in the world.\r\n\r\nSpread out over a marvellous three day itinerary, you''ll get accommodation, meals and more all included as you''re taken from Brisbane up the coast to the popular resort town of 1770, spending a night there before being taken via a scenic cruise to the stunning Lady Musgrave Island itself where you''ll be able to take part in all the reef and sand style activities you wish. Enjoy lunch and dinner in these fabulous surroundings and revel in the wonders of the Great Barrier Reef both on and under the water. An extremely reasonably-priced getaway all within easy reach from QLD''s capital city, book yourself a Brisbane to Great Barrier Reef tour online today.\r\n\r\nTours depart from the Brisbane Roma Transit Centre every Monday at Friday at 7:15am and return to Brisbane three days after at 6:30pm.', NULL, NULL, '101 Eurong Resort, Fraser Island, QLD 4581 Australia 1300', '-25.50927', '153.125608', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.sunsetsafaris.com.au/great-barrier-reef-3-day-tour.html', 'https://facetag.experienceoz.com.au/en/brisbane/tours/great-barrier-reef-3-day-tour-from-brisbane/great-barrier-reef-3-day-tour', NULL, '610732871644', 'info@sunsetsafaris.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:17:29', '2017-03-04 11:47:29', 2, 1, 1, 0),
(237, 512, 'Learn to Surf on Noosa Beach', NULL, 0, '', 'Logo-0304201711114745.jpg', 'There''s only one way to get started, and that''s to get in the water. However, a few helpful tips, the right equipment, and heaps of encouragement from your highly qualified instructor will go a long way with getting you hooked forever. You will learn in a relaxed, informal environment at your own pace while safe, gentle waves break in warm, waist-deep water. The water is vibrant blue and the sand is clean and white, making for a wonderful environment to admire and learn in.\r\n\r\nLearn to Surf in Noosa caters to the complete beginner with no prior ocean experience necessary to fall in love with this popular Sunshine Coast past time. All you''ll need to bring is a positive attitude and the ability to maybe laugh at yourself a couple of times when things don''t immediately go perfectly! Your surfing lesson includes a 2 hour surf lesson, surf safety information, all necessary equipment including a soft beginner board, leg rope and a wetsuit or rashie and surf instruction to suit your skill level. If you''re visiting the Sunshine Coast then learning to surf in Noosa is a definite must, you''ll be having so much fun you won''t want to return to shore! Book your lesson with Learn to Surf online today', NULL, NULL, 'Noosa''s Main Beach,  Claude batten Dve, Beach Access No. 11, Noosa, Queensland', '-26.385384', '153.085604', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.noosasurflessons.com.au/', 'https://facetag.experienceoz.com.au/en/noosa/activities/learn-to-surf-on-noosa-beach/go-take-the-drop-1-x-2-hour-lesson', NULL, '610400182614', 'info@gorideawave.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 0, '2017-03-04 06:17:45', '2017-03-04 11:47:45', 2, 1, 1, 0),
(238, 513, 'Noosa Hinterland Tours', NULL, 0, '', 'Logo-0304201711114858.png', 'The Taste of the Hinterland tour is one of the Sunshine Coast''s best food tasting tours, and one of the best ways to see the beautiful sights, and tastes, of the Noosa Hinterland and the surrounding areas. If you''re looking to sample some of the delicious and local products of Noosa and see the surrounding areas of Montville, Maleny and Mapleton, then this tour is for you.\r\n\r\nThe first stop of the day is a visit to Noosa Reds, where you can sample some of the tastiest and most colourful tomatoes in the area. Onwards to Mapleton and The Falls Farm, you can enjoy a morning cup of tea while taking in the beautiful view, just before heading out on a tour of the market gardens.\r\n\r\nNext, the journey will take you to a boutique brewery to enjoy a sample brew (soft drink or wine alternatives are available), before sitting down for lunch in an idyllic hinterland restaurant. To top of the day, the tour will stop off for a goodbye glass of bubbly. Tour sizes are a maximum of 12 people, ensuring that you will get an ample amount of time at each location in an intimate setting. Book today and discover the highlights of the Noosa Hinterland', NULL, NULL, '89 Don Napier Rd, Eumundi QLD 4562', '-26.4876021', '152.9566322', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/NoosaHinterlandTours/', '', 'https://www.instagram.com/noosahinterlandtours/', 'http://noosahinterlandtours.com.au/', 'https://facetag.experienceoz.com.au/en/noosa/tours/small-group-tasting-tour-from-noosa/taste-of-the-hinterland', NULL, '610412072930', 'relax@noosahinterlandtours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 1, '2017-03-04 06:18:58', '2017-03-04 11:48:58', 2, 1, 1, 0),
(239, 514, 'Eureka Skydeck 88', NULL, 0, '', 'Logo-0304201711114904.jpg', 'Melbourne''s Eureka Skydeck is the highest point in the city and a must-do for any visitor to Victoria''s capital! Created to reach for the sky, nothing you have ever experienced will prepare you for the awe inspiring view of Melbourne from the Southern Hemisphere''s highest viewing platform - the Eureka Skydeck. An experience above all else, Eureka Skydeck takes you to one of the most scenic vantage points available in the country to gaze out over the scenery of Victoria''s culturally and historically rich capital, with an impressive panorama visible in every direction.\r\n\r\nBe sure to grab your Eureka Skydeck tickets online here to pre-print them before you go and go directly up to the top.', NULL, NULL, '7 Riverside Quay, Southbank, Victoria, 3006, Australia', '-37.82156250000001', '144.96457729999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/eurekaskydeck', 'https://twitter.com/Eureka_Skydeck', 'https://www.instagram.com/eureka_skydeck/', 'https://www.eurekaskydeck.com.au', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/eureka-skydeck/skydeck-entry', NULL, '610396938888', 'info@eurekaskydeck.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:19:04', '2017-03-04 11:49:04', 2, 1, 1, 0),
(240, 515, 'Airtrain Citylink Limited', NULL, 0, '', NULL, 'If you''re wanting to get from Brisbane to the Gold Coast, AirtrainConnect is the premium service for getting you from the Brisbane Airport to the door of your Gold Coast destination. Regardless of where you are staying on the Gold Coast, the price remains the same.\r\n\r\nAirtrainConnect includes a train ride to the Gold Coast station, and then a chauffeured private vehicle transfer to your accommodation. When you arrive at the train station your driver will be waiting with your name on a sign/ipad to take you the rest of the way.', NULL, NULL, 'Alpinia Drive, Brisbane Domestic Airport, Brisbane, QLD 4008', '-27.3850752', '153.1189451', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'https://airtrain.com.au/gold-coast-connect', 'https://facetag.experienceoz.com.au/en/brisbane/transport/brisbane-airport-train-and-transfer-to-gold-coast-hotels/brisbane-airport-to-gold-coast-hotels-with-airtrainconnect', NULL, '610732163308', 'reservations@airtrain.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:19:05', '2017-03-04 11:49:05', 2, 1, 1, 0);
