(241, 516, 'Wildlife Habitat', NULL, 0, '', 'Logo-0304201711115016.JPG', 'The Wildlife Habitat Port Douglas is Australia''s leading wildlife experience and is famous for ''Breakfast with the Birds'' and ''Lunch with the Lorikeets''. A visit to The Wildlife Habitat is a must when visiting Port Douglas.\r\n\r\nBreakfast with the Birds This is a visitor must do when visiting Port Douglas. Guests are immersed within the wetlands environment whilst enjoying the cacophany of sounds and colours of wildlife as they wander freely amongst the guests. You will also be treated to one of Queensland''s best tropical breakfast buffets.\r\n\r\nLunch with the Lorikeets The sumptuous Lunch with the Lorikeets offers an extensive buffet where you can help yourself. The lunch menu includes tasty homemade soup, sausages, bbq steaks and smokey BBQ chicken, salads and a wide range of tempting tropical fruits. Tea and coffee are included, and vegetarians are well catered for. As well as lorikeets, visitors can expect to meet cockatoos, curlews, parrots, herons and a host of other birdlife', NULL, NULL, 'Port Douglas Rd, Port Douglas QLD 4877', '-16.5126177', '145.4638216', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/PortDouglasWildlife/', 'https://twitter.com/habitatwildlife', 'https://www.instagram.com/wildlifehabitat/', 'http://www.wildlifehabitat.com.au/', 'https://facetag.experienceoz.com.au/en/port-douglas/attractions/the-wildlife-habitat/the-wildlife-habitat-port-douglas', NULL, '610740993235', 'info@wildlifehabitat.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:20:17', '2017-03-04 11:50:17', 2, 1, 1, 0),
(242, 517, 'Adventure Moreton Island', NULL, 0, '', 'Logo-0304201711115044.png', 'Gear up and hit the waters of lovely Moreton Island off the coast of Brisbane for some quality snorkelling around the iconic Tangalooma Wrecks on this great value full day tour. Departing at 7:00am, you''ll tour one of South East QLD''s most popular and easily accessible dive spots - this is a great value way for divers both beginner and advanced to get up close with marine life in a lovely part of the region renowned for its high populations of sea turtles, dolphins and even dugongs. Join your friendly crew and hop aboard a luxurious catamaran as you''re taken across the scenic stretch of water to Moreton Island, and once there you''ll have all diving equipment included to take advantage of the water''s many offerings.\r\n\r\nAlternatively, spend some of your time taking part in the many on-and-off-shore activities offered by the Tangalooma Island Resort, or spend time utilising the resort''s facilities - the choice is yours. The Brisbane region''s best diving experience is just a click of the mouse away - book yourself an enjoyable Moreton Island scuba diving tour online today.', NULL, NULL, '26 Nautilus drive, Brisbane, QLD 4025', '-27.5227548', '153.2618632', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/adventuremoretonisland/', 'https://twitter.com/advmoretonisl', 'https://www.instagram.com/adventure_moreton_island/', 'http://www.adventuremoretonisland.com.au/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/moreton-island-scuba-diving-with-optional-brisbane-transfers/moreton-island-scuba-diving-with-optional-brisbane-transfers', NULL, '611300022878', 'info@adventuremoreton.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:20:44', '2017-03-04 11:50:44', 2, 1, 1, 0),
(243, 518, 'Balloon Flights Over Melbourne', NULL, 0, '', 'Logo-0304201711115058.jpg', 'This 1 hour hot air ballooning flight takes you over the centre of the Melbourne CBD and surrounding suburbs and comes with delicious champagne breakfast making for one of the most unforgettable Melbourne sightseeing adventures available! Hot air ballooning over Melbourne will grant you views of Australia''s second-largest city that few others get to see, and on this flight you''ll depart early in the morning when the air is at its clearest visibility at its highest, joining your friendly balloon operators and hopping in the basket before ascending up, up and away over the iconic city skyline.\r\n\r\nFrom the complete tranquility of the air, you''ll be able to gaze down and see all of Melbourne''s most famous highlights such as the MCG, Shrine of Remembrance, Botanical Gardens, St. Paul''s Cathedral, Rod Laver Arena and much more - be sure to bring your camera along for the ride as you''ll be able to get photos of each of these from high above that your friends and family are sure to be jealous of! Cap it all off with the option to enjoy a delicious, 5 star full buffet breakfast - with champagne! - at the Pullman on the Park, and you''ve got one of the most comprehensive, enjoyable and memorable Melbourne sightseeing experiences available whether it''s to celebrate a special romantic occasion or simply enjoy an airborne adventure. For the ultimate Melbourne hot air ballooning experience, book online today!', NULL, NULL, 'Melbourne, 10 Bond St, Abbotsford, VIC, 3067, Australia', '-37.810284', '145.00498500000003', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Balloon-Flights-Over-Melbourne-185375644846033/', 'https://twitter.com/BalloonmanMelbo', '', 'http://www.balloonman.com.au/home', 'https://facetag.experienceoz.com.au/en/melbourne/activities/hot-air-ballooning-in-melbourne/melbourne-balloon-flight', NULL, '610394270088', 'chris@balloonovermelbourne.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:20:58', '2017-03-04 11:50:58', 2, 1, 1, 0),
(244, 519, 'Quicksilver Cruises', NULL, 0, '', NULL, 'This fantastic reef and rainforest tour takes you to explore two very different worlds - the Great Barrier Reef and the ancient Daintree Rainforest at Cape Tribulation in an epic two-day guided tour from Port Douglas!\r\n\r\nDay one you will be whisked away on a luxury catamaran to explore the underwater wonders of the renowned Agincourt Reef, a spacious floating platform where you can relax, snorkel and dive to your hearts content! Throughout the day you can experience the vibrant marine life and colourful underwater gardens starting with a guided snorkelling tour. There is plenty to do here even if you don’t swim, you can discover the coral formations under the waves with a semi-submersible viewing boat or underwater observatory without getting wet! Morning and afternoon tea is provided for you for you along with a hot and cold buffet lunch and you can even send a postcard postmarked with the only Great Barrier Reef stamp!\r\n\r\nAnd it’s not over yet!\r\n\r\nOn day two the guided tour will pick you up from your Port Douglas accommodation and take you to a whole other world to experience the lush Daintree Rainforests at Cape Tribulation. A trip to the Daintree Discovery Centre will offer fascinating insights into this spectacular and ancient environment. From here you can take a guided rainforest walk, head up the rainforest canopy tower and along the aerial walkway to really feel at one with the rainforest and appreciate the panoramic views. Here you can enjoy lunch in the rainforest (morning and afternoon tea is also provided for you during the rainforest tour) and in the afternoon you can top off your Cape Tribulation experience with a scenic Daintree River Cruise to see the stunning wildlife found here. Your day tour to Cape Tribulation will also take you for a walk along the pristine beach, lined with lush green rainforest and to see the best vantage points for views of the reef and beyond to the Coral Sea', NULL, NULL, 'Wharf Street, Port Douglas, Queensland. 4877', '-16.4849597', '145.461345', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/QuicksilverCruises', '', 'https://www.instagram.com/reefcruises/', 'https://www.quicksilver-cruises.com/', 'https://facetag.experienceoz.com.au/en/port-douglas/tours/great-barrier-reef-and-cape-tribulation-2-day-package-from-port-douglas/great-barrier-reef-and-cape-tribulation-2-day-package', NULL, '610740872100', 'reservations@quicksilver-cruises.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:22:29', '2017-03-04 11:52:29', 2, 1, 1, 0),
(245, 520, 'Bungy Australia', NULL, 0, '', 'Logo-0304201711115406.jpg', 'Prepare for the ultimate Brisbane-area rush with this bungy jumping experience that will allow you to ""take the plunge"" and free-fall from 40m high! One of the world''s most famous and popular adrenaline experiences, bungy jumping provides jumpers with a window into the full force of gravity, and on this experience you''ll journey to South-East Queensland''s only bungee centre located around 20 minutes south of Brisbane and 30 minutes north of the Gold Coast. Once there, you''ll get a full safety briefing and then ascend to the top of the bungy tower for some awesome views of the surrounding area - although your heart will likely be racing too hard to take it all in!\r\n\r\nOnce the count begins, take a breath and it''s 3, 2, 1... bungy! Leap from the platform and plummet towards the ground before the high-tensile bungee cord kicks in and saves you from impact. This newly re-launched bungy site is an absolute must-do for those who like to live their lives to the fullest, so if you''re wanting to get the blood pumping be sure to book YOUR turn at this Brisbane bungy jumping adventure online today!', NULL, NULL, 'Brisbane, 20 Mudgee Street, Kingston, QLD, 4114, Australia', '-27.6721167', '153.11517279999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/BungyAustralia/', '', '', 'http://bungyaustralia.com/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/bungy-australia/bungee-jumping-gold-coast', NULL, '610432864963', 'info@bungyaustralia.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:24:06', '2017-03-04 11:54:06', 2, 1, 1, 0),
(246, 521, 'Solar Whisper', NULL, 0, '', 'Logo-0304201711115649.jpg', 'Witness the wonders of the spectacular Daintree Rainforest from its very heart with a Daintree Rainforest cruise! Over the course of an hour, gently cruise along the Daintree River on an informative wildlife focused experience that will highlight all the various animal and plant life of this fragile and beautiful tropical ecosystem. Keep an eye out for rare birds, have your camera ready for seeing crocodiles in their native habitat and much, much more. With a 98% success rate of spotting crocs on the cruise, view these fearsome creatures from the safety of the small cruise boat as your guide highlights all the features that make this part of Australia truly special.\r\n\r\nThis local tour operation runs from the banks of the Daintree River, and is an essential experience for those wanting to have an intimate encounter with the country''s oldest - and World Heritage protected - rainforest. With refreshments, snacks and beverages included as well as binoculars for spotting wildlife, you''ll have everything you need for a serene, educational and beautiful cruise on the Daintree River - so book online today', NULL, NULL, 'Cape Tribulation Road, Daintree QLD 4873', '-16.1700308', '145.4184612', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/SolarWhisper/', '', 'https://www.instagram.com/solar_whisper/', 'http://www.solarwhisper.com/', 'https://facetag.experienceoz.com.au/en/port-douglas/activities/daintree-river-cruises/daintree-river-cruise', NULL, '610740987131', 'info@solarwhisper.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:26:49', '2017-03-04 11:56:49', 2, 1, 1, 0),
(247, 522, 'MXJ F1 Simulator', NULL, 0, '', 'Logo-0304201711115752.jpg', 'Try your hand at Australia''s most realistic simulated driving experience with this high-octane Formula One racing simulator in Brisbane for speed thrills! The next-best thing to racing your own real Formula One car, this lifelike racing emulation provides a glimpse into the high-speed life of the world''s best professional drivers; you''ll sit in the cockpit of a life-size Formula One replica vehicle and choose from multiple famous racetracks from around the world.\r\n\r\nSee if you have what it takes to set a new lap time record as you handle every bend and hairpin with precision - you''ll be impressed with the responsiveness and attention to detail that the simulator provides as it handles just as a real F1 vehicle would. You''ll also have the chance to race a friend - or is that a rival? - in the accompanying F1 car and see who gets bragging rights of being the best race car driver of the bunch. If you''re a rev-head looking for the ultimate simulated on-road thrill, this Brisbane Formula One simulator is so lifelike, you can almost smell the burnt rubber!', NULL, NULL, '6/15-19 Musgrave St, West End QLD 4101', '-27.4769334', '153.0066823', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/mxjf1simulator/', '', 'https://www.instagram.com/mxjf1simulator/', 'http://www.mxjf1simulator.com.au/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/formula-one-simulator-experience/formula-one-simulator-experience-in-brisbane', NULL, '610403871477', 'info@mxjf1simulator.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:27:52', '2017-03-04 11:57:52', 2, 1, 1, 0),
(248, 523, 'Kuranda Skyrail and Scenic Railway Self Drive Tour', NULL, 0, '', 'Logo-0304201711115813.png', 'Explore Kuranda at your own pace on a self-drive tour from Port Douglas where all you need to do is make your way to the Skyrail Rainforest Cableway Base Station and the rest is taken care of for you - now that’s a holiday!\r\n\r\nYou will enjoy the Kuranda Scenic Rail for your journey to Kuranda, with some breathtaking views along the way. You will have free time at Kuranda Village to explore the Heritage Markets or visit other attractions such as Birdworld Kuranda, Kuranda Koala Gardens and the Australian Butterfly Sanctuary (entry is at own expense). Once you have finished exploring the village in the rainforest, board the Skyrail Rainforest Cableway for your return journey back to your vehicle', NULL, NULL, 'Cairns Western Arterial Road Smithfield, Cairns, Queensland, 4878', '-16.8476624', '145.6950452', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/skyrailcairns/', 'https://twitter.com/skyrailcairns', 'https://www.instagram.com/skyrailcairns/?ref=badge', 'https://www.skyrail.com.au/', 'https://facetag.experienceoz.com.au/en/port-douglas/tours/kuranda-self-drive-tour-from-port-douglas-including-skyrail-and-scenic-railway/kuranda-self-drive-tour-including-skyrail-and-scenic-railway', NULL, '610740385555', 'mail@skyrail.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:28:13', '2017-03-04 11:58:13', 2, 1, 1, 0),
(249, 524, 'Kookaburra Showboat Cruises', NULL, 0, '', NULL, 'For an evening to remember, this Brisbane River dinner cruise includes a live cabaret performance and more coupled with a delicious three course meal. Come aboard an old-world style paddle wheel vessel on any night from Thursday to Sunday for a lively and upbeat evening cruising along the Brisbane River as all of the city''s major highlights pass you by. See the lovely sunset and the city lights reflecting off the water, followed by setting your eyes upon some great entertainment including a mixed showcase of dance and music; it''s a fun-filled display of Indigenous Australian dance, live comedy, and a journey through the Islands of the Pacific all in one.\r\n\r\nDuring your journey you''ll also get some great dining to indulge in as well - choose from a selection of tantalising menu items including sumptuous mains and delectable desserts from the options available on the three course menu that covers all major tastes and dietary types. Perhaps sip a drink from the bar at the rear of the vessel to round things off! All the essentials of a good night out combine to make this Brisbane River dinner cruise one of Brisbane''s best value nights out - so book online today!\r\n\r\nCruises depart from Eagle Street Pier in the Brisbane CBD at 7pm with a 6:30pm boarding time.', NULL, NULL, 'Eagle Street Pier, 1 Eagle St, Brisbane City QLD 4000', '-27.469204', '153.0305376', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://kookaburrariverqueens.com/brisbane-river-cruises/dinner-cruises-brisbane/', 'https://facetag.experienceoz.com.au/en/brisbane/cruises/brisbane-island-carnivale-dinner-cruise/island-carnivale-dinner-cruise', NULL, '610732211300', 'info@showboat.net.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:30:20', '2017-03-04 12:00:20', 2, 1, 1, 0),
(250, 525, 'Port Douglas Scenic Helicopter Flight and Cruise Packages', NULL, 0, '', 'Logo-0304201712120159.jpg', '', NULL, NULL, 'Cairns Heli Centre 2 Pier Point Road, Marina Point Cairns, Queensland', '-16.9185599', '145.7805667', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/GbrHelicoptersAustralia/', '', 'https://www.instagram.com/gbrhelicopters/', 'http://www.gbrhelicopters.com.au', 'https://facetag.experienceoz.com.au/en/port-douglas/reef-and-island-cruises/great-barrier-reef-and-scenic-helicopter-flights-from-port-douglas', NULL, '610740818888', 'reservations@gbrhelicopters.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:31:59', '2017-03-04 12:01:59', 2, 1, 1, 0),
(251, 526, 'Tamborine Rainforest Skywalk', NULL, 0, '', 'Logo-0304201712120224.jpg', 'Put on your walking shoes and prepare for a day full of natural beauty and adventure on this day tour from Brisbane to the lovely, lush Tamborine Mountain hinterland area of the Gold Coast! Famed for its pristine environment away from the glitz and glamour, on this Brisbane to Gold Coast hinterland tour you''ll encounter various marvels of both flora and fauna - see rare butterflies in flight, crystal clear waterfalls cascading down, vivid green rainforest, creeping vines, ancient trees and much more!\r\n\r\nDuring your exploration of the Springbrook National Park found within, you''ll also pay a visit to the ever-popular, multi-million dollar eco-attraction, Skywalk, which will allow you to explore the area from treetop level. Immerse yourself in the rainforest and see indigenous insects and the freshwater fish aquarium at the interpretive centre and cafe before travelling to Tamborine Mountain’s retail precinct, Gallery Walk. Be sure to bring your camera along for the journey - you''ll come away with some excellent photo opportunities at local highlights such as Canyon Falls Lookout and pretty Purlingbrook Falls. The ultimate in nature escapes, this Brisbane to Tamborine Mountain day tour is a rainforest adventure not to be missed!\r\n\r\nTours depart every Tuesday around 8:45am to return at approximately 6pm.', NULL, NULL, '333 Geissmann Drive, North Tamborine, Tamborine Mountain, Queensland 4272', '-27.9135545', '153.1886484', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/TamborineRainforestSkywalk', 'https://twitter.com/skywalk_mtt', 'https://www.instagram.com/tamborinerainforestskywalk/', 'http://rainforestskywalk.com.au/', 'https://facetag.experienceoz.com.au/en/brisbane/tours/brisbane-to-tamborine-mountain-tour-including-rainforest-skywalk/brisbane-to-tamborine-mountain-tour-including-rainforest-skywalk', NULL, '610755452222', 'info@rainforestskywalk.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:32:24', '2017-03-04 12:02:24', 2, 1, 1, 0),
(252, 527, 'Melbourne Shopping Tours', NULL, 0, '', 'Logo-0304201712120356.jpg', 'This Melbourne shopping tour - dubbed the ""Bargains and Bubbles Tour"" - is a fun and relaxed day of discount retail therapy that''s fun for shopping junkies from all over. Melbourne is Australia’s shopping capital, and your tour host will help you to discover some of our best discount outlets and hard-to-find warehouse sales!\r\n\r\nThe itinerary will change based on availability and sales in various shops but may include women’s fashion, shoes, handbags, men’s and kid’s clothing, homewares, chocolates/nuts/food, stationary, jewellery and accessories, cosmetics, gifts, hats, scarves, luggage, books, electrical goods, sportswear, lingerie and sleepwear, leather goods, sunglasses, swim wear, toys, Manchester, surf/street wear, sunglasses, knitwear…\r\n\r\nPlease ask us prior to the tour if you have any requests and we will attempt to fit it into our itinerary. Lunch & a glass bubbles (or soft or hot drink) is included in the price. This quick but relaxed and delicious café style lunch will give you fuel to continue shopping into the afternoon. Sit back and relax as we help you to enjoy your day of shopping without the worry of carrying bags, tackling trains and trams, paying for taxis or finding directions and car parks.', NULL, NULL, '21151 QV Little Lonsdale St, Melbourne, Victoria 8011', '-37.8103574', '144.9655342', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Melbshopexperiences/?ref=hl', 'https://twitter.com/melbshopping', '', 'http://www.outletshoppingtours.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-outlet-shopping-tours/bargains-and-bubbles-tour', NULL, '610388224568', 'info@outletshoppingtours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:33:56', '2017-03-04 12:03:56', 2, 1, 1, 0),
(253, 528, 'Port Douglas Hot Air Ballooning', NULL, 0, '', 'Logo-0304201712120408.jpg', 'Why not experience the romance and wonder of a hot air balloon ride during your Port Douglas holiday? After the reef and rainforest, a hot air balloon ride is the next best thing to do to allow yourself the joy of seeing this famed area of tropical north Queensland from the skies! Ascend gently into the early morning air and be greeted by the spectacular sunrise as it spreads out over the vast blue expanse of the Great Barrier Reef to the east and the lush Aussie rainforest to the west including the impressive sight of the Atherton Tablelands far below.\r\n\r\nWith expert commentary provided throughout by your friendly hot air ballooning guide who will point out all the highlights, as well as return accommodation transfers to your Port Douglas accommodation included in the price, as well as the option to upgrade to a full-hour flight or go all-out with breakfast, limo transfer & photo portrait, with a hot air balloon trip you''ll be getting your day in the Port Douglas region off to an unforgettably memorable start', NULL, NULL, '30 Macrossan St, Port Douglas QLD 4877', '-16.4823263', '145.4641854', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/hotairballooncairns/', 'https://twitter.com/hotaircairns', 'https://www.instagram.com/hotairballooncairns/', 'http://www.hotair.com.au/', 'https://facetag.experienceoz.com.au/en/port-douglas/activities/hot-air-ballooning-from-port-douglas', NULL, '610740152622', 'portdouglas@hotair.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:34:08', '2017-03-04 12:04:08', 2, 1, 1, 0),
(254, 529, 'Riverlife', NULL, 0, '', NULL, 'See the best of Brisbane from an entirely different angle while getting a dose of exercise and fresh air with a great value kayaking tour! Choose from the range of Brisbane Kayaking options below and enjoy a fun and friendly environment as you make your way down the lovely Brisbane River either by day or by night. Get impressive views of some of the city''s most iconic highlights, from Southbank to the Maritime Museum and the Botanic Gardens to the Mangroves; all the essentials are covered here.\r\n\r\nSimply select from the range of available Brisbane kayaking itinerary options below that best suits you, then grab your paddle and hit the water for some adventure-based sightseeing fun!', NULL, NULL, 'Naval Stores, Lower River Terrace, Kangaroo Point QLD 4169', '-27.474601', '153.0344949', NULL, NULL, NULL, NULL, NULL, NULL, '', 'https://twitter.com/riverlife', '', 'http://riverlife.com.au/adventures/kayaking/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/brisbane-kayaking-with-optional-dinner', NULL, '610738915766', 'functions@riverlife.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:34:24', '2017-03-04 12:04:24', 2, 1, 1, 0),
(255, 530, 'Poseidon', NULL, 0, '', 'Logo-0304201712120521.png', 'Combining beautiful scenery with an epic marine adventure, this fantastic Outer Barrier Reef tour allows you to explore three of the best reefs in this famous region. Under the guidance of the experienced crew you''ll be taught about the reef and its history, and be taken on a guided snorkelling tour with an expert marine biologist.\r\n\r\nThe tour includes morning and afternoon tea, and a delicious tropical buffet lunch on board complete with fresh prawns. All necessary equipment is supplied on board including snorkelling gear and lessons, stinger suits and flotation devices for the not-so-confident swimmers. The vessel is complete with fresh water showers, toilets and a professional photographer who will be around to capture all of the best moments from the day', NULL, NULL, '44 Wharf Street, Port Douglas QLD 4877', '-16.4825474', '145.4613537', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/poseidonouterreef.cruises', 'https://twitter.com/ReefCruises', 'https://www.instagram.com/reefcruises/', 'http://www.poseidon-cruises.com.au/', 'https://facetag.experienceoz.com.au/en/port-douglas/reef-and-island-cruises/outer-reef-cruise-with-buffet-lunch-from-port-douglas', NULL, '610740872100', 'info@poseidon-cruises.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:35:21', '2017-03-04 12:05:21', 2, 1, 1, 0),
(256, 531, 'City Sightseeing Melbourne', NULL, 0, '', 'Logo-0304201712120551.png', 'See the best of Melbourne at your own pace with a hop on/hop off sightseeing bus pass that will allow you to experience its wide array of great restaurants, landmarks and much more firsthand - and at your leisure! With a variety of key stops on the bus itinerary around the city''s major sightseeing hubs - including such essentials as the Arts Centre, Federation Square, the MCG and Sports Precinct, University of Melbourne, Shrine of Remembrance and much more (see the ""more info"" section below for a full list of stops) - you''ll ensure that you don''t miss out on any of the must-see attractions in Melbourne.\r\n\r\nWith your choice of both 24 hour and 48 hour hop on hop off bus tickets, you can choose an option that best suits both your itinerary and budget and save yourself a bunch of money when sightseeing in Victoria''s capital in the process. Save stress on both your legs and your wallet; grab a hop on hop off pass online today and ensure you get the most out of your visit to one of the world''s most liveable cities with more freedom than your standard guided bus tour.', NULL, NULL, 'Flinders Street, Russell Street, Melbourne VIC 3000', '-37.8182711', '144.9670618', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/citysightseeingmelbourne', 'https://twitter.com/cityssworldwide?lang=en', 'https://www.instagram.com/citysightseeing/', 'http://www.citysightseeing.melbourne', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-city-sightseeing-pty-ltd/hop-on-hop-off-sightseeing', NULL, '610432379322', 'info@melbournecitysightseeing.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:35:51', '2017-03-04 12:05:51', 2, 1, 1, 0),
(257, 532, 'Paradise Seaplanes', NULL, 0, '', 'Logo-0304201712120643.png', 'Experience the Sunshine Coast from an entirely new perspective as you taxi in the spray of warm waters and take off from the beautiful Maroochy River in this antique Wilga Warbird. Soar above Maroochydore, Alexandra Heads and Mooloolaba beach before circling over Point Cartwright and returning to touch down on the Maroochy River. This 10 minute aerial adventure is great for those looking to garner a new perspective at new heights of the beautiful Sunshine Coast region. With a minimum of two passengers and a maximum of three this is a great, intimate idea for couples or small groups wanting to experience something new.\r\n\r\nPassengers are advised to allow for up to 30 minutes to complete the entire adventure and factor that in to their transport to and from the Bradman Avenue airstrip as hotel transfers are not included in the price. With flights running from Mondays to Thursdays this is one adventure you won''t want to miss. Including everything you could want in a scenic adventure flight all at one reasonable price, you can book your flight online today', NULL, NULL, '142 Bradman Ave, Maroochydore, Queensland', '-26.642404', '153.0739105', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/ParadiseSeaPlanes/', 'https://twitter.com/ParadisSeaplane', '', 'http://paradiseseaplanes.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/activities/sunshine-coast-seaplane-adventure-flights/maroochy-river-adventure', NULL, '610437719088', 'paradiseseaplanes@gmail.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:36:43', '2017-03-04 12:06:43', 2, 1, 1, 0),
(258, 533, 'Top Shots Fun Park', NULL, 0, '', 'Logo-0304201712120812.jpg', 'The Sunshine Coast''s attractions are great for families and adults alike! Fun and ''Naturally Refreshing'' attractions including the iconic Australia Zoo with its great wildlife shows, UnderWater World located on the Mooloolaba Wharf is a delight for marine life lovers, with their resident Otters, Seals, Sharks and hundreds of species of fish. Aussie World is fast becoming the Theme Park of the Sunshine Coast and is a must do on anyone''s visit here. Go go-karting, visit the Ginger Factory for some tasty delights, and much more - there are plenty of Sunshine Coast attractions for all ages, so book online today', NULL, NULL, '2 Allora Drive, Maroochydore, Queensland', '-26.6603973', '153.0674315', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/topshotsfunpark/', 'https://twitter.com/topshots4558', '', 'http://www.topshotsfunpark.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/attractions', NULL, '610754527007', 'fun@topshotsmaroochydore.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:38:12', '2017-03-04 12:08:12', 2, 1, 1, 0),
(259, 534, 'Yarra Valley Wine Tasting Tours', NULL, 0, '', 'Logo-0304201712120851.jpg', 'Wine is only half the story of the Yarra Valley - book this great value gourmet tour and taste fresh fruits, wines, cheeses, pasta, meats and much more! During this wonderful journey into this famously verdant region of Victoria which departs from Melbourne at 9:00am, you''ll pay a visit to some of the premier wineries of the Yarra Valley - including the iconic Rochford and DeBortoli - while combining these fine drinks with stops at various other locations which will indulge your palate.\r\n\r\nSample some fresh fruit and juice, rich chocolates at the Yarra Valley Chocolaterie, feast on a delicious lunch, stop at the Yarra Valley Dairy and taste many exclusive wines. Few Yarra Valley tours blend together the aspects of both food and wine together in such an enjoyable fashion, and when combined with the friendly, knowledgeable guides it''s a comprehensive and in-depth way to both sample and learn everything that makes the Yarra tick. With everything you''ll need included in the price of the tour - including lunch and return accommodation transfers (don''t worry about drinking and driving!), you''ll have everything you need to get the best out of the bounty that the Yarra Valley has to offer - so book a gourmet Yarra Valley tour online today!', NULL, NULL, 'Suite 32, 211 Wellington Parade South, East Melbourne 3002', '-37.8164425', '144.9774712', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/www.yarravalleywinetastingtours.com.au/?rf=1466142203616643', '', '', 'https://yarravalleywinetastingtours.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/yarra-valley-winery-day-tour-including-lunch-from-melbourne/yarra-valley-winery-tour', NULL, '610396500888', 'info@yarravalleywinetastingtours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:38:51', '2017-03-04 12:08:51', 2, 1, 1, 0),
(260, 535, 'Floating Images Hot Air Balloon Flights', NULL, 0, '', 'Logo-0304201712120912.png', 'See Ipswich from the best possible angle - the air - with a hot air ballooning experience that takes off just 30 minutes west of the Brisbane CBD. Get the best of both worlds with a flight that encompasses a mixture of city and country scenery as you soak up the views ranging from Ipswich all the way out to the Great Dividing Range.\r\n\r\nDuring the course of this 60-minute ballooning flight, you''ll float serenely through the clear skies as the gradually illuminating light of the morning sun casts its beautiful glow over the landscape below - you''ll come across an aspect of the greater Brisbane and south-east QLD regions that you''ve never experienced before! Cap the experience off with a delicious restaurant champagne breakfast and you''ve got yourself one of the most unforgettable adventures available that''s easily reachable from Brisbane. The ultimate combination of scenery, informative commentary, and unmissable views - book a Brisbane hot air ballooning adventure online today!\r\n\r\nFlights depart 15 to 20 minutes before sunrise and take around 3 to 4 hours to complete including the one hour flight and breakfast.', NULL, NULL, 'Ipswich, 259 Junction Road, Karalee, Queensland, 4306, Australia', '-27.5669475', '152.81434809999996', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/floatingimagesballooning', '', 'https://www.instagram.com/floatingimages/?hl=en', 'http://www.floatingimages.com.au/', 'https://facetag.experienceoz.com.au/en/brisbane/activities/hot-air-ballooning-flights-over-brisbane/hot-air-ballooning', NULL, '610732948770', 'gday@floatingimages.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:39:12', '2017-03-04 12:09:12', 2, 1, 1, 0),
(261, 536, 'Dolphin Discovery Cruise including Lunch', NULL, 0, '', 'Logo-0304201712120928.jpg', 'Come along for a lovely wildlife cruise on the Sunshine Coast to see the dolphins after enjoying a delicious buffet lunch, feed pelicans & more! On this Sunshine Coast dolphin cruise, you''ll be able to board a comfortable vessel for a day out on the water in pursuit of some of nature''s most graceful and beautiful marine animals. Departing from Mooloolaba, over the course of 2 hours you''ll be able to see the playful Bottlenose and Common dolphins along with their calves as they entertain themselves alongside the boat.\r\n\r\nDuring the cruise, you''ll also to be able to kick back and relax while dining on a tasty, fresh buffet of mixed meats and salads before capping off the experience with a dose of pelican hand-feeding before returning to the wharf. Cruises depart on Fridays, Saturdays and Sundays at 12pm and return at 2pm. If you''re a fan of marine life or simply wanting to have a great day out on the waters of the Sunshine Coast, then be sure to book YOUR dolphin cruise online today', NULL, NULL, 'Shop 4, The Wharf Mooloolaba, 123 Parkyn Parade Mooloolaba, QLD 4557', '-26.683853', '153.121959', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/whaleone?fref=ts', 'https://twitter.com/whaleone1', 'https://www.instagram.com/whale_one/', 'http://whaleone.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/cruises/dolphin-discovery-cruise-including-lunch/dolphin-discovery-cruise', NULL, '611300942531', 'info@whaleone.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:39:28', '2017-03-04 12:09:28', 2, 1, 1, 0),
(262, 537, 'Sunreef Diving', NULL, 0, '', 'Logo-0304201712121036.jpg', 'Hit the waters for an Australian-first aquatic experience, on a tour to swim with Humpback whales in the waters off QLD''s Sunshine Coast! Take advantage of this rare opportunity to join in a truly life-changing experience, swimming alongside one of the world''s largest and most gentle creatures over the course of a half day 4 hour tour with a limited maximum group size of 20 people to keep the experience both uncrowded and eco-friendly. The whale swimming tour departs from Mooloolaba on the Sunshine Coast and is available each day between the 6th of July and 11th of November, and provide a firsthand look at these ocean giants as they play, dive, breach and slap their fins.\r\n\r\nOnce whales have been spotted, groups of 10 swimmers will be sent out on a floating line to get acquainted with the whales, and with all equipment such as snorkelling gear and wetsuits provided, you''ll have everything you need to come along and tick one of life''s true bucket list items off your agenda. Combined with a spotter plane that helps spot the whales faster and more efficiently, this is the newest and ultimate whale experience in Australia exclusive to the Sunshine Coast - so book your whale swimming tour online today as spots are sure to fill up quickly', NULL, NULL, '11/123 Parkyn Parade, Mooloolaba QLD 4557', '-26.682941', '153.1227059', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/sunreef/', 'https://twitter.com/sunreefdive', 'https://www.instagram.com/sunreef_scuba/', 'http://www.sunreef.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/activities/swimming-with-whales/swim-with-whales', NULL, '610754445656', 'dive@sunreef.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:40:36', '2017-03-04 12:10:36', 2, 1, 1, 0),
(263, 538, 'River City Cruises', NULL, 0, '', 'Logo-0304201712121045.png', 'Get a taste of Brisbane’s city sights and history on this morning half- day guided tour of the places and spectacular architecture that characterise Queensland’s capital city. Learn about the history of this fast growing cosmopolitan centre set on the Brisbane River with a delightful river cruise.\r\n\r\nIn addition to the great attractions, you''ll also be given free time to explore the Brisbane area and take in all of the beautiful sights it is known for. Tours depart every Monday, Wednesday, Thursday, Saturday and Sunday at 9:15am and include pick ups from the Brisbane Transit Centre in Roma Street and concludes at 12:15pm. There are no return transfers, however that means you are free to explore the region on your own and maybe even visit Queen Street Mall for a little browse.', NULL, NULL, 'South Bank Parklands, A, South Brisbane QLD 4101', '-27.4766308', '153.0222406', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/rivercitycruises/?ref=page_internal', 'https://twitter.com/RiverCityCruise', 'https://www.instagram.com/rivercitycruises/', 'http://www.daytours.com.au/optional-tours/Tours/brisbane-city-sights-morning-tour', 'https://facetag.experienceoz.com.au/en/brisbane/tours/brisbane-city-morning-sightseeing-tour/brisbane-city-sights-morning-tour', NULL, '610428278473', 'info@rivercitycruises.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:40:45', '2017-03-04 12:10:45', 2, 1, 1, 0),
(264, 539, 'Horseback', NULL, 0, '', 'Logo-0304201712121058.jpg', 'Choose from a range of incredibly popular Mornington Peninsula horse riding experiences below that have long been one of our best-selling experiences in Victoria! Hop on horseback and head out into the wonderful scenery of the Mornington Peninsula within an easy drive of Melbourne for an exhilarating horse riding experience through a variety of beautiful and scenic locations; along some of the region''s loveliest beaches, through lush forests, bush and rainforest, past popular walking destinations and more! Not only for adults - bring the kids along as well!\r\n\r\nThese Mornington Peninsula horse riding experiences cater to a range of different skill and difficulty levels while also providing a choice of scenery - and can even be combined with one of Mornington''s other iconic attractions (the Peninsula Hot Springs) that make for a great way to sooth any horse riding aches afterwards! No experience is necessary and first-timers are more than welcome, with a variety of rides that range from a slow trot to a more speedy canter depending on your skill and confidence levels. Simply choose from the list of available horse riding experiences below and prepare for a day in the saddle that you''ll remember for a long time in this picturesque part of Victoria.', NULL, NULL, '356 Shands Road, Main Ridge, Mornington Peninsula, Victoria 3928', '-38.3983523', '144.9819221', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/horseback.com.au/', '', 'https://www.instagram.com/horseback.com.au/', 'http://horseback.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/horse-trail-rides-mornington-peninsula-melbourne', NULL, '610359896119', 'info@horseback.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:40:58', '2017-03-04 12:10:58', 2, 1, 1, 0),
(265, 540, 'Sunshine Coast Airport to Sunshine Coast Hotels Arrival Transfer', NULL, 0, '', 'Logo-0304201712121139.jpeg', 'Take the hassle of navigating your way from the airport to your accommodation with an organised transfer. This is a quick and easy way to travel between the Sunshine Coast Airport and your Sunshine Coast accommodation is with a door to door coach transfer', NULL, NULL, 'Friendship Avenue, Sunshine Coast, Queensland', '-26.6078277', '153.0875581', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/SunshineCoastAirport/', 'https://twitter.com/SunCoastAirport', 'https://www.instagram.com/sunshinecoastairport/', 'http://www.sunshinecoastairport.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/transport/sunshine-coast-airport-arrival-transfer', NULL, '610754531500', 'airport@sunshinecoast.qld.gov.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:41:39', '2017-03-04 12:11:39', 2, 1, 1, 0),
(266, 541, 'The Workshops Rail Museum', NULL, 0, '', 'Logo-0304201712121223.jpg', 'Explore The Workshops Rail Museum, an interactive and authentic heritage and cultural experience located at the home of Australia''s oldest working railway workshop. An exciting adventure for kids and rail enthusiasts of all ages, the museum brings history to life with a range of hands-on exhibits, multi-media encounters and stories related to the steam locomotives and machinery. The museum is home to over 15 exhibits just waiting to be discovered explaining the role rail has played in our world.\r\n\r\nLocated a short drive from Brisbane in Ipswich, The Workshops Rail Museum, part of the Queensland Museum Network, is winner of Australian and Queensland Tourism Awards for Heritage & Cultural Tourism. The museum is open daily from 9:30am to 4pm and guests must wear closed in footwear to embark on the Heritage Railway Workshops Tour - a must-see for an exciting behind-the-scenes look at the operating workshop.', NULL, NULL, 'North St, North Ipswich, QLD, 4305, Australia', '-27.59896', '152.76032699999996', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/TheWorkshopsRailMuseum/', 'https://twitter.com/railmuseum_qld', 'https://www.instagram.com/theworkshopsrailmuseum/', 'http://www.theworkshops.qm.qld.gov.au/', 'https://facetag.experienceoz.com.au/en/brisbane/attractions/the-workshops-rail-museum/one-day-pass', NULL, '610734325100', 'info@theworkshops.qm.qld.gov.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:42:24', '2017-03-04 12:12:24', 2, 1, 1, 0),
(267, 542, 'Skydiving over Coolum Beach', NULL, 0, '', 'Logo-0304201712121301.png', 'Looking for one of the ultimate rushes on the Sunshine Coast? Combine the epic thrill of free-fall with some of the Sunny Coast''s signature gorgeous beachfront scenery with your choice of either a 10,000ft or 14,000ft skydive over beautiful Coolum Beach! Join your friendly and reassuring skydive operators at Sunshine Coast Airport in Marcoola and get set to put your fears aside as they give you a full safety briefing and suit you up in the latest and greatest skydiving equipment and jumpsuit. Once the instruction and safety briefing is over you''ll hop aboard a light aircraft to soar up over the Sunshine Coast''s landscape for some awesome views of the hinterland, beach, and glittering waters beyond.\r\n\r\nOnce the light turns green, your tandem partner will launch you out of the plane, where your (up to) 60 seconds of incredible free-fall begins! Free falling is one of the world''s most unique feelings and once the canopy deploys you''ll be able to relax and soak in all of the incredible views of this gorgeous part of Queensland. Tandem jumps let you meet the friendly instructors and learn a thing or two about what to aim for on your dive - head back, arch, smile, relax (yes that''s right, relax!). Harness up to look and feel the part, and keep an eye on the instructor as he does a gear check while marvelling at the technology including two parachutes with an automatic-opening device, climb aboard the plane and practice the exit. For the ultimate blend of adrenaline and views, book yourself a Sunshine Coast skydiving experience today', NULL, NULL, '4 Kittyhawk Close, Sunshine Coast Airport, Marcoola QLD 4564', '-26.6069024', '153.0865981', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/SkydiveNoosa/', 'https://twitter.com/skydiveforfun', '', 'http://www.skydiveforfun.com.au/', 'https://facetag.experienceoz.com.au/en/sunshine-coast/activities/skydiving-on-the-sunshine-coast/tandem-skydiving-over-coolum-beach', NULL, '610754488877', 'noosadz@skydive.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:43:01', '2017-03-04 12:13:01', 2, 1, 1, 0),
(268, 543, 'Sovereign Hill', NULL, 0, '', 'Logo-0304201712121349.jpg', 'Buy entry tickets to the Blood on the Southern Cross evening show, OR combine with a full day entry package to Sovereign Hill for a full day of historic fun! In the evenings, Victoria''s iconic Sovereign Hill hosts an epic, multimillion dollar show dubbed Blood on the Southern Cross - and with a ticket you''ll have a great seat to a spectacle documenting the dramatic Eureka Rebellion of the mid-1800''s - one of Australia''s most significant battles. Held in the evening under open skies, this stunning show is conducted on a vibrant open-air set and depicts the burning of the Eureka Hotel, the recreation of a dawn attack on Aussie patriots, and much more.\r\n\r\nOne of Australia''s most memorable dinner shows, Blood on the Southern Cross includes a 2-course dinner with beer, wine and soft drink (optional) as well as free on-site parking. In the cost of admission you can also choose day entry to the recreated goldrush town of Sovereign Hill, which allows you to step back in time to the 1800s and witness a variety of craftsmen, stores, gold panning and other era-specific highlights. Victoria''s ultimate dinner show does an amazing job of documenting one of the country''s more significant historic events in a highly entertaining way, so if you''re looking for a wonderful evening experience full of visual spectacles be sure to grab your Blood on the Southern Cross tickets online today!', NULL, NULL, 'Bradshaw Street, Ballarat, Victoria 3352', '-37.5732282', '143.8624834', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/sovereignhill/', 'https://twitter.com/Sovereignhill', 'https://www.instagram.com/sovereignhill/?hl=en', 'http://www.sovereignhill.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/blood-on-the-southern-cross-by-sovereign-hill/blood-on-the-southern-cross', NULL, '610353371199', 'bosc@sovereignhill.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:43:50', '2017-03-04 12:13:50', 2, 1, 1, 0);
