(296, 571, 'iFLY Indoor Skydiving on the Gold Coast', NULL, 0, '', 'Logo-0304201712122910.jpg', 'Try all the thrill of skydiving without any of the fear with this brand-new Gold Coast indoor skydiving experience with a range of packages available! Located in Surfers Paradise, join in the fun and experience the feeling of complete weightlessness to perform all the aerial twists, turns and spins you like in a near-perfect simulation of a 14,000 feet free fall that standard skydives offer.\r\n\r\nProfessional indoor skydiving instructors will ensure you''re both comfortable and confident to simply enjoy your time floating in mid-air as the massively powerful fans have you feeling like a superhero. Be sure to book your experience online now as this is sure to become one of the top Gold Coast attractions; do a skydive without the required months of training that your friends and family can stand by and watch! Simply choose from the available indoor skydive packages below and book your airborne fun online today', NULL, NULL, '3084 Surfers Paradise Blvd, Surfers Paradise, Gold Coast, QLD 4217', '-28.0044459', '153.4286192', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/iFLYdownunder/', 'https://twitter.com/iflydownunder?lang=en', '', 'https://downunder.iflyworld.com/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/activities/ifly-indoor-skydiving-gold-coast', NULL, '610756552400', 'info@iflydownunder.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 06:59:10', '2017-03-04 12:29:10', 2, 1, 1, 0),
(297, 572, 'Gold Coast 7D Cinema Experience', NULL, 0, '', 'Logo-0304201712123008.jpg', 'Surfers Paradise has a brand new 7D Cinema experience engaging all the senses in a thrilling cinematic sensory overload! 7D Cinema on the Gold Coast has taken the cinematic experience to the seventh dimension with the added in-theatre effects. You can literally feel what you see on the screen so you will be sitting in a massive simulator but in a theatre environment!\r\n\r\nThere are ten specially adjusted 7D experience films to choose from where you and your friends and family can be transported to a virtual world of thrilling roller coaster rides, haunted houses, venture into outer space, go underwater or get up close and personal with prehistoric beasts – its virtual reality at its very best. Located in central Surfers Paradise this fantastic virtual cinematic experience offers loads of fun for all ages', NULL, NULL, '6/34 Trickett St Surfers Paradise QLD 4217', '-28.004086', '153.4290325', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/7dcinemas', 'https://twitter.com/7DCinemas', '', 'http://www.7dcinema.com.au/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/attractions/gold-coast-7d-cinema-experience/7d-cinema', NULL, '610755388308', 'info@7dcinema.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 07:00:08', '2017-03-04 12:30:08', 2, 1, 1, 0),
(298, 573, 'Vintage Airways', NULL, 0, '', 'Logo-0304201712123020.png', 'With this vintage flight experience, board an authentic 1930''s Tiger Moth aircraft and ascend into the skies above Victoria for 20 minutes worth of scenic flying just like a WWI flight ace! Over the course of the Melbourne Tiger Moth flight you''ll don your traditional leather jacket/goggles/scarf/helmet combo and depart from the airstrip in the Yarra Valley before heading up into the skies to garner some outstanding views over the likes of Yarra Glen, Healesville, the Yarra River and Sugarloaf Reservoir.\r\n\r\nYou''ll be flown by a friendly, knowledgeable pilot who has over 15 years experience, and who will point out all the regional highlights to you along the way - if you''re game, you''ll even get the chance to take the controls and temporarily fly the plane (a one of a kind offering in Australia)! One of the most traditional examples of scenic flying and featuring completely unobstructed, 360 degree views, this Tiger Moth experience is not to be missed for aerial enthusiasts and first-time flyers alike; so book yourself the ultimate Melbourne scenic flight adventure online today!', NULL, NULL, '13 MacIntyre Lane, Yering, VIC, 3770, Australia', '-37.69742', '145.37222900000006', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/vintageairways/', 'https://twitter.com/vintageairways', '', 'http://vintageairways.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/yarra-valley-vintage-joy-flights/yarra-valley-highlights-tiger-moth-flight', NULL, '610387412021', 'info@vintageairways.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 07:00:20', '2017-03-04 12:30:20', 2, 1, 1, 0),
(299, 574, 'Cairns Airport Transfers', NULL, 0, '', 'Logo-0304201712123039.png', 'This convenient Cairns Airport to Hotel shuttle share service operates 24 hours a day and airport transfer representatives greet all flight arrivals at the airport to help you with your transfers. A driver will then take you to your accommodation in air-conditioned comfort with minimum fuss and delay!\r\n\r\nKick start your holiday in Cairns with a safe, reliable and affordable airport to hotel transfer service so that you can arrive refreshed, relaxed and ready to explore! Its quick, its easy and most of all it’s stress free!', NULL, NULL, 'Airport Ave, Cairns, QLD, 4870, Australia', '-16.8839175', '145.7611084', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/cairnsairporttransfers/', 'https://twitter.com/cairnsairports?lang=en', 'https://www.instagram.com/cairnsairport/', 'http://www.cairnsairporttransfer.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/transport/cairns-airport-arrival-transfer/cairns-airport-to-cairns-city', NULL, '610740806703', 'help@transfers.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 07:00:39', '2017-03-04 12:30:39', 2, 1, 1, 0),
(300, 575, 'Gold Coast Ghost Tours', NULL, 0, '', 'Logo-0304201712123123.png', 'Select a tour of the old Surfers Paradise and peel away the glitz and glamour of the Gold Coast''s past to reveal a seedy underbelly of greed and betrayal, or visit the place that everyone is dying to get into, the Southport General Cemetery. On this tour you will move along unmarked graves as this cemetery is bursting with stories just waiting to be told. But remember, it is bad luck to visit a cemetery at night', NULL, NULL, 'Cnr Cavill and Orchid Ave, Surfers Paradise, Gold Coast, Queensland 4217', '-28.001981', '153.4295021', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/lanternghosttours/', 'https://twitter.com/lanterntours', 'https://www.instagram.com/lanternghosttours/', 'http://www.goldcoastghosttours.com/', 'https://facetag.experienceoz.com.au/en/surfers-paradise/tours/gold-coast-ghost-tours', NULL, '611300390119', 'info@lanternghosttours.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-04 07:01:23', '2017-03-04 12:31:23', 2, 1, 1, 0),
(301, 576, 'Hartley''s Crocodile Adventures', NULL, 0, '', 'Logo-0306201704045431.jpg', 'This half day tour from Cairns will take you to the popular Hartleys Crocodile Adventures park - the best place to see crocodiles in tropical North QLD! This highly regarded wildlife park features not just the largest collection of crocodiles in captivity in Queensland, but also a huge array other animals such as snakes, kangaroos, wallabies, koalas and much more - the majority of which you''ll be able to touch for yourself.\r\n\r\nThis tour will take you directly from your Cairns accommodation to the park, where you''ll get to take part in a variety of additional activities including the Snake Show, Cassowary Feeding, the Crocodile Attack Show and Koala feeding, among others. The friendly and knowledgable staff at Hartley''s will provide you with interpretive and informative commentary on all the animals of the park, and do a great job of catering to making it a fun place for children - making for an ideal day out for families - and all for a very reasonable price.\r\n\r\nVisit one of the most highly regarded attractions in the greater Cairns region - book a tour to Hartley''s Crocodile Adventures online today!', NULL, NULL, 'Captain Cook Hwy Wangetti Beach, Queensland 4879', '-16.6640891', '145.5638296', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Hartleys-Crocodile-Adventures-212091295213/', '', 'https://www.instagram.com/hartleyscrocodileadventures/', 'http://www.crocodileadventures.com/', 'https://facetag.experienceoz.com.au/en/cairns/tours/hartleys-crocodile-adventure-park-half-day-tour-from-cairns/hartleys-crocodile-adventure-park-day-tour-from-cairns', NULL, '610740553576', 'sales2@crocodileadventures.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:24:31', '2017-03-06 04:54:31', 2, 1, 1, 0),
(302, 577, 'Moonlit Sanctuary', NULL, 0, '', 'Logo-0306201704045543.jpg', 'Grab your tickets to this charming wildlife conservation park on the Mornington Peninsula - the Moonlit Sanctuary - online here and see all the rare Aussie animals that make the centre great! Also known as Pearcedale Conservation Park, the Moonlit Sanctuary lets you cuddle up to a koala, meet kangaroos, dingoes, wombats and colourful birds all in the name of eco-tourism. A great - and reasonably priced - day out for kids, this well-kept sanctuary is a must visit for wildlife lovers of all ages.\r\n\r\nLocated around 1 hour outside of the Melbourne CBD, Moonlit Sanctuary is a phenomenal, interactive wildlife facility that is just as active at night as in the day. It''s also a haven of Aussie nature, featuring plenty of authentic local greenery all located in a lovely bush setting. If you''re after one of Victoria''s true hidden wildlife gems, then book tickets to Moonlit Sanctuary online today and see all your cute and cuddly favourites for yourself!', NULL, NULL, '550 Tyabb-Tooradin Rd, Pearcedale, Victoria, 3912, Australia', '-38.21314599999999', '145.24893799999995', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/moonlitsanctuary', 'https://twitter.com/MoonlitSanctuar', 'https://www.instagram.com/moonlitsanctuary/?hl=en', 'http://www.moonlitsanctuary.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/moonlit-wildlife-sanctuary/moonlit-sanctuary-wildlife', NULL, '610359787935', 'info@moonlit-sanctuary.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:25:43', '2017-03-06 04:55:43', 2, 1, 1, 0),
(303, 578, 'Cairns Jet Boat Ride', NULL, 0, '', NULL, 'Grab your life jacket and strap yourself in for some high-speed fun in Cairns on this 35 minute jet boat adventure that combines thrills and sightseeing in the one enjoyable experience! On this Cairns jet boating ride, you''ll join the friendly and fun-spirited crew aboard ""Bad Fishy"", a turbo-charged jet boat, and head out on the water to perform a range of tricks and turns such as spins, slides, power-brakes and even the occasional 360. As the music cranks up, you''ll speed through the scenic waterway of Cairns'' Trinity Inlet with its wonderful surrounding mountains and wildlife-rich waters adding to the great atmosphere.\r\n\r\nKeep your eyes open - if you can! - for local marine and bird life; if you''re lucky, you might even spot one of the famous Cairns locals - a crocodile! Along the way, your jet boat captain will also provide you with some detailed, informative commentary on the local area and regional highlights, providing some background for all the great things you''ll see throughout the ride. Departing from the heart of Cairns, this jet boat experience is a great value and enjoyable outing for the whole family; as long as you''re willing to embrace some high-speed fun (and don''t mind getting wet), you''ll be in for one of Cairns'' best tours that''s fun for adults and kids alike!', NULL, NULL, 'Wharf A, The Marlin Marina, Cairns City QLD 4870', '-16.9223547', '145.7808471', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/cairnsjetboat', 'https://twitter.com/_badfishy?lang=en', 'https://www.instagram.com/badfishy_cairnsjetboat/', 'http://www.badfishy.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/activities/cairns-jet-boating/cairns-jet-boat-ride', NULL, '610499490030', 'bookings@badfishy.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:26:18', '2017-03-06 04:56:18', 2, 1, 1, 0),
(304, 579, 'Kuranda Koala Gardens', NULL, 0, '', 'Logo-0306201704045739.jpg', 'Visit the home of the koalas in the Cairns region with tickets to the fun Kuranda Koala Gardens where you''ll get to see these cuddly creatures and many of their other wildlife friends. Perhaps Australia''s most iconic animal, the koalas are at their best at Koala Gardens in the heart of Kuranda - the combination of animals and environment make for a great day out for both adults and families with kids alike!\r\n\r\nDespite the name, koalas aren''t the only animal you''ll come across you''ll also see freshwater and saltwater crocodiles, wallabies, snakes and much more as they play in their natural habitats as you stroll through the relaxing, lush surroundings all within an easily reachable distance from Cairns. This amazing selection of mammals and reptiles both scaly and loveable makes for a great day out in the Cairns region. So grab a ticket to Koala Gardens and get a dose of this wonderful atmosphere and see for yourself!', NULL, NULL, '2-4 Rob Veivers Dr, Kuranda QLD 4881', '-16.8194501', '145.6335274', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Kuranda-Koala-Gardens-236308029719974/', '', '', 'http://www.koalagardens.com/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/kuranda-koala-gardens/kuranda-koala-gardens', NULL, '610740939953', 'reservations@koalagardens.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:27:39', '2017-03-06 04:57:39', 2, 1, 1, 0),
(305, 580, 'White Water Rafting on the Mitta Mitta River', NULL, 0, '', NULL, 'Get set for a wild and wonderful white water adventure on the Mitta Mitta River outside Melbourne with a full day rafting journey full of watery fun! Join your friendly whitewater rafting operators and hit the Mitta Mitta in the heart of the stunning Alpine National Park at a departure point near Omeo around 4.5 hours from Melbourne. Buckle up your helmet and life jacket then head down this run of crystal-clear water featuring over 60 rapids ranging between grades 2 and 4, making it a waterway that''s great for beginners and more advanced rafters alike.\r\n\r\nFeaturing over 18 kilometres worth of rafting thrills in total as well as a stunning showcase of Aussie back-country nature and wildlife, this white water rafting experience is one of the few of its kind in Victoria. With inclusions such as delicious riverside lunch, guided commentary on the nature and history of the surroundings, and some pure, unfiltered white water fun, this Mitta Mitta River rafting adventure is available every weekend as well as with mid-week bookings for larger groups. If you''re looking for Victoria''s ultimate rafting day out, then book this adrenaline-filled tour online today!', NULL, NULL, '993 Benambra Road, Hinnomunjie Victoria 3898', '-37.0104359', '147.6573412', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://raftingaustralia.com.au/mitta-mitta-river/', 'https://facetag.experienceoz.com.au/en/melbourne/extreme/white-water-rafting-melbourne/1-day-mitta-mitta-river-trip', NULL, '610260771164', 'Info@rafting.net.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:27:44', '2017-03-06 04:57:44', 2, 1, 1, 0),
(306, 581, 'Billy Tea Safaris', NULL, 0, '', 'Logo-0306201704045906.png', 'Explore the wonders of two of tropical north QLD''s best highlights - the Daintree Rainforest and Cape Tribulation - with an amazing offroad 4WD tour! Combining stunning scenery with an in-depth look at the region''s abundant flora and fauna, on this tour you''ll join your expert naturalist guides in the morning then head out from either Cairns or Port Douglas along a wonderful coastal route. Take in the breathtaking views of the Coral Sea, before arriving at the Daintree River for a morning tea break. Hop on a vessel for an informative guided river cruise right into the heart of this incredible rainforest.\r\n\r\nNext up, head up the Alexandra Range for some panoramic views of the green World Heritage rainforest clashing with the vibrant blue of the ocean. Visit an animal refuge centre and feed kangaroos and other animals before enjoying a delicious BBQ style lunch amongst the rainforest. Once you''re recharged we visit Emmagen Creek along the Bloomfield Track - a pristine, untouched example of Aussie nature with the chance for a rainforest swim.\r\n\r\nAll capped off with a visit to the wonderful Cape Tribulation beach, this is a comprehensive tropical north Queensland tour that covers all aspects of the Daintree and beyond - so book online today!', NULL, NULL, '94 Upper Richardson Street, Cairns, QLD, 4870, Australia', '-16.9059595', '145.73221039999999', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/BillyTeaSafaris/', 'https://twitter.com/billyteasafaris', '', 'http://www.billytea.com.au/tours/daintree-rainforest-cape-tribulation-bloomfield-track', 'https://facetag.experienceoz.com.au/en/cairns/tours/cape-tribulation-and-daintree-rainforest-small-group-tour-from-cairns-and-port-douglas/cape-tribulation-and-daintree-rainforest-4wd-tour', NULL, '610740320077', 'info@billytea.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:29:06', '2017-03-06 04:59:06', 2, 1, 1, 0),
(307, 582, 'Cairns ZOOM', NULL, 0, '', 'Logo-0306201705050048.png', 'Combine two great Cairns attractions into one fun-filled package with entry to Cairns ZOOM and Wildlife Dome. The first of its kind in the world, this popular Cairns attraction is an indoor ropes course inside a wildlife exhibit. Located on the top of Cairns'' Reef Hotel Casino, you can choose from the Mid-ZOOM or High-ZOOM course, featuring a total of 65 different elements including crossings, tunnels, climbing walls, cargo nets and zip lines. An experience for adventure enthusiasts, the course travels around the wildlife dome getting you up close to various animals including gliding over the 4-metre long saltwater crocodile, Goliath.\r\n\r\nIf you''re chasing a little more adventure, try the PowerJump, a 13-metre free fall adventure, or the Pirate Climb & Commando Rope Climb challenges. The ZOOM experience provides a birds-eye-view of the animal enclosure and the surrounding region, while entry to the dome lets you explore the ground level enclosures including the bird aviary and reptile enclosures.\r\n\r\nThe perfect way to get up close and see some of Australia''s favourite animals with a twist, the Cairns ZOOM & Wildlife Dome attraction is a great adventure for all ages to enjoy year round no matter the weather.', NULL, NULL, '35 - 41 Wharf Street,  The Reef Hotel Casino, Cairns, Queensland 4870', '-16.9235936', '145.7794069', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/CairnsZoom/', 'https://twitter.com/cairnszoom', 'https://www.instagram.com/cairnszoom/', 'http://cairnszoom.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/activities/wildlife-dome/cairns-zoom-and-wildlife-dome', NULL, '610740317250', 'info@cairnszoom.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:30:48', '2017-03-06 05:00:48', 2, 1, 1, 0),
(308, 583, 'AJ Hackett Cairns', NULL, 0, '', 'Logo-0306201705050230.png', 'Visit the world''s first purpose built tower for Bungy Jumping and the unique Minjin Jungle Swing for a dose of adrenaline just outside Cairns! Nestled in the heart of a lush rainforest surroundings, this is the place to go for those looking to get the blood pumping in Tropical North Queensland - the Cairns Bungy Tower offers two of the best ""take the plunge"" experiences in Australia; take part in a traditional bungy jumping thrill with over 16 different jump styles to choose from, or soar through the air at high speeds on the unique Minjin Jungle Swing - either alone or with up to two friends.\r\n\r\nBungy jumping in Cairns will have you free-falling from a 50m high platform that offers stunning views out to the reef and beyond, while the Minjin Swing will drop you from 45m high and kick in just before you hit the ground, propelling you on and outwards on a massive arc - and those who are feeling particularly adventurous can even choose a package where you''ll get to do both! Simply choose either the Cairns Bungy Jumping or Minjin Swing option from the choices below to get your dose of adrenaline in the Cairns region underway today.', NULL, NULL, 'McGregor Road, Smithfield, Queensland, 4878, Australia', '-16.8208368', '145.69352649999996', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/ajhackettcairns/', 'https://twitter.com/ajhackettbungy?lang=en', 'https://www.instagram.com/ajhackettcairns/', 'https://www.ajhackett.com/cairns/', 'https://facetag.experienceoz.com.au/en/cairns/activities/bungy-jumping-in-cairns', NULL, '610740577188', 'cairns.reception@ajhackett.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:32:30', '2017-03-06 05:02:30', 2, 1, 1, 0),
(309, 584, 'Australian Butterfly Sanctuary', NULL, 0, '', 'Logo-0306201705050404.jpg', 'The Australian Butterfly Sanctuary in Cairns is set in the middle of the lush Kuranda rainforest and has been visited by over a million people since its opening! The Australian Butterfly Sanctuary''s 3666 cubic metre aviary is home to over 1500 magnificent tropical butterflies that are hand reared on the premises. All are local rainforest species, including the electric blue Ulysses and the majestic fluoro green Cairns Birdwing. Both these and the smaller but equally colourful species, provide visitors with the unique experience of being surrounded by these habitually elusive wonders of nature.\r\n\r\n30 minute guided tours through the aviary are available at no extra cost and occur regularly throughout the day, with informative facts delivered about the butterfly''s life cycle and behaviour. There are a range of tours available which include the Butterfly Sanctuary as part of their list of attractions due to their close to proximity to one another, such as our Cairns 4 Park Pass, to help you get the most out of the highlights of the region, so book a ticket today!', NULL, NULL, '8 Rob Veivers Dr, Kuranda QLD 4881', '-16.8198201', '145.6325019', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/KurandaButterflies/', '', 'https://www.instagram.com/australianbutterflysanctuary/', 'http://australianbutterflies.com/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/butterfly-sanctuary/australian-butterfly-sanctuary', NULL, '610740937575', 'ulysses@australianbutterflies.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:34:04', '2017-03-06 05:04:04', 2, 1, 1, 0),
(310, 585, 'Melbourne City Sights Afternoon Tour', NULL, 0, '', NULL, 'Save the early wakeup and instead book an afternoon sightseeing tour of Melbourne to take in all of the city''s lovely natural and man-made icons later in the day. Departing at 1:30pm, this half-day Melbourne city tours cover all of the essential highlights including the seaside precinct of St. Kilda, the colourful bathing boxes of Brighton, the sports complex featuring the likes of the MCG, Ethiad Stadium, and much more. Check out the city''s eclectic mix of suburbs both old and new while your friendly and informative diver-guide provides a detailed commentary on all of the history and architecture that makes Victoria''s capital great.\r\n\r\nA great and budget-friendly way to soak in Melbourne''s must-see''s, book a half day afternoon city sightseeing tour today.', NULL, NULL, 'Cnr Flinders St & Russell St, Melbourne, VIC 3000', '-37.817593', '144.967148', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/GrayLineOz', 'https://twitter.com/GrayLineAus', '', 'http://www.grayline.com.au/australia-sightseeing/melbourne-day-tours/melbourne-city-day-tours/melbourne-highlights-tour', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-and-dandenongs-tour/melbourne-highlights-and-blue-dandenongs-afternoon-tour', NULL, '611300858687', 'reservations@grayline.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:34:19', '2017-03-06 05:04:19', 2, 1, 1, 0),
(311, 586, 'Great Barrier Reef Cruise & Fly Packages', NULL, 0, '', 'Logo-0306201705050547.jpg', 'Explore the Great Barrier Reef with the choice of three epic adventure packages; the fly and cruise half day or full day trip, or the Get High package.\r\n\r\nThe fly and cruise half day trip sees guests enjoy a 25 minute flight flight to join Down Under Cruise and Dive on the reef at lunch time. The following two hours will be spent exploring the reef with the supplied snorkelling equipment, enjoying a barbecue lunch on board, and cruising back while enjoying a complimentary glass of wine with cheese and live entertainment.\r\n\r\nThe full day trip begins with a fast cruise to two reef sites, giving you up to 5 hours to enjoy on the reef. With all snorkelling equipment supplied, a barbecue lunch, free semi-submersible tour (valued at $10 per person), and return flight over the reef and sand cays back to Cairns, this is a full day adventure not to miss.\r\n\r\nFinally, the Get High Package includes a fast cruise to 2 reef sites, all of the above mentioned perks, as well as an introductory or certified dive and a scenic flight over Hastings Reef before cruising back to Cairns.\r\n\r\nThree exciting and scenic ways to explore the Great Barrier Reef, choose from one of the above packages with DownUnder Cruise & Dive. Book your spot online today to avoid missing out.', NULL, NULL, '287 Draper St, Cairns, QLD, 4870, Australia', '-16.9252428', '145.76700749999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/DownUnderCruiseandDive', '', 'https://www.instagram.com/downundercruiseanddive/', 'http://downundercruiseanddive.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/reef-and-island-cruises/great-barrier-reef-scenic-helicopter-flight-and-cruise-packages-/down-under-cruise-packages', NULL, '610740528300', 'reservations@downunderdive.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:35:47', '2017-03-06 05:05:47', 2, 1, 1, 0),
(312, 587, 'Spirit Of Melbourne Cruising Restaurant', NULL, 0, '', 'Logo-0306201705050722.jpg', 'Enjoy one of Melbourne''s most unique dining experiences with a delicious 4 course meal aboard the Spirit of Melbourne Cruising Restaurant as it winds its way along the calm waters of the Yarra River past the glowing city lights of Melbourne! Over the course of 3 hours, you''ll enjoy freshly-prepared food as well as a number of included beverages - both alcoholic and softdrinks - for the duration of your cruise included in the price of admission. Seeing Melbourne city at night provides an entirely new viewpoint on the skyline, which you''ll be able to view from either the expansive viewing windows indoors, or outside on the viewing deck.\r\n\r\nEnjoy a tantalising tasting platter to start, then follow it up with your choice of several mains including chicken, fish, beef, pork and a vegetarian option to ensure all tastes are covered. Indulge your sweet tooth with a range of enjoyable mini desserts, then cap everything off with a lovely cheese platter consisting of a number of Aussie cheeses, crackers, fruit and nuts. Ideal for both celebrating special occasions or simply for a classy and relaxing night out, this Melbourne dinner cruise is one of the more special ways to dine out in Victoria''s capital.', NULL, NULL, 'Vault 11, Banana Alley, 365 Finders, Street, Melbourne VIC 3000', '-37.8191555', '144.9619425', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/melbournerivercruises/', 'https://twitter.com/melbcruises', 'https://www.instagram.com/melbournerivercruises/', 'https://www.melbcruises.com.au', 'https://facetag.experienceoz.com.au/en/melbourne/cruises/melbourne-cruising-restaurant/melbourne-cruising-restaurant', NULL, '610386102600', 'info@melbcruises.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:37:22', '2017-03-06 05:07:22', 2, 1, 1, 0),
(313, 588, 'Flames of the Forest Rainforest Dining Experience', NULL, 0, '', 'Logo-0306201705050728.jpg', 'Be transported into a magical setting at Flames of the Forest in Tropical North Queensland - one of the most unique dining experiences available in the state. This rainforest dining experience is a relaxing and enjoyable way to escape the ordinary dinner cycle and experience a delicious meal in the heart of the rainforest under the twinkling night sky. Located near Port Douglas, this timeless experiences gives you the option to simply relax with your partner, family or friends, or socialise with fellow diners and travellers - the choice is yours. The Aboriginal Cultural Dining experience features a range of perfectly curated meals accompanied by aromatic Australian wines and treated to local indigenous musicians and storytellers who will teach you about the ancient culture of the local Aboriginal people.\r\n\r\nIf you''d prefer a more intimate experience, the Romantic Dining option will let you keep to yourself and indulge on the delicious food and wine while admiring the spectacular setting. Flames of the Forest is located just 10 minutes from Port Douglas, 30 minutes from Palm Cove, 50 minutes from Cairns and what seems a world away from the everyday. At Flames of the Forest guests can choose from two very different styles of dining; choose from an Aboriginal cultural dining experience or an exclusive romantic evening of dining amongst this unique rainforest setting. Either way – it will be a wonderful tropical evening in Port Douglas and one that you will never forget!', NULL, NULL, '29 Barrier St, Port Douglas, QLD, 4877, Australia', '-16.5207864', '145.47138589999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Flames-of-the-Forest-197249660294836/', 'https://twitter.com/flames_forest', 'https://www.instagram.com/flamesoftheforest/', 'http://www.flamesoftheforest.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/flames-of-the-forest', NULL, '610740993144', 'caroline@flamesoftheforest.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:37:28', '2017-03-06 05:07:28', 2, 1, 1, 0),
(314, 589, 'Con-X-Ion Melbourne Airport Transfers', NULL, 0, '', 'Logo-0306201705050903.jpg', 'Arriving home to Melbourne from a long journey or flying in for an unforgettable Melbourne getaway? Remove the stress factor from your travel plans with a reliable and comfortable Melbourne airport transfer. Arriving in to a new place can be stressful and trying to find your way around after a flight is the last thing you need! Save your strength for exploring and adventuring your way around Victoria’s largest city and book a convenient Melbourne Airport transfer to your chosen accommodation in Melbourne!\r\n\r\nAn airport transfer service will pick you up from the Melbourne International or Domestic Terminal and take you straight to the door of your Melbourne accommodation – its convenient, easy and most importantly – stress free! Whether you are travelling alone, with your family or in a group you need a hassle-free service that gets you there quickly, safely and at an affordable price.', NULL, NULL, '29 Barrie Rd, Tullamarine, VIC, 3043, Australia', '-37.71320559999999', '144.87651359999995', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/cxnairporttransfers', 'https://twitter.com/ConXionAus', '', 'https://www.con-x-ion.com/services/melbourne-airport-transfers', 'https://facetag.experienceoz.com.au/en/melbourne/transport/melbourne-airport-arrival-transfers/melbourne-airport-arrival-transfer', NULL, '611300266946', 'enquiries@con-x-ion.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:39:03', '2017-03-06 05:09:03', 2, 1, 1, 0),
(315, 590, 'Passions of Paradise', NULL, 0, '', 'Logo-0306201705051008.png', 'See the best of the Great Barrier Reef in style and comfort with this sailing cruise from Cairns aboard a purpose-built sailing catamaran! Live the life of luxury aboard a wonderful vessel while surrounded by the spectacular azure blues and emerald greens of Australia''s most famous natural icon as we head out to the stunning areas of Michaelmas Cay and Paradise Reef. Here you''ll have the opportunity to snorkel with all the marine life, take part in scuba diving, take a glass bottom boat ride or simply relax on the spacious foredeck and soak up the sunshine - the choice is yours.\r\n\r\nWe ensure you get to experience the least crowded areas so you can maximise your enjoyment of the reef, with a great, friendly crew who will provide you with all scuba and snorkelling tuition plus give you a guided snorkelling tour pointing out all the best marine highlights. With morning and afternoon tea as well as a tropical buffet lunch and all equipment included, this is the comprehensive reef day trip for those who want to get a full day of Outer Reef enjoyment while ""taking it easy"" amongst these unforgettably picturesque surrounds. For the ultimate one-day Great Barrier Reef adventure, book this sailing cruise from Cairns online today.', NULL, NULL, '1 Spence St, Cairns City, QLD, 4870, Australia', '-16.9226321', '145.7787654', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/passionsofparadise/', 'https://twitter.com/PassionsReef', '', 'https://passions.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/reef-and-island-cruises/sailing-cruise-to-the-outer-great-barrier-reef/great-barrier-reef-sailing-cruise', NULL, '610740411600', 'reservations@passions.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:40:09', '2017-03-06 05:10:09', 2, 1, 1, 0),
(316, 591, 'Segway Tours Yarra Valley | Segway Victoria', NULL, 0, '', 'Logo-0306201705051151.jpg', 'If you''re looking for a day tour around Melbourne and Victoria with a different twist, these guided Segway tours of the lush and lovely Yarra Valley will be just what you''re looking for! What exactly is a Segway? It''s unlike any other form of transport - a two-wheeled, stand-up, self-balancing electric vehicle powered by a combination of computers and motors that provides the perfect navigation method to explore this wonderful region up close while sparing your legs from walking and still being able to take in the fresh air.\r\n\r\nExperience the delights of gliding amongst grapevines at the famed Rochford Winery as experienced, friendly guides provide you with full training and take you around the vineyard aboard your Segway as you learn about grape growing and wine production along the way. Afterwards it''s time to put your newfound Segway skills to the test on the specially-designed offroad track - fun for all ages. Cap off the entire experience with a delicious meal at the award-winning Rochford Restaurant surrounded by the greenery of the lush vineyards!', NULL, NULL, 'Maroondah Highway, Coldstream, Victoria, 3770, Australia', '-37.6987986', '145.41940840000007', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/SegwayVictoria/', 'https://twitter.com/SegwayVictoria', 'https://www.instagram.com/SegwayVictoria/', 'http://www.segwayvictoria.com.au/segway-tours/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/yarra-valley-segway-tours', NULL, '610394855293', 'info@segwayvictoria.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:41:51', '2017-03-06 05:11:51', 2, 1, 1, 0),
(317, 592, 'Cape Trib Connections', NULL, 0, '', 'Logo-0306201705051242.jpg', 'Explore two of Tropical North Queensland''s most beautiful wonders in this bundled day tour to Cape Tribulation and Mossman Gorge. With accommodation transfers from Cairns, Northern Beaches and Port Douglas included in the price, you''ll be collected in the morning to begin your adventure into this beautiful part of the region. Journeying into the lush, ancient heart of the Cairns region, the tour will travel north along the Queensland coast passing Port Douglas and other natural highlights including beautiful sights of the reef and vibrant blue waters.\r\n\r\nTravelling further along the Cook Highway, your first destination will be Cape Tribulation where you can enjoy spectacular beach views prior to jumping aboard your scenic rainforest cruise boat. Cruising along the Daintree River, this water journey will prove to be both scenic and exciting as the area is inhabited by a range of native Australian wildlife including crocodiles, so be sure to keep your eyes peeled!\r\n\r\nWhile on board, you''ll be treated to informative commentary about the region while scouring the waters and banks for the large crocodiles that live here. Come the conclusion of the cruise, you''ll be led on an exciting bush walk through the Mossman Gorge National Park before reaching Mossman Gorge itself. Here you will be given ample time to explore the area surrounding the gorge and go for a dip (if it''s not too cold). From here, you will begin the return journey back to your accommodation with arrivals scheduled between 5:15pm and 6:30pm depending on where you are staying.\r\n\r\nFor a comprehensive and great value rainforest tour adventure, book this Cape Tribulation and Daintree National Park Day tour online today.', NULL, NULL, 'Cairns City QLD 4870', '-16.9185514', '145.7780548', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/CapeTribConnections/', 'https://twitter.com/capeconnections', '', 'http://www.capetribconnections.com/day-tour.htm', 'https://facetag.experienceoz.com.au/en/cairns/tours/cape-tribulation-and-daintree-rainforest-tour-from-cairns/cape-tribulation-and-daintree-rainforest-tour', NULL, '610740320500', 'info@capetribconnections.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:42:42', '2017-03-06 05:12:42', 2, 1, 1, 0),
(318, 593, 'Down and Dirty Quad Bike Tours', NULL, 0, '', 'Logo-0306201705051438.png', 'Zig Zag along rainforest and adventure trails on your very own four wheeled Quad Bike or ATV, as fantastic guides take you out for as much fun as you can handle whilst getting down and dirty!\r\n\r\nYour tour includes all safety equipment and an introductory lesson, so if you haven''t ridden at ATV before, it doesn''t matter! Choose between one of the times below and get ready for a great day of fun and adventure!', NULL, NULL, '2735 Kennedy Hwy, Koah, Queensland', '-16.9117328', '145.5626897', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Down-and-Dirty-Quad-Bike-tours-Cairns-143287575700593/', '', '', 'http://www.downanddirtyquads.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/activities/cairns-horse-riding', NULL, '610740582396', 'info@downanddirtyquads.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:44:38', '2017-03-06 05:14:38', 2, 1, 1, 0),
(319, 594, 'The Colonial Tramcar Restaurant', NULL, 0, '', 'Logo-0306201705051502.jpg', 'This great value tour of Melbourne and its surrounds is completely comprehensive and - when combined with the delicious meal served aboard an authentic tramcar - ensures that no highlight or aspect of this great Victorian region is missed! With a tour of the city''s highlights that covers all the essential architecture and landmarks that Melbourne is famous for, along with a scenic cruise down the lovely Yarra River and a trip to the Brighton Bathing Boxes, you''ll come away with one of the most thorough day tours that ensures no sight or sound is left either unseen or unheard - and caps it all off with a delicious 3 course meal in an utterly unique environment.', NULL, NULL, '125, Cnr Normanby Rd & Clarendon St, South Melbourne, VIC 3205', '-37.8697', '145.032406', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/tramrestaurant', 'https://twitter.com/TramRestaurant', 'https://www.instagram.com/TramRestaurant/', 'http://www.tramrestaurant.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-tour-with-tramcar-restaurant-and-cruise/melbourne-city-tour-with-colonial-tramcar-restaurant-dinner-and-yarra-river-cruise', NULL, '610396954000', 'reservations@tramrestaurant.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:45:02', '2017-03-06 05:15:02', 2, 1, 1, 0),
(320, 595, 'Green Island Discovery Tour', NULL, 0, '', 'Logo-0306201705051603.png', 'On this great value, comprehensive day tour from Cairns, you''ll pay a visit to the ever-popular Green Island just off the coast for a full day''s itinerary that includes a snorkelling trip and a glass bottom boat adventure! This Green Island tour takes you to a paradise which sits just 45 minutes from Cairns aboard a fast catamaran to a beautiful 6000 year old coral cay in the Great Barrier Reef. With its unique reef and rainforest environment that is home to over 120 native plant species and colourful bird life, it’s a nature lover’s paradise. Your Green Island tour includes both snorkelling and an informative glass bottom boat tour to fully experience this beautiful Great Barrier Reef island from both the wet and dry side of things; and, with a variety of departure and return cruise times, you have the ability to spend as much as 7 hours enjoying the island and its reef surrounds!\r\n\r\nAs a guest, you’ll enjoy many exclusive inclusions such as the use of the island swimming pool and a self guided eco island walk to discover some of the island’s unique rainforest flora. The well-appointed day visitor facilities include a range of restaurant and café style lunch options and a wide range of optional activities including scuba and helmet diving, snorkel trips, parasailing and scenic helicopter flights. Get to and from Green Island and Cairns in style with this return package - book yourself a tour online today!', NULL, NULL, '1 Spence St, Cairns, 4870, Queensland,', '-16.9226182', '145.7787535', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/GreatAdventuresCruises/', '', 'https://www.instagram.com/reefcruises/', 'https://greatadventures.com.au/tours-green-island/', 'https://facetag.experienceoz.com.au/en/cairns/reef-and-island-cruises/green-island-day-trip-including-glass-bottom-boat-and-snorkel-hire/green-island-discovery', NULL, '610740449944', 'central_ga@quicksilvergroup.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:46:03', '2017-03-06 05:16:03', 2, 1, 1, 0),
(321, 596, 'Wildlife Coast Cruises', NULL, 0, '', 'Logo-0306201705051648.png', 'Visit Australia''s most famous Fur Seal colony in with a stunning 2 hour cruise to Phillip Island''s ruggedly beautiful south-west coast! These playful and inquisitive animals are a must-see for wildlife lovers as their nature leads them to approach the boat and makes for some outstanding photo opportunities. Climb aboard the comfortable vessel then simply sit back, relax and enjoy the scenery as you head out from Melbourne towards Phillip Island''s famously wildlife-rich surrounds, keeping an eye out for dolphins, a huge number of sea birds, and much more.\r\n\r\nEnjoy a complimentary morning or afternoon tea and, upon arrival, you''ll get to witness an average of five thousand seals from a very close distance - the number and activity of which will no doubt surprise, impress and enchant you. If you''ve got even a passing interest in wildlife, don''t hesitate to book this Phillip Island seal cruise online today for a memorable - and reasonably priced - adventure!', NULL, NULL, '11/13 The Esplanade, Cowes, VIC, 3922, Australia', '-38.44822540000001', '145.2389948', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/WildlifeCoastCruises', '', 'https://www.instagram.com/wildlifecoastcruises/', 'http://www.wildlifecoastcruises.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/seal-watching-cruise-phillip-island/seal-watching-cruise', NULL, '610359523501', 'info@wildlifecoastcruises.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:46:49', '2017-03-06 05:16:49', 2, 1, 1, 0),
(322, 597, 'Paronella Park', NULL, 0, '', 'Logo-0306201705051855.jpg', 'Featuring beautiful gardens, amazing buildings and plenty of history, North QLD''s Paronella Park makes for an enchanting place both to stay and explore. Located at Mena Creek, this boutique caravan park and adventure wonderland is a unique attraction in Australia, with peaceful surrounds and plenty to see and do all set within lush rainforest surrounds. Entry fee includes a free overnight camping lot, making for the ideal place to settle down and relax while doing some exploring.\r\n\r\nThis option includes a 45 minute guided walk which will take you through the many highlights of the park while telling the amazing story of Jose Paronella''s dreams and vision which lead to the park''s creation. With a cafe open daily for lunch, wonderfully scenic botanical walk, and both day and darkness tour options running regularly throughout the week, this is one of the most enchanting places you''re likely to experience in Tropical North QLD - so book Paronella Park online today!', NULL, NULL, '1671 Japoonvale Rd , Mena Creek, Queensland 4871', '-17.6727913', '145.8978803', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/paronellapark/', 'https://twitter.com/Paronella', '', 'http://www.paronellapark.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/paronella-park/paronella-park', NULL, '610740650000', 'info@paronellapark.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:48:55', '2017-03-06 05:18:55', 2, 1, 1, 0),
(323, 598, 'Parks Victoria', NULL, 0, '', 'Logo-0306201705051928.png', 'Visit the wildlife-rich Wilsons Promontory in Victoria - one of the state''s best-kept secrets - on this day tour for hiking, plenty of Aussie native animals, stunning coastal views and much more! This popular sightseeing destination sits at the very tip of Australia''s southern mainland, and this tour will take you to experience all of its manly highlights. Departing from Melbourne early in the morning (7:30am), you''ll be taken first by coach and then by foot on a variety of adventures to explore the Promontory''s offerings - expect bush walking and hiking through Wilson''s Promontory National Park to see wildlife such as kangaroos, emus and wombats in their natural environments.\r\n\r\nTake in the breathtaking coastal views and visit such regional icons as the shores of Squeaky Beach and the impressive Giant Rock which towers over its surroundings. For one of the most comprehensive and best-value visits to one of Victoria''s true natural treasures, book a Wilson''s Promontory tour online today!', NULL, NULL, 'Wilsons Promontory Marine National Park, Wilsons Promontory, Victoria, 3960, Australia', '-39.133677', '146.37628110000003', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/wilsonsprom/', '', '', 'http://parkweb.vic.gov.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/wilsons-promontory-national-park-day-tour-from-melbourne/wilsons-promontory-national-park-tour', NULL, '61131963', 'info@parks.vic.gov.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:49:28', '2017-03-06 05:19:28', 2, 1, 1, 0),
(324, 599, 'Barron River Half Day White Water Rafting', NULL, 0, '', NULL, 'Enjoy a half day of rafting on the Barron River with an exhilarating white water rafting experience. This river rafting experiences is affordable, exciting and makes for an exhilarating and memorable day out! Experience river rafting on a series of rapid courses ranging from grades 1 to 4 ensuring an enjoyable challenge for all participants!\r\n\r\nAll white water rafting trips are guided by expert rafters who will show you the best ways to negotiate the rapids while maintaining a safe environment in which you can enjoy the excitement without ever feeling a sense of danger. All sports rafts are purpose-built and super stable to ensure extra safety. Whether travelling as an individual, couple, or group, white water rafting in Cairns is an amazing experience that will leave you exhilarated and with a massive sense of personal achievement.', NULL, NULL, '19-21 Barry Street, Cairns, QLD, 4870, Australia', '-16.93860459999999', '145.75319209999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/foamingfury?fref=ts', '', 'https://www.instagram.com/foamingfury/', 'http://www.foamingfury.com.au/barron-river-half-day/', 'https://facetag.experienceoz.com.au/en/cairns/activities/barron-river-and-russell-river-white-water-rafting', NULL, '610740313460', 'bookings@foamingfury.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:50:17', '2017-03-06 05:20:17', 2, 1, 1, 0);
