(325, 600, 'Melbourne Sports Tours', NULL, 0, '', 'Logo-0306201705052442.jpg', 'Sports play a major part in Melbourne''s culture as a city, and with a Melbourne sports tour you''ll be able to go behind the scenes of some of Australia''s most famous sporting venues that have seen some truly memorable moments throughout sporting history including the Melbourne Cricket Ground (MCG), Rod Laver Arena, Flemington and more. Join your knowledgeable expert sports hosts and discover the stories behind the fields, stadiums and racetracks that have been graced by some truly famous faces over the decades.\r\n\r\nOn these tours you''ll learn interesting facts delivered in a passionate and engaging fashion by your guide who knows all the ins and outs of Melbourne''s sporting history; in addition, you''ll have the option for either half or extended full day tours for the chance to go even more in-depth. Simply choose from the range of available Melbourne sports tours below to garner the ultimate look at the sporting venue of your choice today!', NULL, NULL, 'Russell St Departures-Federation Square, Melbourne, VIC 3000', '-37.8182711', '144.9670618', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/melbournesportstours', 'https://twitter.com/MelbSportsTours', '', 'http://www.melbournesportstours.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-sports-tours', NULL, '610388024547', 'sales@melbournesportstours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:54:42', '2017-03-06 05:24:42', 2, 1, 1, 0),
(326, 601, 'phillip island nature parks', NULL, 0, '', 'Logo-0306201705052653.jpg', 'Experience some of Phillip Island''s best attractions with this ''4 Park Pass''. Providing you with entry to the region''s most popular sites within the Phillip Island Nature Park including the Penguin Parade, Koala Conservation Centre, Churchill Island Heritage Farm and the Antarctic Journey. A great outing for all ages, Phillip Island Nature Park is a great way to get up close to local wildlife and learn all about the region including its heritage and furry residents.\r\n\r\nPenguin Parade will get you up close to large groups of Little Penguins as they make their way from the water to the beach to rest for the evening. Koala Conservation Centre will let you see these adorable Aussie favourites in their natural environment away from the cages and enclosures. Churchill Island Heritage Farm offers guests the chance to step back in time and learn about the old ways of the region with various farm activities and sheep shearing as well as letting you get up close to a range of animals including wallabies. Finally, this pass will also give you entry in the Antarctic Journey, which is a family friendly, hands-on interactive exhibit letting you experience an Antarctic Journey at the Nobbies via multimedia displays and virtual experiences.\r\n\r\nPhillip Island is reached within a short 90 minute trip from Melbourne and offers visitors an enjoyable, wildlife loving day out of the city. Combining all of these attractions into one affordable pass will let you save money while enjoying yourself on your next Victorian holiday. This Phillip Island 4 park pass provides a unique educational experience for everyone to enjoy - so grab yours online today!', NULL, NULL, '1019 Ventnor Rd, Summerlands, Summerlands, VIC 3922', '-38.509003', '145.147827', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/PhillipIslandNatureParks', 'https://twitter.com/PhillipIslandNP', 'https://www.instagram.com/phillipislandnp/?hl=en', 'https://www.penguins.org.au/', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/phillip-island-nature-parks/3-parks-pass', NULL, '610359512800', 'info@penguins.org.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:56:53', '2017-03-06 05:26:53', 2, 1, 1, 0),
(327, 602, 'Tjapukai Aboriginal Cultural Park', NULL, 0, '', 'Logo-0306201705052747.png', 'Come and experience an authentic Aboriginal culture with the Tjapukai people in Cairns. Wander through the Magic Space to view authentic stone age artifacts once used by the Tjapukai tribe. Murals created by Tjapukai artists tell the legends of the past. Enjoy the sounds of the haunting didgeridoo in the Nature''s Voice Theatre. The Didgeridoo - A Journey show explores the traditional didgeridoo and incorporates contemporary music with beautiful images of the distinctive region. The Creation theatre tells the stories of the dreamtime and traditional beliefs of the Tjapukai people.\r\n\r\nMove through to the Tjapukai Dance Theatre to experience a dance performance of Tjapukai traditional corroborees. The Cultural Village will provide an opportunity to interact with members of the Tjapukai community. Try your hand at boomerang and spear throwing. Listen, learn and ask questions on what traditional hunting techniques and weapons were used 40, 000 years ago. For those that are keen to broaden their knowledge on bush foods and medicines, Tjapukai provides short demonstrations for you.', NULL, NULL, 'Cairns Western Arterial Road, Caravonica (Cairns) Queensland 4878', '-16.848724', '145.694909', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/tjapukai', 'https://twitter.com/tjapukai_aust', 'https://www.instagram.com/tjapukaiwhereaustraliabegins/', 'http://www.tjapukai.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/tjapukai-aboriginal-cultural-park/tjapukai-aboriginal-cultural-park-cairns-by-day', NULL, '610740429999', 'bookings@tjapukai.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:57:47', '2017-03-06 05:27:47', 2, 1, 1, 0),
(328, 603, 'Melbourne Walking Tours', NULL, 0, '', 'Logo-0306201705052832.jpg', 'Experience Melbourne in a variety of ways with these great value walking tours that let you witness all of its sightseeing and culinary highlights up close! From the best bars to the tastiest treats to the coolest coffee houses, all aspects of what make Melbourne a special city are covered here, and each walking tour will no doubt leave you intrigued and impressed by the immense amount of variety that Victoria''s capital can offer you - regardless of your personal tastes.\r\n\r\nCombining outstanding sightseeing opportunities with delicious food and entertaining and informative storytelling, these Melbourne walking tours may be just what you''re looking for if you want to experience what the city has to offer without joining your run-of-the-mill city tour. Simply choose from the tour options available below and get your personalised Melbourne adventure underway today!', NULL, NULL, 'Melbourne, 18 Wright Street, Middle Park, Victoria, 3206, Australia', '-37.84639500000001', '144.96034899999995', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://melbournewalks.com.au', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-walking-tours', NULL, '610390907964', 'melbwalks@gmail.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-05 23:58:32', '2017-03-06 05:28:32', 2, 1, 1, 0),
(329, 604, 'Hartleys Crocodile Adventures', NULL, 0, '', 'Logo-0306201705053001.png', 'Hartley''s Crocodile Adventures is one of the true must-do experiences in the tropical north Queensland region for wildlife-lovers young and old alike! Located at Palm Cove - easily reachable within around 40 minutes from Cairns and 25 minutes from Port Douglas - Hartley''s Crocodile Adventures provides the chance to get up close with some of Australia''s best native wildlife all within a huge, ten hectare, World-Heritage protected environment.\r\n\r\nTour Hartley''s Lagoon - the best spot in the park to see crocs in their natural environment; take the Cassowary Walk and see these huge and strikingly coloured birds that date back millions of years; walk the Wildlife Discovery Trail and see a delightful mix of reptiles and birds, and much, much more. While crocodiles are in the name, there''s a host of other wildlife on offer as well, including such favourites as cuddly koalas and slithery snakes. Hartley''s Crocodile Adventures is both entertaining and educational - so don''t miss the chance to visit when you''re in tropical North QLD; grab a ticket online today!', NULL, NULL, 'Captain Cook Hwy, Wangetti Beach, Queensland 4879', '-16.6640891', '145.5638296', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Hartleys-Crocodile-Adventures-212091295213/', '', 'https://www.instagram.com/hartleyscrocodileadventures/', 'http://www.crocodileadventures.com/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/hartleys-crocodile-adventures/hartleys-crocodile-adventures', NULL, '610740553576', 'sales@crocodileadventures.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:00:01', '2017-03-06 05:30:01', 2, 1, 1, 0),
(330, 605, 'Mountain Bike Adventures', NULL, 0, '', 'Logo-0306201705053132.png', 'Strap on your helmet and get set to combine some great Victorian nature with some offroad biking thrills on this You Yangs Regional Park guided bike tour. Join your friendly and knowledgeable guides as they take you on an adventure on two wheels, hopping on a quality mountain bike and heading along the Kurrajong mountain bike trails on the east side of the You Yangs of varying thrill and challenge levels ranging through from beginner to advanced. Before setting out, you''ll be given a full safety briefing and the chance to test your skills on your new bike and then, once you feel comfortable, get underway.\r\n\r\nKeep your eyes peeled for native wildlife such as wallabies and kangaroos along the way, as this is an animal-rich part of Victoria. Take advantage of the well-maintained - yet naturally shaded - biking tracks to cover a lot of ground and ensure you get a comprehensive and true ""Aussie bush"" experience during your day out. An excellent way to blend sightseeing with exercise and outdoor enjoyment, this Victorian mountain bike tour is suitable for all ages.', NULL, NULL, '42 Macaulay St, Williamstown North, Victoria, 3016, Australia', '-37.8492665', '144.86200129999997', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/mtbadventuresaustralia', 'https://twitter.com/mtbadventuresau', 'https://www.instagram.com/mtb_adventures_australia/', 'http://www.mountainbiketoursaustralia.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/bike-and-bush-adventure-day-tour/you-yangs-regional-park-bike-adventure-day-tour', NULL, '610393931355', 'info@mountainbikeadventures.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:01:32', '2017-03-06 05:31:32', 2, 1, 1, 0),
(331, 606, 'Ocean Spirit Cruises', NULL, 0, '', 'Logo-0306201705053212.png', 'On this full day tour from Cairns, you''ll cruise to the spectacular Michaelmas Cay, a wonderful natural reef-island that is teeming with marine life and corals of a range of colours that makes for a perfect snorkelling destination! This comprehensive 8 hour cruise experience will allow you to enjoy 4 full hours out on the reef at Michaelmas Cay and its fringing reefs surrounding its golden sands. With everything you''ll need to enjoy the day provided by the operator you''ll have full, free use of all necessary equipment as well as snorkelling tuition and demonstrations for those who are snorkelling for the first time.\r\n\r\nMichaelmas Cay itself is spectacularly beautiful and a haven for wildlife as the entire area is a National Park and is brimming with sea birds and other wildlife that makes for a fascinating spot for a nature walk. Explore the island, relax on the spacious vessel, snorkel amongst the spectacular aquatic life of the Great Barrier Reef, board a semi-submersible and see the fish and corals through the glass. However you wish to spend your time at Michaelmas Cay, you''ll no doubt come away with some unforgettable memories of what makes the reef an essential bucket-list item. Departing from Cairns at 8:30am and returning at 5:00pm, this is a comprehensive itinerary with plenty of inclusions all at a great price - so book online today.', NULL, NULL, 'Reef Fleet Terminal, 1 Spence St, Cairns City QLD 4870', '-16.9213886', '145.7805855', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/OceanSpiritCruises', '', '', 'http://oceanspirit.com.au/index.html', 'https://facetag.experienceoz.com.au/en/cairns/reef-and-island-cruises/sailing-cruise-to-michaelmas-cay/michaelmas-cay-sailing-cruise', NULL, '610740449944', 'info@oceanspirit.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:02:12', '2017-03-06 05:32:12', 2, 1, 1, 0),
(332, 607, 'Carlton Brewhouse', NULL, 0, '', 'Logo-0306201705053405.png', 'Take the opportunity to explore Australia''s largest brewery with a Brewery Tour including Beer Tasting at the Carlton Brewhouse! On this tour, you''ll get to try some of Australia''s most talked about beers including Carlton Draught and Victoria Bitter with the help of your very knowledgable beer connoisseur tour guide while learning all the aspects of beer production and distribution. Located on the banks of the Yarra, you''ll be guided through 150 years of history as you explore this fantastic facility complete with a 150,000 litre flowing gold river of the very best beer - fresh every day! Get to know some of the trade secrets and learn how this well known brewing company has earned its prestigious reputation!\r\n\r\nIn this beer expedition you will be gobsmacked by the sheer size of this brewery, complete with a restaurant and beer garden where you can relax and enjoy a bite to eat. Perfect for anyone over 18 years of age, this Brewery Tour including Beer Tasting experience is the perfect chance to sample some of Australia''s finest beers and enjoy a fantastic, history filled day out!', NULL, NULL, '24 Thompson St, Abbotsford, VIC, 3067, Australia', '-37.80995430000001', '145.00333460000002', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/pages/Carlton-United-Breweries/112361475445379', '', '', 'https://www.carltonbrewhouse.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/carlton-brewhouse-tours/brewery-tour-including-beer-tasting', NULL, '610394206800', 'carlton@custhelp.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:04:05', '2017-03-06 05:34:05', 2, 1, 1, 0),
(333, 608, 'Feed a Crocodile at Hartleys Crocodile Adventures', NULL, 0, '', NULL, 'Ever wanted to feed a huge croc by yourself? Well here is your chance, and what better place to do it than the best place to see Crocs in Australia; Hartley''s Crocodile Adventures, just north of Cairns. A must-do experience in Tropical North Queensland where seeing a crocodile in the wild is almost second nature, doing so at Hartley''s Crocodile Adventures means you''ll receive expert aid while also learning about these incredible reptiles.\r\n\r\nYour Big Croc Feed Experience includes entry to Hartley''s Crocodile Adventures where you can pole feed a huge croc by yourself, enjoy a personalised guided talk with a crocodile handler, and meet and hold a juvenile estuarine crocodile. You''ll also receive a digital photo and signed certificate to commemorate your crocodile adventure. The Big Croc Feed experience is available daily from 10:30am and 1pm with the park operating from 8:30am until 5pm on a daily basis (except for Christmas Day). Book online now for one of the most daring experiences in Far North Queensland.', NULL, NULL, '58 Mitchell Street, 0800 Darwin', '-12.4623301', '130.8392567', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Crocosaurus.Cove', '', 'https://www.instagram.com/CrocosaurusCove/', 'http://www.crocosauruscove.com/attractions/big-croc-feed-experience/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/crocodile-feeding-experience/big-croc-feed', NULL, '610889817522', 'info@croccove.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:04:57', '2017-03-06 05:34:57', 2, 1, 1, 0),
(334, 609, 'The Comics Lounge', NULL, 0, '', 'Logo-0306201705053537.png', 'Enjoy an evening full of laughs with tickets to the Comics Lounge Comedy Show in Melbourne! In this two and a half hour live stand up show, you''ll lose yourself in a night bursting with fun and humour! The longest running and most popular comedy club, the Comics Lounge Comedy Club has played host to many well known comedy figures, including Dave Hughes, Carl Barron and Kitty Flanagan - to name only a small few! The prestigious lounge is only located a mere ten minutes from Melbourne''s CBD making it the perfect night out for anyone visiting the city!\r\n\r\nPurchase tickets to the Comics Lounge Comedy Show and prepare yourself for an evening you''ll never forget - and plenty of jokes too! Make your visit that little bit more special, and opt for a dinner before the show to top it all off! If you''re looking for an experience that is bound to blow your mind, this is the one for you! Book your tickets online today to ensure you don''t miss out!\r\n\r\n*PLEASE NOTE : The rates shown below apply to Mondays and Tuesdays (Subject to change). Higher rates apply to the other days of the week. The exact rate will show up for you once you have selected the date and QTY.', NULL, NULL, '26 Errol St, North Melbourne, VIC, 3051, Australia', '-37.8045744', '144.94960939999999', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/thecomicslounge', 'https://twitter.com/thecomicslounge', 'https://www.instagram.com/thecomicslounge/', 'https://www.thecomicslounge.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/attractions/the-comics-lounge-live-comedy-show', NULL, '610393489488', 'info@thecomicslounge.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:05:37', '2017-03-06 05:35:37', 2, 1, 1, 0),
(335, 610, 'Queen Victoria Market', NULL, 0, '', 'Logo-0306201705053714.jpg', 'Calling all foodies.. this is the tour for you! Famous for its fresh produce, and unique delicacies, where better to experience a food tour than the Queen Victoria Market in Melbourne. Led by your local market guide, you’ll spend two hours discovering the very best foods on offer. Take in the life and atmosphere of the historic marketplace, immersing yourself in the stories and tastes of the seven hectare open-air market. Taste your way around the Meat, Fish and Deli halls, with a complimentary recipe card and gift bag.\r\n\r\nWith a diverse assortment of foods available, taste a range of products from Australian meat and seafood, local cheeses, handmade chocolates and so much more! And when you’re all shopped out, sit back and relax with your complimentary coffee! Starting at 10am Tuesday, Thursday, Friday and Saturdays, discover the hidden gems of the Queen Victoria Market. Purchase your tickets today and get ready for a tour that will please both your eyes and your tastebuds.', NULL, NULL, '513 Elizabeth Street, Melbourne, VIC, 3000, Australia', '-37.8069018', '144.95880699999998', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/QueenVicMarket/', 'https://twitter.com/VicMarket', 'https://www.instagram.com/vicmarket/', 'http://www.qvm.com.au/tours/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/queen-victoria-market-tours/hunt-and-gather-food-tour', NULL, '610393205822', 'marketing@qvm.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:07:14', '2017-03-06 05:37:14', 2, 1, 1, 0),
(336, 611, 'Birdworld Kuranda', NULL, 0, '', 'Logo-0306201705053732.jpg', 'Visit Australia''s true ""home of the birds"" at Birdworld Kuranda in QLD''s tropical north just 30 minutes'' drive from Cairns and 1 hour from Port Douglas for a look at one of the most diverse collections of bird life in the world! This interactive, family oriented ""bird zoo"" located in one of the most popular rainforest areas of Queensland is a must-do for animal lovers visiting the region. With over 75 species of exotic birds from both Australia and abroad, each boasting an array of beautiful colours, you''ll be able to enjoy both the views and having a turn at hand-feeding some of these friendly avian creatures yourself!\r\n\r\nEnjoy not just the company of the birds but the lush rainforest environment as well - take a stroll through the tropical landscape that blends trees with tumbling waterfalls and clean ponds and revel in the sounds of the birds as they frolic and play. A great day out for adults and families and kids alike, Kuranda''s Birdworld is not to be missed - so buy your tickets online today!', NULL, NULL, 'Kuranda Heritage Markets, Rob Veivers Dr, Kuranda, QLD, 4881, Australia', '-16.8193105', '145.6330912', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Birdworld-Kuranda-202419636435309/', 'https://twitter.com/BirdworldQLD', 'https://www.instagram.com/explore/locations/5484344/', 'http://www.birdworldkuranda.com/', 'https://facetag.experienceoz.com.au/en/cairns/attractions/birdworld-kuranda/birdword-kuranda', NULL, '610740939188', 'sales@birdworldkuranda.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:07:32', '2017-03-06 05:37:32', 2, 1, 1, 0),
(337, 612, 'Cairns Harbour Cruises with Optional Lunch or Dinner', NULL, 0, '', 'Logo-0306201705053849.png', 'Enjoy the best of Cairns from the water with your choice of a Cairns a sightseeing and lunch cruise, or sunset dinner cruise on the waters surrounding the city! Hop on board a scenic cruise in the afternoon and explore the waterways and wildlife, or instead head out of an early evening for a dash of romance with the option to add on a 3 course dinner on the waterfront afterwards.\r\n\r\nThese cruises depart daily at 1.30pm and 5.30pm, respectively. You can add a restaurant lunch or dinner to cap off your cruise!', NULL, NULL, 'Reef Fleet Terminal, Cairns, QLD, 4870', '-16.921653', '145.780391', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/cairnsharbourcruises', '', '', 'http://cairnsharbourcruises.com.au/', 'https://facetag.experienceoz.com.au/en/cairns/reef-and-island-cruises/cairns-sunset-cruise', NULL, '610740510444', 'info@cairnsharbourcruises.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:08:49', '2017-03-06 05:38:49', 2, 1, 1, 0),
(338, 613, 'Rap Jumping', NULL, 0, '', 'Logo-0306201705053850.jpg', 'Take part in a truly unique adventure experience in Melbourne - Rap Jumping, a form of ""building abseiling"" that will have you repelling down at speed! Using a technique used by the Australian SAS, rap jumping involves freestyle rope work allowing you to make your way down the side of a building as you control your descent speed for a thrill with a difference. Held in Melbourne''s Southbank district, this fun-filled activity allows you to embrace a challenge while ensuring you''re taken care of by a friendly and enthusiastic operator with an impeccable 100% safety record dating all the way back to 1989.\r\n\r\nIf you''re looking for a physical challenge that will allow you to see Melbourne from an entirely different perspective, put your fears aside and book yourself a Melbourne rap jumping experience online today!', NULL, NULL, '334 City Road, Southbank, Victoria, 3006, Australia', '-37.8278607', '144.95737110000005', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/RapjumpingOfficial/', 'https://twitter.com/rapjumping', 'https://www.instagram.com/Rapjumping/', 'https://rapjumping.com/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/abseiling-rubseiling-forward-run', NULL, '610387379325', 'info@rapjumping.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:08:50', '2017-03-06 05:38:50', 2, 1, 1, 0),
(339, 614, 'Go West Tours', NULL, 0, '', 'Logo-0306201705054033.png', 'Take the ease out of making a trip to the Grampians, with this full day tour from Melbourne! Including morning tea, lunch, hotel transfers and a day filled with sight seeing, you can be sure that this Grampians Day Tour from Melbourne will be a hit! Departing at roughly 8am, you''ll head out from Melbourne for a full day adventure to one of Australia''s most scenery-rich national parks, renowned for its incredible lookout points and authentic examples of Aussie bush nature. Enjoying a range of different outdoors activities, this tour will show you the very best of what the Grampians have to offer.\r\n\r\nThroughout the day you will have the opportunity to enjoy a short hike from the Wonderland Turntable to the spectacular Grand Canyon, an easy stroll to the tranquil Silverband Falls, a trip to the beautiful MacKenzie Falls, spectacular panoramic views from Reeds Lookout and finally amazing views over the Grampians mountain range from Boroka Lookout. With so many magical sights spread across the day you can be sure you''ll experience a day full of wonder and adventure.\r\n\r\nIf you''re an animal lover, you''ll be in for a real treat with guaranteed wildlife sightings possible throughout the journey! Morning tea is held at the Eureka Stockade Memorial in Ballarat, where you''ll be supplied with a delicious cake, as well as coffee, tea or hot chocolate. Lunch will be in the Grampians township of Halls Gap. Tours depart at 8 am and return at around 9pm. Dinner isn''t included however a stop is made on the return journey for you to purchase a meal if you wish. With a day full of adventure, be sure to wear comfortable clothing and shoes so you can make the most of this tour!', NULL, NULL, '10/167 Beavers Road, Northcote, VIC, 3070, Australia', '-37.7667045', '144.9866654', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/gowestmelbourne', 'https://twitter.com/GoWestTours', 'https://www.instagram.com/gowest_tours/?hl=en', 'https://www.gowest.com.au/our-tours/grampians-day-tour/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/grampians-day-tour-from-melbourne', NULL, '610394855290', 'info@gowest.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:10:34', '2017-03-06 05:40:34', 2, 1, 1, 0),
(340, 615, 'Murray River Paddlesteamers Echuca', NULL, 0, '', 'Logo-0306201705054145.png', 'Perfect for both adults and children, enjoy a delectable two course lunch aboard the iconic Emmylou paddle steamer with this 2 hour Murray River cruise. Travelling along one of Australia''s most well known rivers, take in the magnificent views that surround you as you leisurely cruise in luxury. With the skipper providing interesting historical commentary throughout the journey, you''ll discover the rich history of the River Trade as well as the boat. From the moment you board the redgum-fired paddle steamer, you are evident of its long history. With its completely restored 1906 steam engine and its hooting whistle, the boat epitomises charm. Feel the heat from the engine, watch the paddle wheels as they lift in rhythm, you can even take a turn at steering the boat!\r\n\r\nChoose a main and a dessert from the seasonal menu for lunch, a fine glass of red or white wine, beer or soft drink and sit back and engulf yourself in the Murray River. With impressive natural scenery everywhere you look, you''ll discover an abundance of beautiful wildlife that have made this area home. With wheelchair accessibility, this cruise is perfect for those requiring extra assistance. Boarding commences 15 minutes prior to departure from Riverboat Dock at Watson Street, Echuca. Hotel transfers aren''t included. Choose from a 11.00am or 1.15pm and cruise and enjoy a unique cruising experience like no other.', NULL, NULL, '57 Murray Esplanade, Port of Echuca, Echuca, Victoria 3564', '-36.1197141', '144.746815', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/MurrayRiverPaddlesteamers', 'https://twitter.com/MurrayRiverPS', 'https://www.instagram.com/murrayriverpaddlesteamers/', 'https://www.murrayriverpaddlesteamers.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/cruises/murray-river-lunch-cruises/murray-river-emmylou-2-hour-lunch-cruise', NULL, '610354825244', 'info@mrps.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:11:45', '2017-03-06 05:41:45', 2, 1, 1, 0),
(341, 616, 'Aussie Brewery Tours', NULL, 0, '', 'Logo-0306201705054240.png', 'Discover the best of Melbourne''s boutique beer scene with the four following brewery tours. The four different brewery tours showcase the best of the beer business, with behind-the-scenes looks into the beer making process, education on the different kinds of beers and of course, taste testing of a range of different flavours. With four tours to choose from, there is sure to be a tour to suit you, your party and your taste buds. You can choose between various day tours visiting at least four different breweries with taste testings, food inclusions and transport or a night tour visiting a few night owl breweries also including food, transport and a guide. Choose your desired tour below and dive in to the delicious world of Melbourne''s breweries.', NULL, NULL, '38 Jessie St, Cremorne, Victoria, 3121, Australia', '-37.82610349999999', '144.99011070000006', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/AussieBreweryTours', 'https://twitter.com/ausbrewerytours', '', 'http://www.aussiebrewerytours.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/melbourne-breweries-and-cideries-tours', NULL, '611300787039', 'info@aussiebrewerytours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:12:40', '2017-03-06 05:42:40', 2, 1, 1, 0),
(342, 617, 'The Escape Hunt Experience - Melbourne''s Most Unique Escape Room', NULL, 0, '', 'Logo-0306201705054312.png', 'See yourself as some what of a detective? Put your skills to the test with Melbourne''s Escape Hunt Experience! With a selection of different rooms, you could see yourself solving an abduction, a murder or even a disappearance. Each escape the room game runs for 60 minutes and is suitable from between 2 to 5 people. With an abundance of fantastic clues and puzzles to solve throughout your one hour journey, will you have the skills to escape?\r\n\r\nEscape Hunt Melbourne boasts three fantastic rooms, carefully decorated to make the game seem as life like as possible. You will have the opportunity to choose between ''Law and Disorder'', ''Secrets of the Brewery'' or ''Abduction at The Graveyard''. In the Law and Disorder game you and your group will try your luck at solving the disappearance and possibly murder of your detective partner. Opt for the Secrets of The Brewery and you will be in charge of solving a brew masters murder. Lastly choose the Abduction at The Graveyard and you will be tasked with solving a kidnapping case before it''s too late!\r\n\r\nEscape Hunt Melbourne is located at the Shop 3, Ground Floor of 190 Queen Street. They are open from 10am until 10pm, 7 days a week. Put your detective skills to the test and try your luck at solving one of these awesome crimes. Purchase your Escape Hunt tickets below.', NULL, NULL, 'Ground Floor, Shop 3, 190 Queen Street, Melbourne VIC 3000', '-37.8140245', '144.9606843', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/melbourne.escapehunt', 'https://twitter.com/escapehuntmel', 'https://www.instagram.com/escapehuntmel/', 'http://melbourne.escapehunt.com/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/escape-hunt-melbourne/the-es', NULL, '610396001086', 'melbourne@escapehunt.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:13:13', '2017-03-06 05:43:13', 2, 1, 1, 0),
(343, 618, 'Yarra Valley Hot Air Balloon Flights', NULL, 0, '', NULL, 'Soar over Victoria''s verdant Yarra Valley wine region on this 1 hour hot air balloon flight that provides outstanding views of this famous part of Australia, capping off the experience with a delicious buffet champagne breakfast! Departing early in the morning when the air is at its clearest, you''ll join your friendly ballooning guides at a serene launch point surrounded by rolling hills and the iconic vineyards of the Yarra Valley before the balloon inflates, you hop in the spacious basket, and begin to ascend up, up and away until you''re at a suitable height.\r\n\r\nHot air ballooning is an utterly tranquil and peaceful experience that is only further enhanced by the greenery of the Yarra Valley; see the likes of the Yarra River, hills and mountains from thousands of feet above as the sunrise slowly spreads its warm, glowing light over the panorama below. Be sure to bring your camera as you''ll come away with some unforgettable shots of the Yarra Valley that are seen by relatively few people - definitely something to show your friends and family once the flight is complete! Cap it all of with a delicious breakfast served at the popular Rochford Wines winery - served in buffet style and including champagne - for an overall memorable experience. If you''re looking to go ballooning outside Melbourne, be sure to book yourself a Yarra Valley hot air ballooning adventure today and check another item off your bucket list!', NULL, NULL, '1st Floor, 173-175 Swan St,  Richmond, Melbourne, Victoria 3121', '-37.8254569', '144.9975165', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'https://www.globalballooning.com.au/yarra-valley', 'https://facetag.experienceoz.com.au/en/melbourne/activities/yarra-valley-hot-air-balloon-flights/yarra-valley-hot-air-balloon-flight', NULL, '610394285703', 'balloon@globalballooning.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:14:10', '2017-03-06 05:44:10', 2, 1, 1, 0),
(344, 619, 'Moonraker Dolphin Swims', NULL, 0, '', 'Logo-0306201705054443.jpg', 'Get up close to some of Victoria''s friendly marine animals with a dolphin and seal swim and sightseeing cruise departing Sorrento. Taking you to some of the most popular aquatic destinations to spot some of the local wildlife, animal lovers won''t be disappointed. With the option of a morning or afternoon swim, this three hour cruise is sure to fit perfectly in your schedule.\r\n\r\nAs an added bonus, if you''re unfortunate enough to not spot any dolphins, you''re invited to climb aboard another trip. Choose from the morning or afternoon option below to jump into the waters of Victoria and make some new marine friends.', NULL, NULL, '7 George Street, Sorrento, Victoria 3934', '-38.3388265', '144.7398084', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Moonraker-Dolphin-Swims-164579663564733/', '', '', 'http://www.moonrakercharters.com.au/', 'https://facetag.experienceoz.com.au/en/melbourne/cruises/dolphin-swims', NULL, '610359844211', 'info@moonrakercharters.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:14:43', '2017-03-06 05:44:43', 2, 1, 1, 0),
(345, 620, 'Chillout Travel', NULL, 0, '', NULL, 'Spend a day eating and drinking your way around the beautiful Mornington Peninsula sampling some of the region''s best wines, food and sweet treats! Surrounded by stunning scenery of the hinterland as well as the coastline, this tour really is special! Departing the city between 7.30 and 8.30am (operates Thursday, Saturday and Sunday) and returning at approximately 5.30pm, you have plenty of time to explore this wonderful area without feeling rushed.\r\n\r\nAll the food you could possibly need is included in your tour with wine and cider tastings, an assortment of local produce for morning and afternoon tea, a delicious gourmet lunch, cheese and chocolate tastings as well as water throughout the day - you really don''t have to worry about bringing a thing! In addition to the impressive food that awaits, the tour has a professional guide to point out to you many of Mornington Peninsula''s iconic spots along the way. Discover the colourful Beachside Bathing Boxes, lose your breath at Arthurs Seat and take in the beautiful views from the highest point of the Peninsula, enjoy some of the regions finest chocolates and treats at Mornington Peninsula Chocolates and much more!\r\n\r\nFor anyone making the trip to Melbourne, a visit to the Mornington Peninsula is a must! Incorporating all of the must-see sights with some of the best produce on offer, this tour has it all! With transfers also included, you can sit back and enjoy the drive taking in the surroundings along the way. There''s even an onboard coffee machine and fridge meaning you can truly travel in comfort and style! Simply pack your camera, some comfortable clothing to suit the season, walking shoes, and an open mind ready to experience this spectacular part of Victoria!', NULL, NULL, 'Flinders Street, St. Pauls Cathedral, Melbourne, Victoria 3000', '-37.817029', '144.967687', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.chilloutwinetours.com.au/mornington-peninsula-wine-tours/mornington-peninsula-wine-tours-wine-cheese-chocolate-tour-private/', 'https://facetag.experienceoz.com.au/en/melbourne/tours/mornington-peninsula-wine-cheese-and-chocolate-tour/mornington-peninsula-gourmet-tour-from-melbourne', NULL, '610428161662', 'contact@chillouttravel.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:15:44', '2017-03-06 05:45:44', 2, 1, 1, 0),
(346, 621, 'Wild Buggy', NULL, 0, '', 'Logo-0306201705054613.png', 'Have you ever driven over massive rock piles, tyres, cars and logs? Or driven through mud, tunnels, and water obstacles? The Buggy Ride Experience at the Melbourne Driving Adventure park is the chance to do all of this and more!\r\n\r\nGet behind the wheel for the ultimate Wild Buggy experience and drive along the purpose built track. You can either drive with an experienced instructor (suitable for kids and teenagers!) or all by yourself. Take on the crazy hills, rocks, and logs as you drive through mud, water, and dirt! Expect to get down and dirty, because this is one drive of a lifetime!\r\n\r\nAll safety gear is provided. Book today!', NULL, NULL, '433-453, Boundary Rd, Heatherton VIC 3202', '-37.96839', '145.1114156', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/Wild-Buggy-920862827976980/', 'https://twitter.com/WildBuggy', 'https://www.instagram.com/wildbuggy/', 'http://www.wildbuggy.com/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/buggy-experience/buggy-ride-experience', NULL, '611300945328', 'drive@wildbuggy.com', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:16:14', '2017-03-06 05:46:14', 2, 1, 1, 0),
(347, 622, 'Microflite Helicopter Services', NULL, 0, '', NULL, 'Get the ultimate views of Melbourne with a touch of class as you fly above the Melbourne city skyline aboard a Microflite helicopter for unparalleled views of this modern and beautiful city. Taking off from the bank of the famous Yarra River, you will take to the skies to see all of the city''s most popular landmarks from a different perspective. Your flight path will take you past the bustling city and its towering skyline, the Docklands, Albert Park Lake, the Melbourne Cricket Ground (MCG) and the iconic St. Kilda foreshore. Encompassing most of Melbourne''s must-see sights and accompanied by in flight commentary from your experienced and friendly pilot, you will most likely walk away with a new appreciation for this beautiful city.\r\n\r\nThis tour of the Melbourne sites runs for a total of 20 minutes in on of Microflites luxurious red helicopter. Once you''ve landed back on the Yarra, you''ll be given a photo opportunity with your pilot and their famous red helicopter. These Melbourne helicopter tours take off every day of the week, with a minimum of two passengers per flight required for take off. Whether it''s for a special occasion or simply to see Melbourne from the ultimate angle, don''t hesitate to book a Melbourne scenic flight online today!', NULL, NULL, '17b / 60 Siddeley Street, Melbourne, VIC, 3008, Australia', '-37.8226921', '144.9525182', NULL, NULL, NULL, NULL, NULL, NULL, '', '', '', 'http://www.microflite.com.au/tours/melbourne-city-tour/', 'https://facetag.experienceoz.com.au/en/melbourne/activities/scenic-helicopter-flight-over-melbourne-city/melbourne-city-helicopter-flight', NULL, '610385879700', 'info@microflite.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:17:10', '2017-03-06 05:47:10', 2, 1, 1, 0),
(348, 623, 'Jenolan Caves', NULL, 0, '', 'Logo-0306201705054748.jpg', 'Perfect for self-drivers, this Orient Cave Tour allows you to enjoy the wonder of the Jenolan Caves at your own pace. Journey into the heart of the expansive Orient Cave in the centre of the unique Jenolan Caves network on this 1.5 hour tour allowing you to get up close to these amazing formations! Often considered one of the most spectacular caves not only in Australia but the world as a whole, this cavernous and beautiful cave is teeming with the iconic stalagmites and stalactites that are characteristic of the cave network. With a special, modern LED-based lighting system added to the Orient Cave designed to enhance its natural beauty without appearing fake, the cave features a number of expansive chambers giving off all manner of shades of browns and oranges.\r\n\r\nOn this tour you''ll learn all about the geology and history of the caves and their limestone formations, while crossing a series of walkways designed to provide the best possible views of each unique natural sculpture - including the giant Pillar of Hercules, the Jenolan Caves tallest stalagmite measuring 10m in height. With a large number of stairs to climb and narrow passageways to squeeze through, be sure to pack your walking shoes for this incredible adventure. See the ""king"" of the Jenolan Caves network - book your Orient Cave ticket online today! Please note that this tour is of the Orient Cave only and does NOT include return transfers from Sydney.\r\n\r\nTours depart for the Jenolan Caves on a daily basis from Katoomba at 1:30pm and 3:45pm and are located just over an hour from Katoomba.', NULL, NULL, '4655 Jenolan Caves Road, JENOLAN CAVES NSW 2790', '-33.8188351', '150.022589', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/JenolanCaves', 'https://twitter.com/jenolanmagic', 'https://www.instagram.com/jenolancaves/', 'http://www.jenolancaves.org.au/', 'https://facetag.experienceoz.com.au/en/blue-mountains/tours/jenolan-caves-tours/jewels-of-jenolan-cave-pass', NULL, '610263593911', 'reception@jenolancaves.org.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:17:48', '2017-03-06 05:47:48', 2, 1, 1, 0),
(349, 624, 'Blue Mountains Trolley Tours', NULL, 0, '', 'Logo-0306201705054942.jpg', 'Sit back, relax and enjoy a scenic coach and trolley tour to the various hotspots located within the Blue Mountains region of New South Wales. On this day tour you''ll ride to a multitude of great attractions in Katoomba and the Leura World Heritage area with an unlimited number of stops. Along the way you''ll be provided by full, expert commentary of all the highlights of the region from the experienced tour operators to ensure you don''t miss a thing!\r\n\r\nIn addition, you''ll be able to visit Scenic World for some experiences on the great and - you guessed it - scenic rides that the facility offers that will grant you absolutely stunning views of the expansive, impressive landscape that surrounds you on all sides. As this is a tour around Blue Mountains and not to the Blue Mountains, you''ll have to make your own way from Sydney or wherever you are staying. If touring on a weekday it is recommended you take the 7:21am train from Sydney Central Railway Station to Katoomba and the 7:18am on weekends. From Katoomba, the tours depart on a half hour basis from 9:45am until 4:45pm.', NULL, NULL, '76 Main Street, Katoomba NSW 2780', '-33.7126326', '150.3116674', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/bluemountainstrolleytours/', '', '', 'http://www.trolleytours.com.au/', 'https://facetag.experienceoz.com.au/en/blue-mountains/tours/explore-the-blue-mountains-by-trolley/scenic-world-and-blue-mountains-trolley-tour', NULL, '610247827999', 'info@trolleytours.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:19:42', '2017-03-06 05:49:42', 2, 1, 1, 0),
(350, 625, 'Featherdale Wildlife Park', NULL, 0, '', 'Logo-0306201705055127.jpg', 'This Blue Mountains and Featherdale Wildlife Park Tour offers an unforgettable trip around New South Whales'' Blue Mountains region with an experienced guide to entertain you along the way with fascinating local insights. Visit Featherdale Wildlife Park, an award-winning wildlife park and encounter some of Australia’s favourite animals. Here guests can pat a cute Koala and meet other native animals such as Kangaroos and even Crocodiles! Visit the pretty tree-lined streets of Leura Village, a historic township known for its quaint shops and charming heritage buildings and the perfect destination for grabbing a unique souvenir.\r\n\r\nSee spectacular scenery over the Jamison and Megalong Valleys and ride the world’s steepest railway at Scenic World (own expense). After lunch the Blue Mountains tour will visit another historic township of Katoomba and head out to Echo Point to see the famous rock formation of the Three Sisters. (*As of April 2017, this tour will no longer visit Echo Point. Three Sisters will be viewed from alternative vantage point)\r\n\r\nThere are three tour options available; the basic Blue Mountains and Featherdale Wildlife Park Tour, the opportunity to add lunch, or to include a river cruise. Hotel picks ups are available for guests before the 6:50am departure time and will return around 6pm. For those that choose to include the river cruise, you''ll be treated to a delightful return journey along the Parramatta River passing some local highlights including the Sydney Harbour Bridge before docking to disembark at CIrcular Quay and Darling Harbour.\r\n\r\nThis tour of the Blue Mountains features many fantastic photo opportunities packed with wildlife encounters and scenic landscapes so don’t forget your camera! A must for anyone visiting Sydney, book your tour here today!', NULL, NULL, 'Sydney, 217-229 Kildare Road, Doonside, NSW, 2767, Australia', '-33.7658201', '150.88424150000003', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/FeatherdaleWildlifePark', 'https://twitter.com/featherdale', 'https://www.instagram.com/featherdalewildlifepark/?hl=en', 'http://www.featherdale.com.au/', 'https://facetag.experienceoz.com.au/en/blue-mountains/tours/blue-mountains-day-tour-with-entry-to-featherdale-wildlife-park/blue-mountains-and-featherdale-wildlife-park-day-tour', NULL, '610296221644', 'info@featherdale.com.au', NULL, NULL, NULL, '', '', '0.00', 0, 0, 0, '2017-03-06 00:21:27', '2017-03-06 05:51:27', 2, 1, 1, 0),
(351, 626, 'Blue Mountains Explorer Bus', NULL, 0, '', 'Logo-0306201705055327.png', 'The Lyrebird Pass combines all the benefits of the full day Blue Mountains Hop on Hop off Explorer Bus with Scenic World''s Unlimited Discovery Pass. See all the major, breathtaking sightseeing spots in the Blue Mountains with 29 separate stops available PLUS ride the Blue Mountains Skyway, Cableway and Scenic Railway as many times as you want in a day to ensure you get the best possible views of this stunning area teeming with New South Wales wilderness goodness.\r\n\r\nBuses depart on a regular basis between 9:45am and 5pm, to see the full timetable scroll down to the ''More Info'' section below. Get the best of both worlds for the most comprehensive Blue Mountains sightseeing experience - buy the Lyrebird Pass online today.', NULL, NULL, '283 Main St, Katoomba, NSW 2780', '-33.7122143', '150.3116355', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/bmexplorerbus/', 'https://twitter.com/bmexplorerbus', 'https://www.instagram.com/bmexplorerbus/', 'http://www.explorerbus.com.au', 'https://facetag.experienceoz.com.au/en/blue-mountains/tours/blue-mountains-explorer-bus-and-scenic-world-attraction-pass/hop-on-hop-off-blue-mountains-plus-scenic-world-attraction-pass', NULL, '610247821866', 'info@explorerbus.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 0, 2, '2017-03-06 00:23:27', '2017-03-06 05:53:27', 2, 1, 1, 0);
