(375, 664, 'cbus super stadium', NULL, 0, '', 'Logo-0408201706065519.jpg', 'Cbus Super Stadium is one of nine major sporting and entertainment facilities owned and operated by Stadiums Queensland.\r\n\r\nWhat''s On\r\nCheck out upcoming events at Cbus Super Stadium\r\n8 Apr 05:30 PM Gold Coast Titans v Canberra Raiders\r\n23 Apr 06:30 AM Gold Coast Bulletin Fun Run\r\n29 Apr 03:00 PM Gold Coast Titans v Newcastle Knights\r\n20 May 05:30 PM Gold Coast Titans v Sea Eagles\r\n10 Jun 03:00 PM Gold Coast Titans v NZ Warriors', NULL, NULL, 'Skilled Stadium, 22 Stadium Dr, Robina QLD 4226, Australia', '-28.06679668514471', '153.37878497249142', NULL, NULL, NULL, NULL, NULL, NULL, 'https://www.facebook.com/CbusSuperStadium/', 'https://twitter.com/CbusStadium', 'https://www.instagram.com/explore/locations/243608074/cbus-super-stadium/', 'http://www.cbussuperstadium.com.au/', '', NULL, '0756565500', 'info@cbussuperstadium.com.au', NULL, NULL, NULL, '', '', '0.00', 1, 1, 0, '2017-04-08 01:25:19', '2017-04-08 06:55:19', 2, 1, 1, 0),
